(1, 2, 1, 'Set Đồ 2 Món Gồm Áo Sơ Mi Tay Dài Và Quần Dài Plus Size Phong Cách Hong Kong Thời Trang Xuân Thu Cho Nam', 'https://cf.shopee.vn/file/sg-11134201-22110-ig1ga0vkatjvab', '\"Vải / chất liệu: <br />Polyester / Polyester (Sợi Polyester)\nNội dung thành phần: 81% (Bao gồm) -90% (Bao gồm)\nChiều dài tay áo: Dài tay\nChiều dài quần: quần tây\nPhong cách: Phong cách Hồng Kông\nĐộ tuổi sử dụng: Thanh niên (18-25 tuổi)\nMùa niêm yết thời gian: Mùa thu 2022\"', 100, 0.04, '2022-12-02 10:21:21', '2022-12-02 10:21:21'),
(2, 2, 1, 'Bộ Thể Thao Nam Chất Nỉ 4 Màu Trẻ Trung Năng Động Thời Trang Cao Cấp VICERO', 'https://cf.shopee.vn/file/15827a23c85ab57d02195e9a00de725a', '\"Bộ Thể Thao Nam Chất Nỉ 4 Màu Trẻ Trung Năng Động Thời Trang Cao Cấp VICERO\r\nCHÍNH SÁCHLà khách hàng của VICERO, bạn sẽ được:\r\nFREESHIP cho tất cả các đơn hàng từ 150K\r\nCam kết chất lượng và mẫu mã sản phẩm giống với hình ảnh.\r\nHoàn tiền nếu sản phẩm không giống với mô tả.\r\nCam kết được đổi trả hàng trong vòng 2 ngày\r\nHƯỚNG DẪN CÁCH ĐẶT HÀNG\r\nCách chọn size: Shop có bảng size mẫu. Bạn NÊN INBOX, cung cấp chiều cao, cân nặng để SHOP TƯ VẤN SIZE\r\nMã sản phẩm đã có trong ảnh\r\nCách đặt hàng: Nếu bạn muốn mua 2 sản phẩm khác nhau hoặc 2 size khác nhau, để được freeship\"', 159, 7.86, '2022-12-02 10:22:50', '2022-12-02 10:22:50'),
(3, 2, 1, 'Áo sơ mi nam form rộng Pastel Premium phong cách Unisex thời trang', 'https://cf.shopee.vn/file/af932b67d4678a272d81f69e648887ce', '1.THÔNG TIN SẢN PHẨM: Áo Sơ Mi Nam Form Rộng Chất liệu: Vải Lụa Cotton Ưu điểm: Mềm mát, chống nhăn Tuyệt đối, độ bền cao. Màu sắc: Xanh Pastel, Nâu, Đen, Trắng, Xám Kiểu áo: Kiểu trơn, Kiểu Dấu khuy, Kiểu Cổ Vigo • Kiểu Trơn là kiểu áo sơ mi thiết kế phổ thông • Kiểu Giấu Khuy tạo nên 1 phong cách thanh lịch, với hàng khuy được che, ẩn dưới 1 lớp vải • Kiểu Cổ V là một mẫu mới trong năm 2022. Thiết kế cổ Chữ V và được tối giản đi hàng Khuy, tạo phong cách thanh lịch, nhẹ nhàng hơn nữa! Size áo: Rất tuyệt vời vì Size áo có đủ cho mọi cỡ! Từ S đến 2XL cho các bạn từ 45kg đến 80kg!', 135, 4.00, '2022-12-02 10:28:24', '2022-12-02 10:28:24'),
(4, 1, 1, 'Quần Áo Nam Mùa Hè Vincii Đồ Bộ Thể Thao Nam Nữ Cao Cấp Cotton Ngắn Tay Mềm Mịn Thấm Hút Mồ Hôi Set Bộ Nam Ekc Thun', 'https://cf.shopee.vn/file/e59d3ed8d175e784b0fb625b436ce791', 'Thông tin sản phẩm : Quần áo nam mùa hè Vincii đồ bộ thể thao nam nữ cao cấp cotton ngắn tay mềm mịn thấm hút mồ hôi set bộ mặc nhà đi chơi Chất liệu: COTTON 100% loại đẹp, mềm mịn, thoáng mát, co dãn thấm hút mồ hôi, chuẩn hàng VNXK. ( KHÔNG phải loại thun lạnh mỏng dính, giá rẻ ) Size Bộ thể thao nam: Size M: (42-50kg) cao (1m54-1m59) Size L: (51-59kg) cao (1m60-1m65)  Size XL: (60-67kg) cao (1m66-1m73)  Size XXL: (68-78kg) cao (1m74-1m80) Quần áo hè nam bộ thể thao có đầy đủ size từ M tới XXL cho cả nhà lựa chọn nhé ^^  Màu sắc Đồ bộ nam: y hình  Đồ Bộ Nam là phụ kiện thời trang đơn giản nhưng không thể thiếu cho mùa hè. Các anh có thể mặc đồ bộ nam ờ nhà, hay dùng làm đồ thể thao, tập gym rất mát mẻ và thoải mái Trong thế giới thời trang của phái mạnh các set thể thao hay bộ quần áo hè nam luôn chiếm một vị trí quan trọng. quần áo thể thao có cổ hay không cổ hợp dáng người, hợp màu sắc không chỉ khỏe khoắn mà còn rất thời trang mang lại cá tính cho người mặc và thoải mái khi đi dạo phố hoặc hẹn hò bè bạn , những bộ đồ thể thao nam cao cấp đã trở thành người bạn không thể thiếu các chàng. Và nếu bạn cũng đang đi tìm một set bộ cộc tay nam đẹp thời trang thể thể hiện được cá tính của bản thân một cách rõ nét nhất và đang... lạc lối, thì hãy cùng khám phá và cảm nhận trên sản phẩm của Shop Vincii chúng mình nhé  Luôn là nơi cập nhật những xu hướng quần áo thể thao, bộ quần áo nam, quần áo hè nam mới nhất Shop VINCII đã khẳng định vị trí của mình với nhiều bạn trẻ bởi phong cách thời trang sang trọng, thanh lịch nhưng không thiếu sự năng động và cá tính. Khéo léo kết hợp trang phục cùng phụ kiện, bạn dễ dàng mang lại một set đồ hài hòa, thể hiện được cá tính riêng của bạn', 120, 5.06, '2022-12-02 10:28:24', '2022-12-02 10:28:24'),
(5, 1, 1, 'Sét 3 món áo gile + áo phông + quần đùi COH0321', 'https://cf.shopee.vn/file/1fb474d482788088a4ce798d568661e8', 'Sét 3 món áo gile + quần đùi thời trang đẹp rẻ Chất liệu: Cotton tixi Màu sắc: Đen Sản phẩm nữ Free size dưới 1m62, 40-52kg tùy chiều cao Thời Trang Nữ Hari Queen – FB: Xưởng May Xuân Hùng Chuyên sản xuất và cung cấp “SỈ LẺ” các loại quần áo thời trang 4 mùa. Hàng “GIÁ XƯỞNG” không qua trung gian.Cam kết “GIÁ RẺ NHẤT”. Mẫu mã đa dạng ,luôn sẵn SLL.  Nhận đặt may theo yêu cầu.  Sản phẩm bên shop đa số đã đăng “ẢNH THẬT’ các bạn chú ý đọc Thông tin sản phẩm trước khi đặt hàng. Shop chỉ chuyển đơn hàng theo đúng phân loại khách chọn trong đơn .Ngoài ra khách có thay đổi màu sắc hay phân loại,...vui lòng hủy đơn và đặt lại giúp Shop nhé .Shop không hỗ trợ phí đổi trả trong trường hợp này.', 100, 3.36, '2022-12-02 10:33:29', '2022-12-02 10:33:29'),
(6, 1, 1, 'Set Áo Thun Ngắn Tay Cổ Chữ V Quần short Lưng Cao Ống Rộng Thời Trang Nữ', 'https://cf.shopee.vn/file/1069f771e1de22012cd13bfac6e24a41', '\"Bao gồm: 1 * Trên cùng\r\nChất liệu: Cotton + sợi polyester + khác\r\nKích thước: (cm)\r\nÁo sơ mi\r\nS: Chiều dài 41 Ngực 90 Vai 39 Tay áo 28\r\nM: Chiều dài 42 Ngực 94 Vai 40 Tay áo 29\r\nL: Chiều dài 43 Ngực 98 Vai 41 Tay áo 30\r\nXl: Chiều dài 44 Ngực 100 Vai 42 Tay áo 31\r\nQuần short\r\nS: chiều dài quần 37 vòng hông 48 eo 30\r\nM: chiều dài quần 38 hông 50 eo 32\r\nL: chiều dài quần 39 vòng hông 52 eo 34\r\nXl: Dài 40 Vòng hông 54 Eo 36\"', 70, 4.21, '2022-12-02 10:33:29', '2022-12-02 10:33:29'),
(7, 1, 1, 'Sét quần áo thể thao unisex áo thun tay lỡ PuM phối màu đen trắng basic kèm quần short đùi nam nữ năng động', 'https://cf.shopee.vn/file/94754974b2e960a3563ae276dc0a8577', 'Áo thun cổ tròn dễ mặc, thoải mái. Áo thun là một loại trang phục có mặt trong tủ đồ của tất cả mọi người . Nếu chiếc áo sơ mi mang lại vẻ thanh lịch, đứng đắn thì áo thun lại tạo phong cách trẻ trung, cá tính đầy cuốn hút. Form áo ôm vừa vặn thoải mái khi mặc hằng ngày hay các hoạt động mang lại sự tự tin và năng động. Áo trơn màu đơn giản tạo nên nét cá tính, thời thượng Màu sắc đa dạng, cá tính, nổi bật, dễ phối đồ, rất cuốn hút khi mặc vận động thể thao hay đi chơi. Kết hợp hài hòa được với các trang phục từ bụi bặm cá tính như quần short, quần jean đến những phong cách đơn giản cổ điển như quần tây quần kaki,.. Thiết kế thời trang phù hợp xu hướng hiện nay • Kiểu dáng đa phong cách • Đường may tinh tế sắc sảo • Áo thun được thiết kế vể đẹp trẻ trung năng động nhưng không kém phần mạnh mẽ. Áo thun luôn là trang phục được ưa chuộng cho tất cả các mùa trong cả năm. Với chất liệu thun cotton thoải mái thấm hút mồ hôi khi vận động. Áo thun thời trang mẫu mã đa dạng thích hợp đi chơi, du lịch, dạo phố, mặc hằng ngày.', 45, 4.04, '2022-12-02 10:35:14', '2022-12-02 10:35:14'),
(8, 1, 1, 'Set áo thun ngắn tay + quần short IFNICEFUTURE thời trang cho nam', 'https://cf.shopee.vn/file/24d60a9bb71947da8605bf8cc6feecb5', '\"Thương hiệu: IFNICEFUTURE\r\n\r\nThành phần chất liệu: 100% sợi polyester\r\n\r\nPhong cách áo: Áo thun\r\n\r\nChiều dài tay áo: tay áo ngắn\r\n\r\nChiều dài: quần năm phần tư\r\n\r\nMàu sắc: Trắng, xám, đen, Klein xanh lam\r\n\r\nKích thước: M L XL 2XL 3XL 4XL 5XL\r\n\r\nTùy chọn trường hợp bình thường thời gian giao hàng sẽ mất khoảng vài ngày (Không có đơn đặt hàng khẩn cấp.)\r\n\r\nLô hàng được hoãn lại trong các ngày lễ quốc gia đến ngày làm việc\r\n\r\nTất cả các đơn đặt hàng có sẵn đều được lên lịch giao hàng nhanh chóng\r\n\r\nQuý khách thân mến, người bán không thể kiểm soát hậu cần và phân phối nên chúng tôi \"\"Không hỗ trợ đơn hàng gấp\"\". Vui lòng không đặt hàng nếu bạn đang vội.\"', 120, 16.53, '2022-12-02 10:35:14', '2022-12-02 10:35:14'),
(9, 1, 1, 'Bộ Áo Thun + Chân Váy Ngắn Kẻ Sọc Caro Thời Trang Mùa Hè Mới Cho Bé 3-5-8-10-13 Tuổi 15-45KG', 'https://cf.shopee.vn/file/4824e609d659803f2c7d679f371fc4c9', '\"Vải / chất liệu: Loại khác\r\n\r\nNội dung thành phần: 91% (Bao gồm) -95% (Bao gồm)\r\n\r\nPhù hợp cho: Nữ\r\n\r\nThiết kế: in\r\n\r\nSố miếng: Bộ hai mảnh\r\n\r\nChiều dài tay áo: Tay áo ngắn\r\n\r\nChiều dài đáy: Ngắn\r\n\r\nMức độ an toàn: Loại B\r\n\r\nĐộ dày: Bình thường\r\n\r\nMùa áp dụng: Mùa hè\r\n\r\nHọa tiết: Vân kẻ sọc\r\n\r\nPhong cách: Bình thường\r\n\r\nPlacket: áo chui đầu\r\n\r\nChiều cao áp dụng: 90-170cm\r\n\r\nDành cho: Bé gái\r\n\r\nPhát hành năm: 2021\r\n\r\nKích thước tham khảo:\r\n\r\nThông số kỹ thuật 110 Phù hợp với chiều cao (100-110cm) Phù hợp với cân nặng 15-20KG\r\n\r\nThông số kỹ thuật 120 Phù hợp với chiều cao (110-120cm) Phù hợp với cân nặng 20-25KG\r\n\r\n130 Thông số kỹ thuật Phù hợp với chiều cao (120-130cm) Phù hợp với cân nặng 25-30KG\r\n\r\nThông số kỹ thuật 140 Phù hợp với chiều cao (130-140cm) Phù hợp với cân nặng 30-35KG\r\n\r\nThông số kỹ thuật 150 Phù hợp với chiều cao (140-150cm Phù hợp với cân nặng 35-40KG \r\n\r\nThông số kỹ thuật 160 Phù hợp với chiều cao (150-160cm) Phù hợp với cân nặng 40-45KG  \r\n\r\n  \r\n\r\nHướng dẫn mua hàng để mua hàng:\r\n\r\n1.Kích thước mặt hàng được đặt trên bàn có thể gây ra sự khác biệt từ 1-3 cm, xin lưu ý rằng kích thước không phù hợp cho mọi người. Vui lòng kiểm tra chi tiết kích thước trước khi mua.\r\n\r\n2.Màu sắc thực của vật phẩm có thể hơi khác so với hình ảnh hiển thị trên trang web do nhiều yếu tố gây ra như độ sáng của màn hình và độ sáng của ánh sáng khi chụp.\r\n\r\n3.Nếu Có Bất Kỳ Vấn Đề Về Giao Dịch, Vui Lòng Giao Dịch Với Chúng Tôi Để Giải Quyết, Chúc Các Bạn Mua Sắm Vui Vẻ!\r\nSố mặt hàng: DT10271037\"', 140, 8.42, '2022-12-02 10:37:31', '2022-12-02 10:37:31'),
(10, 1, 1, 'Bộ quần áo sơ mi cho bé Beemo, Chất liệu cotton mềm mịn, màu áo nâu kết hợp cùng quần đen vô cùng bảnh trai B087', 'https://cf.shopee.vn/file/d85fcb697d28c9e557eb8fc13182b9d3', '\"Set sơ mi cho bé - Chất liệu cotton mềm mịn, màu áo nâu kết hợp cùng quần đen vô cùng bảnh trai B087\r\n\r\nLƯU Ý : SẢN PHẨM KHÔNG BAO GỒM ÁO THUN TRẮNG BÊN TRONG, QUÝ KHÁCH VUI LÒNG ĐỌC KỸ MÔ TẢ TRƯỚC KHI MUA\r\n\r\n? Chất liệu cực mềm, đường may tỉ mỉ\r\n\r\n? Thiết kế áo sơ mi điểm nhấn túi hộp kết hợp quần đen cực công tử\r\n\r\n? Bé có thể mặc đi học đi chơi đều cực đẹp các mẹ nha\r\n\r\n\r\n\r\nXuất Xứ : BEEMO- Hàng Việt Nam Chất Lượng Cao\r\n\r\nBẢNG CHỌN SIZE CHO BÉ :\r\n\r\n \r\n\r\nSize 80 : 9-11kg\r\n\r\n Size 90 : 11-13kg\r\n\r\n Size 100 : 13-15.5kg\r\n\r\n Size 110 : 16-17.5kg\r\n\r\n Size 120 : 18-20.5kg\r\n\r\n Size 130 : 21-23kg\r\n\r\nBằng kinh nghiệm của mình , thời trang BEEMO luôn hướng tới cảm giác thoải mái nhất cho bé . Nguyên liệu sản xuất đều được lựa chọn kĩ càng , chất lượng nhất. \r\n\r\nBEEMO luôn đặt niềm tin của khách hàng lên hàng đầu và mong muốn sẽ được phục vụ quý khách hàng trong những lần mua sắm tiếp theo\"', 90, 7.82, '2022-12-02 10:37:31', '2022-12-02 10:37:31'),
