(15, 1, 2, 'Dép a.d.i.d.a.s Aqua Quai Ngang Slip On Đi Mưa Nhanh Khô Càng Mang Lâu Càng Êm Chân', 'https://cf.shopee.vn/file/60b7d297a7fb674bf0613002b40dd849', '- Lão làng và thâm niên trong làng chống nước và siêu bền theo thời gian . \r\n\r\n( Nếu Chân Mập Bề Ngang nên lấy lớn hơn 1 Size dùm Sốp nhé Khách Iu )\r\n\r\n___ Càng Mang Càng Êm\r\n\r\n- Chất liệu EVA nguyên miếng , vừa êm, vừa tiện lợi, đi mùa mưa là hết bài luôn hổng lo hôi chân và rất Nhanh Khô .\r\n\r\n____ Mẫu UNISEX phù hợp mọi lứa tuổi .\r\n\r\n- Chủ động Inbox để được tư vấn Size - Hỗ trợ đổi Size hoàn toàn Miễn Phí', 400, 13.98, '2022-12-02 10:42:56', '2022-12-02 10:42:56'),
(16, 1, 2, 'Dép đi trong nhà AYUER hình cá mập 4cm', 'https://cf.shopee.vn/file/e657eab6aa3847d5568c8292faeec9e5', 'Thương hiệu :atetime\r\n\r\nNgười bán đảm bảo: 100% thương hiệu sản phẩm mới\r\n\r\nDanh mục sản phẩm: Dép đi trong nhà\r\n\r\nChức năng: thoáng khí / chống mài mòn / trượt / khô nhanh\r\n\r\nChất liệu: EVA\r\n\r\nMàu: Xám núi, Xám khói, Xanh khói, Xanh bạc hà, Xanh ô liu, Vàng chanh, Màu be ngà, Hồng công chúa, Tím rượu, Cam rực rỡ\r\n\r\n(Các Thiết bị khác nhau có màu sắc khác nhau. Dựa trên sản phẩm thực tế)\r\n\r\nĐối tượng áp dụng: phụ nữ và nam giới\r\n\r\nKích thước \r\n\r\n34/35 = 22cm\r\n\r\n36/37 = 23cm\r\n\r\n38/39 = 24cm\r\n\r\n40/41 = 25cm\r\n\r\n42/43 = 26cm\r\n\r\n44/45 = 27cm', 50, 6.08, '2022-12-02 10:51:53', '2022-12-02 10:51:53'),
(17, 1, 2, 'Giày Thể Thao AF1 Khoai Môn Trắng Kem,Giày air Force Cao Cấp mẫu mới dành cho nam nữu Full Size-Top1s', 'https://cf.shopee.vn/file/sg-11134201-22100-1odhzu22aajv67', ' UY TÍN Là thứ tồn tại duy nhất\r\n\r\n Số lượng hàng gửi đi nhiều nên vẫn sẽ có đôi bị lỗi nên mong các bạn thông cảm , Bên mình hỗ trợ đổi trả hàng free trong các trường hợp như này ạ .\r\n\r\n Ảnh này bên mình tự chụp các bạn có thể vào sản phẩm để xem thêm các ảnh chi tiết .\r\n\r\n Hàng bên mình là hàng sẵn full size , các bạn có thể cập nhật ở bên trên mình có up đó\r\n\r\n Shop mình nhập hàng tận xưởng nên giá cực kì rẻ so với các shop khác , mà chất lượng lại ổn định hơn.\r\n\r\n Nhận hàng các bạn được kiểm tra hàng trước khi thanh toán . Vì quy định của shopee không cho xem trước nên 1 số bưu tá không cho xem . Nên các bạn bảo bưu tá điện thoại cho mình mình xác nhận cho xem là các bạn sẽ được kiểm hàng nên yên tâm\r\n\r\n Các bạn có 24h để ấn đổi hoặc trả hàng nếu các bạn nhận hàng lỡ không thích thì vẫn có thể được đổi hàng nhé .', 70, 8.42, '2022-12-02 10:51:53', '2022-12-02 10:51:53'),
(18, 1, 2, 'Giày thể thao nam năng động trẻ trung chất liệu vải thể thao , đế cao su non đi rất mềm và êm chân - Mã sản phẩm: B601', 'https://cf.shopee.vn/file/05836af541f25fcfcb35738488532e24', 'THÔNG TIN SẢN PHẨM: Giày thể thao nam năng động trẻ trung chất liệu vải thể thao , đế cao su non đi rất mềm và êm chân - Mã sản phẩm: B601\r\n Đến với Shop bạn hoàn toàn có thể yên tâm hàng đảm bảo chất lượng, tốt nhất trong tầm giá.( không có hàng lỗi, hàng thứ cấp )\r\n Chất liệu: vải bò thể thao cao cấp mềm mại, thoáng khí bền đẹp theo thời gian\r\n Đế giày được làm bằng chất liệu cao su đúc nguyên khối chắc chắn có khắc họa tiết để tăng độ ma sát, chống trơn trượt.\r\n Size: 39 - 44\r\n ĐẶC ĐIỂM SẢN PHẨM\r\n Giày dễ phối đồ thích hợp cho các hoạt động đi lại hàng ngày, chạy bộ\r\n Mũi Giày tròn, đế cao su tổng hợp, xẻ rãnh tạo cảm giác thoải mái khi đi\r\n\r\nHƯỚNG DẪN BẢO QUẢN\r\nĐể giày ở nơi khô ráo thoáng mát để giữ giày được bền đẹp hơn\r\nVệ sinh giày, dùng khăn hay bàn trải lông mềm để chải sạch giày\r\nCó thể giặt giày cùng với chất tẩy rửa nhẹ\r\nKHUYẾN CÁO\r\nKhông dùng hóa chất hay bột giặt có hoạt tính tẩy rửa mạnh\r\nKhông dùng bàn chải cứng để vệ sinh giày sẽ làm hư \r\nKhông đi mưa ngâm nước lâu, không phơi giày trực tiếp dưới ngoài trời nắng gắt', 140, 6.33, '2022-12-02 10:55:22', '2022-12-02 10:55:22'),
(19, 1, 2, 'Giày cao gót vuông 7p hở mũi quai chéo vòng cổ hột vuông __LZ001', 'https://cf.shopee.vn/file/0fc621f6627ac8ea232f9aa9d0956723', 'GIÀY CAO GÓT VUÔNG 7p HỞ MŨI QUAI CHÉO VÒNG CỔ HỘT VUÔNG __LZ001\r\nThông tin sản phẩm:\r\n Sản phẩm: Giày cao gót vuông 7p hở mũi quai chéo vòng cổ hột vuông __LZ001	\r\n Chất liệu da: Da nhung\r\n Kiểu mũi giày: Mũi tròn	\r\n Màu: Đen, Xám, Hồng, Kem, Xanh rêu\r\n Thời gian xuất hàng: 1 Ngày\r\n Nơi sản xuất: Việt Nam\r\n Thời gian bảo hành: 3 tháng\r\n\r\nBẢNG CHỌN SIZE:\r\nSize 35: Chiều dài từ 22 đến 22.4cm \r\nSize 36: Chiều dài từ 22.5 đến 22.9cm \r\nSize 37: Chiều dài từ 23 đến 23.4cm \r\nSize 38: Chiều dài từ 23.5 đến 23.9cm \r\nSize 39: Chiều dài từ 24 đến 24.4cm\r\n\r\nHướng dẫn bảo quản: \r\n- Bảo quản giày ở nơi khô ráo, thoáng mát để giữ gìn chất lượng giày ở mức tốt nhất. \r\n- Lau chùi giày cao gót thường xuyên bằng vải kết hợp nước lau giày để tránh bụi bẩn bám vào.', 70, 5.27, '2022-12-02 10:55:22', '2022-12-02 10:55:22'),
