(27, 1, 3, '[MÁY ĐẸP 99%] Điện thoại Samsung j2 prime g532 (1,5/8GB) Máy cũ- Hàng chính hãng', 'https://cf.shopee.vn/file/sg-11134201-22100-p4s296x2p8iv86', 'Sự lựa chọn quá hợp lý cho học sinh sinh viên,học online, chơi game nhẹ ===\r\nLoại điện thoại. SmartPhone. cũ 99 %\r\nLoại Sim. Micro SIM.\r\nKích Thước Màn Hình. 5.0inch. PLS TFT LCD. Độ phân giải. ...\r\nHệ điều hành. Android 6.0 (Marshmallow) Tốc độ CPU. 1.4GHz. ...\r\nCamera Trước. 5.0MP. Camera Sau. 8.0MP. ...\r\nBộ nhớ trong. 8GB. Thẻ nhớ ngoài. ...\r\nGPRS/EDGE. Có Bluetooth. ...\r\nXem Phim. MP4,3GP, H.263, H.264(MPEG4-AVC) Nghe Nhạc.\r\nbảo hành 1 tháng', 400, 2.93, '2022-12-02 15:14:52', '2022-12-02 15:14:52'),
(28, 1, 3, 'Điện Thoại Samsung Galaxy A03 (3GB/32GB)- Hàng Chính Hãng', 'https://cf.shopee.vn/file/97f33f4485f8dfb37589b92d69a7fedc', 'Màn hình lớn hơn, trải nghiệm nhiều hơn\r\n\r\n\r\n\r\nThưởng thức nhiều nội dung cực mãn nhãn với màn hình tràn viền Infinity-V 6.5\".\r\n\r\n\r\n\r\nCụm Camera cao cấp bậc nhất trong phân khúc\r\n\r\n\r\n\r\nBộ đôi Camera sau 48MP sở hữu độ phân giải cao bậc nhất, cho chất lượng hình ảnh rõ nét cả khi phóng to.\r\n\r\n\r\n\r\nTrải nghiệm không gián đoạn\r\n\r\n\r\n\r\nDung lượng pin lớn 5,000mAh cho thời gian sử dụng liên tục lên đến 2 ngày.\r\n\r\n\r\n\r\nTốc độ tối ưu, lưu trữ tối đa\r\n\r\n\r\n\r\nVi xử lý 8 nhân Octa-core tối ưu tích hợp cùng RAM 3GB/4GB phù hợp cho nhiều nhu cầu sử dụng.\r\n\r\n\r\n\r\n\r\n\r\nVượt xa trải nghiệm nghe thông thường với Dolby Atmos\r\n\r\n\r\n\r\nCông nghệ Dolby Atmos cho bạn thưởng thức trọn vẹn mọi âm thanh được truyền tải như thể mọi thứ đang xảy ra xung quanh.\r\n\r\n\r\n\r\nThuận tiện hơn tối ưu hơn\r\n\r\n\r\n\r\nĐược tối ưu hoá cho mọi kích thước màn hình, One UI Core trực quan cho phép bạn dễ dàng tập trung vào những gì quan trọng.\r\n\r\n\r\n\r\nGalaxy A03\r\n\r\n\r\n\r\nMàu sắc: Xanh dương, Đen và Đỏ\r\n\r\n\r\n\r\nBộ vi xử lý: Vi xử lý Octa-core\r\n\r\n\r\n\r\nHiển thị : \r\n\r\nMàn hình HD+  Infinity-V 6,5inch\r\n\r\nĐộ phân giải  720 x 1600 (HD+)\r\n\r\nCông nghệ màn hình : PLS TFT LCD\r\n\r\n\r\n\r\nCamera\r\n\r\nCamera sau:\r\n\r\nChính 48.0 MP & Phụ 2.0 MP\r\n\r\nCamera trước:\r\n\r\n5.0 MP\r\n\r\n\r\n\r\nBộ nhớ: RAM 3 GB ROM 32GB\r\n\r\nHỗ trợ thể nhớ ngoài: MicroSD, hỗ trợ tối đa 1 TB\r\n\r\nSim: 2 Nano SIM\r\n\r\nPin: 5000mAh\r\n\r\nBộ sản phẩm gồm: Hộp, Sách hướng dẫn, Cây lấy sim, Cáp microUSB, Củ sạc rời đầu Type A\r\n\r\n\r\n\r\nThông tin bảo hành: Bảo hành chính hãng 12 tháng.  \r\n\r\nTrung tâm bảo hành vui lòng tham khảo đường link: https://www.samsung.com/vn/support/service-center/  Hotline: 1800-588-855  ', 500, 127.50, '2022-12-02 15:14:52', '2022-12-02 15:14:52'),
(29, 1, 3, 'Điện thoại smartphone VIVO Y81 ram 4G/64G chơi game mượt zalo/fb tiktok cực êm- BH 1 năm', 'https://cf.shopee.vn/file/4a09a65188f8804b08f0a5c9ad5c7727', 'Thông số kỹ thuật chi tiết:\r\nMàn hình:\r\n– Công nghệ màn hình: IPS LCD\r\n– Độ phân giải: HD+ (720 x 1520 Pixels)\r\n– Màn hình rộng: 6.22″\r\n– Mặt kính cảm ứng: Mặt kính cong 2.5D\r\nCamera sau\r\n– Độ phân giải: 13 MP\r\n– Quay phim: FullHD 1080p@30fps\r\n– Đèn Flash: Có\r\nTính năng:\r\n– Tự động lấy nét (AF)\r\n– Chạm lấy nét\r\n– HDR\r\n– Toàn cảnh (Panorama)\r\n– Làm đẹp (Beautify)\r\n– Chuyên nghiệp (Pro)\r\nCamera trước\r\n– Độ phân giải: 5 MP\r\nTính năng:\r\n– Góc rộng (Wide)\r\n– Làm đẹp\r\n– HDR\r\n– Tự động lấy nét (AF)\r\nHệ điều hành & CPU\r\n– Chip xử lý (CPU):\r\n– MediaTek MT6762 8 nhân (Helio P22)\r\n– Tốc độ CPU:\r\n– 2.0 GHz\r\nBộ nhớ & Lưu trữ\r\n– RAM: 3 GB\r\n– Bộ nhớ trong: 32 GB\r\n– Bộ nhớ còn lại (khả dụng) khoảng: Khoảng 20 GB\r\n– Thẻ nhớ: MicroSD, hỗ trợ tối đa 256 GB\r\n– Danh bạ: 3000 số\r\nKết nối\r\n– Mạng di động: Hỗ trợ 4G\r\n– SIM: 2 Nano SIM\r\n– Wifi: Wi-Fi 802.11 a/b/g/n, DLNA, Wi-Fi Direct, Wi-Fi hotspot\r\nGPS:\r\n– BDS\r\n– GPS\r\n– GLONASS\r\nBluetooth:\r\n– v4.2A2DP\r\n– Cổng kết nối/sạc: Micro USB\r\n– Jack tai nghe: 3.5 mm\r\n– Kết nối khác: OTG\r\nPin & Sạc\r\n– Loại pin: Li-Ion\r\n– Dung lượng pin: 3260 mAh\r\n– Công nghệ pin: Siêu tiết kiệm pin, Tiết kiệm pin\r\nTiện ích\r\n– Bảo mật nâng cao: Mở khoá khuôn mặt\r\n– Tính năng đặc biệt:\r\nChạm 2 lần sáng màn hình\r\nChạm 2 lần tắt màn hình\r\nChặn cuộc gọi\r\nChặn tin nhắn\r\nỨng dụng kép (Nhân bản ứng dụng)\r\nThu nhỏ màn hình sử dụng một tay\r\nVẽ lên màn hình để mở nhanh ứng dụng\r\n– Radio: Có\r\n– Xem phim: 3GP, MP4, AVI, WMV\r\n– Nghe nhạc: MP3, WAV\r\nThông tin chung\r\n– Thiết kế: Nguyên khối\r\n– Chất liệu:\r\nKhung & Mặt lưng nhựa\r\nKích thước, khối lượng:\r\n– Nặng 146.5 g\r\n– Thời điểm ra mắt: tháng 6 năm  2018\r\nSản phẩm hiện được phân phối là sản phẩm like new với vỏ ngoài của máy mới 99%. 2tekvn cam kết sản phẩm và chất lượng đúng với mô tả, hỗ trợ quý khách hàng đổi trả trong vòng 7 ngày nếu có lỗi do NSX, thời gian bảo hành 12tháng kể từ ngày nhận máy.', 400, 47.60, '2022-12-02 15:18:11', '2022-12-02 15:18:11'),
(30, 1, 3, 'Điện Thoại Xiaomi Redmi 9A 2GB/32GB - Hàng Chính Hãng', 'https://cf.shopee.vn/file/86a41c87cf8b8e1cde7ecd47befc9a1d', 'Điện Thoại Xiaomi Redmi 9A 2GB/32GB - Hàng Chính Hãng\r\nBộ sản phẩm bao gồm: Thân máy, sạc, cáp USB, sách hướng dẫn.\r\n\r\nCamera\r\n\r\n- 13MP camera chính\r\n\r\n- Khẩu độ ƒ/2.2, AF\r\n\r\n- Đèn flash đơn\r\n\r\n- Chế độ kính vạn hoa\r\n\r\n- 5MP camera trước\r\n\r\n- Khẩu độ ƒ/2.2\r\n\r\n- Chế độ chân dung\r\n\r\n\r\n\r\nThiết kế\r\n\r\n- Màn hình giọt nước 6.53\"HD\r\n\r\n- Độ phân giả 720x1600\r\n\r\n- Tỉ lệ 20:9\r\n\r\n- Màn hình độ sáng 400nit\r\n\r\n- Độ tương phản 1500:1\r\n\r\n- Màn hình lọc ánh sáng xanh chứng nhận TUV Rheinland\r\n\r\n- Chế độ đọc sách\r\n\r\n- Chế độ thao tác toàn màn hình\r\n\r\n- Kích thước: 164.9x77.07x9.0mm\r\n\r\n- Trọng lượng: 194g\r\n\r\n- Màu sắc: Xám Hoa Cương, Xanh Da Trời, Xanh Khổng Tước\r\n\r\n\r\n\r\nHiệu năng\r\n\r\n- MediaTek Helio G25\r\n\r\n- Tiến trình 12nm\r\n\r\n- 8 nhân tốc độ lên tới 2.0GHz\r\n\r\n- Ram LPDDR4x - Bộ nhớ công nghệ eMMMC5.1\r\n\r\n- 2GB ram + 32GB bộ nhớ\r\n\r\n\r\n\r\nPin và cổng sạc\r\n\r\nPin 5000mAh\r\n\r\n- Hỗ trợ sạc nhanh 10W\r\n\r\n- Sạc kèm trong hộp 10W\r\n\r\n\r\n\r\nKết nối\r\n\r\n- Cổng tai nghe 3.5mm\r\n\r\n- Cổng mirco USB\r\n\r\n- 4G kép\r\n\r\n- Băng tần :\r\n\r\n- GSM: B2/3/5/8\r\n\r\n- WCDMA: B1/2/4/5/8\r\n\r\n- FDD-LTE: B1/2/3/4/5/7/8/20/28\r\n\r\n- TDD-LTE: B38/40/41(2535-2655MHz)\r\n\r\n- Hai sim hai sóng + thẻ nhớ\r\n\r\n- mở rộng lên đến 512GB\r\n\r\n\r\n\r\nBảo mật\r\n\r\n- Mở khóa bằng khuôn mặt\r\n\r\nĐiện Thoại Xiaomi Redmi 9A 2', 1000, 85.38, '2022-12-02 15:18:11', '2022-12-02 15:18:11'),
(31, 1, 3, 'điện thoại Oppo A1 2sim ram 4G/64G mới Chính hãng, Chiến PUBG/Free Fire mướt - BNN 04', 'https://cf.shopee.vn/file/d89bcd5ac9bda5b1e75fa20c586b87df', 'Thông số kỹ thuật OPPO A1\r\n•	Màn hình: IPS LCD, 5.7\", HD+\r\n•	Hệ điều hành: ColorOS 3.2 (Android 7.1)\r\n•	Camera sau: 13 MP\r\n•	Camera trước: 8 MP\r\n•	CPU: MediaTek 8 nhân\r\n•	RAM: 3 GB – 4GB\r\n•	Bộ nhớ trong: 32 GB - 64GB\r\n•	Thẻ nhớ: MicroSD, hỗ trợ tối đa 256 GB\r\n•	Thẻ SIM:2 Nano SIM, Hỗ trợ 4G\r\n•	Dung lượng pin: 3180 mAh\r\n•	Máy mới, Full Zalo, Facebook, Youtube, nghe gọi tốt, đặc biệt chơi Liên Quân-PUBG-Free Fire mướt\r\n•	- Hotline: 0962.121416 A Hùng\r\n•	- Địa chỉ: 96A đường số 17, phường 11, quận Gò Vấp \r\n•	(ngay ngã 4 Quang Trung - Thống Nhất, từ ngã 5 Chuồng Chó đi theo đường Quang Trung gặp ngã 4 Thống Nhất - Quang Trung thì rẻ trái vào đường Thống Nhất, đi hết đường Thống Nhất là đường số 17, shop nằm sau lưng Vật liệu xây dựng Thành Đạt)\r\n•	Trân Trọng !', 700, 331.50, '2022-12-02 15:21:27', '2022-12-02 15:21:27'),
(32, 1, 3, 'Điện Thoại Nokia 6303 Chính Hãng Vỏ Thép Bảo Hành 12 Tháng', 'https://cf.shopee.vn/file/d4fd6f9e7e9067779767a5a3d590d4fb', 'Điện thoại Nokia 6303 nhỏ gọn đa chức năng giải trí\r\nMáy có thiết kế nhỏ gọn, hỗ trợ các tính năng giải trí đa dạng, ra mắt vào những năm 2009 sản phẩm này với giá 3,2 triệu đồng. Hãy cùng Alofone ngắm lại các chức năng của sản phẩm này.\r\nKích thước 108.8 x 46.2 x 11.7 mm, 57 cc, trọng lượng chỉ nặng 96 gam máy thiết kế thời trang nhỏ gọn cầm chắc trong lòng bàn tay, Nokia 6303 chạy trên giao diện S40 hệ điều hành Symbian khá dễ sử dụng, mặt trước là màn hình 2,2 inch, 16 triệu màu.\r\n\r\nNokia 6303 Một số chức năng nổi trội gồm Camera chính 3.15 MP, 2048×1536 pixels, tự động lấy nét, 2 đèn LED, bộ nhớ trong 17 MB hỗ trợ thẻ nhớ ngoài microSD (TransFlash) lên tới 4GB. Điện thoại nokia cổ này được trang bị viên pin BL-5CT dung lượng chuẩn Li-Ion 1050 mAh cho thời gian đàm thoại liên tục được 7h.\r\n\r\nTHÔNG SỐ KỸ THUẬT CỦA NOKIA 6303\r\nMẠNG 2G	GSM 900 / 1800 / 1900\r\nRa mắt	Tháng 05 năm 2009\r\nKích thước	108.8 x 46.2 x 11.7 mm, 57 cc\r\nTrọng lượng	96 g\r\nLoại	Màn hình TFT, 16 triệu màu\r\nKích thước	240 x 320 pixels, 2.2 inches\r\nHệ điều hành	Nokia S.40\r\nBộ nhớ trong	17 MB\r\nKhe cắm thẻ nhớ	microSD (TransFlash), hỗ trợ lến đến 4GB\r\nCamera chính	3.15 MP, 2048x1536 pixels, tự động lấy nét, 2 đèn LED\r\nKiểu chuông	Báo rung; Nhạc chuông đa âm sắc, MP3\r\nJack audio 3.5mm	Có\r\nTin nhắn	SMS, MMS, Email, IM\r\nTrình duyệt	WAP 2.0/xHTML\r\nJava	Có, MIDP 2.1\r\nPin chuẩn	Pin chuẩn, Li-Ion 1050 mAh (BL-5CT)\r\nChờ	Lên đến 450 giờ\r\nĐàm thoại	Lên đến 7 giờ\r\nNgôn ngữ	Có tiếng Việt\r\n \r\nCAM KẾT CỦA SHOP VỀ SẢN PHẨM \r\nĐiện thoại chính hãng nokia 100%\r\nBảo Hành 12 tháng \r\nCó nhân viên thử hàng trước khi đóng gói đến tay khách hàng \r\nĐóng gói nhiều lớp bảo vệ gồm 1 hộp bìa cứng chắc và 1 lớp nilon chống sốc\r\nCó 1 thẻ bảo hành 12 tháng ghi rõ địa chỉ cửa hàng làm việc suốt 8 năm qua\r\n để yên tâm kể cả khi hết hạn bảo hành shop vẫn hỗ trợ cho tất cả quý khách đã mua hàng tại Shop \r\nPin Sài 2-3 ngày đóng dấu mộc để phân biệt với loại pin rẻ tiền hiện đang bày bán tràn lan trên thị trường.\r\nBảo hành 12 tháng cả máy và pin cho quý khách', 490, 21.25, '2022-12-02 15:21:27', '2022-12-02 15:21:27'),
(33, 1, 3, 'Apple iPhone 14 128GB', 'https://cf.shopee.vn/file/0982de1d517eed28495a9bbcaced5881', 'iPhone 14. Với hệ thống camera kép tiên tiến nhất từng có trên iPhone. Chụp những bức ảnh tuyệt đẹp trong điều kiện từ thiếu sáng đến dư sáng. Phát hiện Va Chạm,1 một tính năng an toàn mới, thay bạn gọi trợ giúp khi cần kíp.\r\n\r\nTính năng nổi bật\r\n•        Màn hình Super Retina XDR 6,1 inch2\r\n•        Hệ thống camera tiên tiến cho chất lượng ảnh đẹp hơn trong mọi điều kiện ánh sáng\r\n•        Chế độ Điện Ảnh nay đã hỗ trợ 4K Dolby Vision tốc độ lên đến 30 fps\r\n•        Chế độ Hành Động để quay video cầm tay mượt mà, ổn định\r\n•        Công nghệ an toàn quan trọng - Phát Hiện Va Chạm1 thay bạn gọi trợ giúp khi cần kíp\r\n•        Thời lượng pin cả ngày và thời gian xem video lên đến 20 giờ3\r\n•        Chip A15 Bionic với GPU 5 lõi để đạt hiệu suất siêu nhanh. Mạng di động 5G siêu nhanh4\r\n•        Các tính năng về độ bền dẫn đầu như Ceramic Shield và khả năng chống nước5\r\n•        iOS 16 đem đến thêm nhiều cách để cá nhân hóa, giao tiếp và chia sẻ6\r\n\r\nPháp lý\r\n1SOS Khẩn Cấp sử dụng kết nối mạng di động hoặc Cuộc Gọi Wi-Fi.\r\n2Màn hình có các góc bo tròn. Khi tính theo hình chữ nhật chuẩn, kích thước màn hình theo đường chéo là 6,06 inch. Diện tích hiển thị thực tế nhỏ hơn.\r\n3Thời lượng pin khác nhau tùy theo cách sử dụng và cấu hình; truy cập apple.com/batteries để biết thêm thông tin.\r\n4Cần có gói cước dữ liệu. Mạng 5G chỉ khả dụng ở một số thị trường và được cung cấp qua một số nhà mạng. Tốc độ có thể thay đổi tùy địa điểm và nhà mạng. Để biết thông tin về hỗ trợ mạng 5G, vui lòng liên hệ nhà mạng và truy cập apple.com/iphone/cellular.\r\n5iPhone 14 có khả năng chống tia nước, chống nước và chống bụi. Sản phẩm đã qua kiểm nghiệm trong điều kiện phòng thí nghiệm có kiểm soát đạt mức IP68 theo tiêu chuẩn IEC 60529 (chống nước ở độ sâu tối đa 6 mét trong vòng tối đa 30 phút). Khả năng chống tia nước, chống nước và chống bụi không phải là các điều kiện vĩnh viễn. Khả năng này có thể giảm do hao mòn thông thường. Không sạc pin khi iPhone đang bị ướt. Vui lòng tham khảo hướng dẫn sử dụng để biết cách lau sạch và làm khô máy. Không bảo hành sản phẩm bị hỏng do thấm chất lỏng. \r\n6Một số tính năng không khả dụng tại một số quốc gia hoặc khu vực. \r\n\r\nThông số kỹ thuật\r\nTruy cập apple.com/iphone/compare để xem cấu hình đầy đủ. \r\n\r\n\r\n\r\nBộ sản phẩm bao gồm: \r\n•        Điện thoại \r\n•        Dây sạc\r\n•        HDSD Bảo hành điện tử 12 tháng.\r\n\r\nThông tin bảo hành:\r\nBảo hành: 12 tháng kể từ ngày kích hoạt sản phẩm.\r\nKích hoạt bảo hành tại: https://checkcoverage.apple.com/vn/en/\r\n\r\nHướng dẫn kiểm tra địa điểm bảo hành gần nhất:\r\nBước 1: Truy cập vào đường link https://getsupport.apple.com/?caller=grl&locale=en_VN \r\nBước 2: Chọn sản phẩm.\r\nBước 3: Điền Apple ID, nhập mật khẩu.\r\nSau khi hoàn tất, hệ thống sẽ gợi ý những trung tâm bảo hành gần nhất.', 560, 1062.08, '2022-12-02 15:24:09', '2022-12-02 15:24:09'),
(34, 1, 3, 'Apple iPhone 11 128GB', 'https://cf.shopee.vn/file/e891e6f900bf8b1760a343231e31f726', 'Lưu ý: Các sản phẩm sản xuất sau tháng 10/2020 sẽ không có củ sạc và tai nghe trong bộ sản phẩm.\r\n\r\nQuay video 4K, chụp ảnh chân dung tuyệt đẹp và chụp ảnh phong cảnh rộng với hệ thống camera kép hoàn toàn mới. Chụp ảnh tuyệt đẹp trong điều kiện ánh sáng yếu với chế độ Ban Đêm. Xem ảnh, video và chơi game màu sắc chân thực trên màn hình Liquid Retina 6.1 inch (3). Trải nghiệm hiệu năng chưa từng có với chip A13 Bionic cho game, thực tế ảo tăng cường (AR) và chụp ảnh. Làm được nhiều việc hơn và sạc ít hơn với thời lượng pin bền bỉ cả ngày (2). Và bớt phải lo lắng nhờ khả năng chống nước ở độ sâu tối đa 2 mét trong vòng 30 phút (1).\r\n\r\nTính năng nổi bật \r\n•	Màn hình Liquid Retina HD LCD 6.1 inch (3)  \r\n•	Chống nước và chống bụi (chống nước ở độ sâu 2 mét trong vòng tối đa 30 phút, đạt mức IP68) (1) \r\n•	Hệ thống camera kép 12MP với camera Ultra Wide và Wide; chế độ Ban Đêm, chế độ Chân Dung và video 4K tốc độ tối đa 60fps \r\n•	Camera trước TrueDepth 12MP với chế độ Chân Dung, quay video 4K và quay video chậm \r\n•	Xác thực bảo mật với Face ID \r\n•	Chip A13 Bionic với Neural Engine thế hệ thứ ba \r\n•	Khả năng sạc nhanh\r\n•	Sạc không dây (4) \r\n•	iOS 13 cùng với chế độ Dark Mode, các công cụ chỉnh ảnh và quay video mới, và các tính năng bảo mật hoàn toàn mới \r\n\r\nPháp lý \r\n(1) iPhone 11 có khả năng chống tia nước, chống nước và chống bụi. Sản phẩm đã qua kiểm nghiệm trong điều kiện phòng thí nghiệm có kiểm soát đạt mức IP68 theo tiêu chuẩn IEC 60529 (chống nước ở độ sâu tối đa 2 mét trong vòng tối đa 30 phút). Khả năng chống tia nước, chống nước, và chống bụi không phải là các điều kiện vĩnh viễn và khả năng này có thể giảm do hao mòn thông thường. Không sạc pin khi iPhone đang bị ướt. Vui lòng tham khảo hướng dẫn sử dụng để biết cách lau sạch và làm khô máy. Không bảo hành sản phẩm bị hỏng do thấm chất lỏng.\r\n(2) Thời lượng pin khác nhau tùy theo cách sử dụng và cấu hình. Truy cập www.apple.com/batteries để biết thêm thông tin. \r\n(3) Màn hình có các góc bo tròn. Khi tính theo hình chữ nhật, kích thước màn hình iPhone 11 là 6.06 inch theo đường chéo. Diện tích hiển thị thực tế nhỏ hơn.\r\n(4) Không bán kèm bộ sạc không dây Qi. \r\n\r\nBộ sản phẩm bao gồm: \r\n•	Điện thoại \r\n•	Cáp sạc\r\n•	Củ sạc + Tai nghe (Với sản phẩm sản xuất trước 10/2020)\r\n•	HDSD Bảo hành điện tử 12 tháng.\r\n\r\nThông tin bảo hành:\r\nBảo hành: 12 tháng kể từ ngày kích hoạt sản phẩm.\r\nKích hoạt bảo hành tại: https://checkcoverage.apple.com/vn/en/\r\n\r\nHướng dẫn kiểm tra địa điểm bảo hành gần nhất:\r\nBước 1: Truy cập vào đường link https://getsupport.apple.com/?caller=grl&locale=en_VN \r\nBước 2: Chọn sản phẩm.\r\nBước 3: Điền Apple ID, nhập mật khẩu.\r\nSau khi hoàn tất, hệ thống sẽ gợi ý những trung tâm bảo hành gần nhất.', 1000, 977.08, '2022-12-02 15:24:09', '2022-12-02 15:24:09'),
(35, 1, 3, 'Điện Thoại Samsung Galaxy Z Flip3 5G 128GB', 'https://cf.shopee.vn/file/1d36eeb1a9da7f6661a87b475bd872f5', 'THIẾT KẾ\r\n\r\nMột ngôn ngữ thời trang cá tính với khả năng gập linh hoạt\r\n\r\n\r\n\r\nBiểu tượng thời trang độc đáo nằm gọn trong túi khi gập cho bạn thỏa sức tham gia các hoạt động yêu thích ở bất cứ nơi đâu. Siêu phẩm công nghệ khi mở để bạn đắm chìm trải nghiệm với tốc độ mạng 5G và khả năng gập ở nhiều góc độ linh hoạt chưa từng có.\r\n\r\n\r\n\r\nMÀN HÌNH NGOÀI\r\n\r\nTrải nghiệm chưa từng có với màn hình ngoài cực đỉnh\r\n\r\n\r\n\r\nThỏa sức giải trí và thao tác dễ dàng mà không cần mở điện thoại với màn hình ngoài lớn hơn. Bạn có thể làm những việc như kiểm tra tin nhắn, chụp ảnh, phát nhạc và hơn thế nữa.4 Kích thước 1.9-inch lớn hơn cho bạn thoải mái xem thông báo ứng dụng và tương tác trực quan hơn.\r\n\r\n\r\n\r\nCAMERA\r\n\r\nThay đổi cách bạn chụp ảnh\r\n\r\n\r\n\r\nSelfie với màn hình ngoài. Selfie đầy mới lạ cùng Bộ Đôi Camera Sau ngay trên Màn hình ngoài chưa bao giờ tiện lợi đến thế. Hơn thế, camera ở chế độ gập mở linh hoạt với Flex Mode\r\n\r\n\r\n\r\nTHAO TÁC ĐA NHIỆM\r\n\r\nTăng gấp đôi hiệu suất\r\n\r\n\r\n\r\nChia đôi màn hình và thao tác đa nhiệm ấn tượng. 14,15 Bạn có thể thỏa sức xem YouTube và nhắn tin cho bạn bè, sau đó gửi một bức ảnh selfie tuyệt đẹp và xem các tương tác của bạn bè.\r\n\r\n\r\n\r\nIP8X\r\n\r\nĐiện thoại bị ướt ư? Đừng lo\r\n\r\n\r\n\r\nThỏa sức sáng tạo với chiếc điện thoại gập thông minh kháng nước đầu tiên trên thế giới, với chuẩn IPX8. IPX8 giúp điện thoại có khả năng chịu đựng ở độ sâu 1,5 mét, tối đa 30 phút trong môi trường nước.\r\n\r\n\r\n\r\nKẾT NỐI 5G SIÊU TỐC\r\n\r\nTốc độ kết nối nhanh chóng\r\n\r\n\r\n\r\nThưởng thức chương trình yêu thích hay tải lên nội dung từ cuộc hành trình mới nhất chỉ trong tích tắc? Với tốc độ 5G vượt trội, không phải chờ đợi.\r\n\r\n\r\n\r\nPIN KÉP THÔNG MINH\r\n\r\nNăng lượng bất tận trọn ngày dài\r\n\r\n\r\n\r\nDung lượng 3300mAh (tiêu chuẩn) cùng công nghệ AI tích hợp giúp tối ưu mức pin theo thói quen trải nghiệm cho bạn nhiều thời gian hơn để làm điều mình thích\r\n\r\n\r\n\r\nFLAGSHIP AP\r\n\r\nVi xử lý nhanh nhất trên Galaxy Z\r\n\r\n\r\n\r\nNội lực không tưởng trong dáng hình thời thượng với vi xử lý 5nm từ GPU, CPU và NPU nâng cấp. Cộng thêm sức mạnh từ RAM 8G cho bạn quyền năng làm chủ mọi cuộc chơi.\r\n\r\n\r\n\r\nSAMSUNG KNOX\r\n\r\nBảo vệ dữ liệu của bạn\r\n\r\n\r\n\r\nBảo vệ tối đa dữ liệu trong thời gian thực với nền tảng bảo mật đa lớp hoàn thiện nhất từ Samsung.\r\n\r\n\r\n\r\nTập Trung Trải Nghiệm Với One UI Core\r\n\r\n\r\n\r\nSẵn sàng trải nghiệm những đột phá trên giao diện One UI Core của Samsung mang đến hiệu suất ấn tượng kết hợp thiết kế giao diện hoàn toàn mới giúp tối ưu trải nghiệm người dùng.\r\n\r\n\r\n\r\nGalaxy Z Flip 3\r\n\r\n\r\n\r\nMàu sắc: Tím nhẹ, Kem, Xanh lá, Đen nguyên bản (Phantom Black), Hồng, Xám, Trắng\r\n\r\nBộ vi xử lý: Snapdragon 888 8 (5nm)\r\n\r\n\r\n\r\nHiển thị : \r\n\r\nMàn hình: 6.7 inch (màn hình chính), 1.9 inch (màn hình phụ)\r\n\r\nĐộ phân giải: 2640 x 1080 (FHD+)\r\n\r\nCông nghệ màn hình: Dynamic AMOLED 2X (màn hình chính), Super AMOLED (màn hình phụ)\r\n\r\n\r\n\r\nCamera\r\n\r\nCamera sau:\r\n\r\nCamera góc siêu rộng: 12MP\r\n\r\nCamera góc rộng: 12MP\r\n\r\n\r\n\r\nCamera trước:\r\n\r\n10.0 MP\r\n\r\n\r\n\r\nBộ nhớ: \r\n\r\nRAM 8GB ROM 128GB\r\n\r\nSim: SIM 1 + Embedded SIM\r\n\r\n\r\n\r\nPin: 3000mAh\r\n\r\n\r\n\r\n\r\n\r\nBộ sản phẩm bao gồm: Hộp, Điện thoại, Cáp, Sách hướng dẫn, Que lấy sim\r\n\r\n\r\n\r\nBảo hành:\r\n\r\nThời gian bảo hành: 12 tháng\r\n\r\nTrung tâm bảo hành:https://www.samsung.com/vn/support/service-center/\r\n\r\nHotline: 1800-588-855\"', 1890, 552.08, '2022-12-02 15:27:14', '2022-12-02 15:27:14'),
(36, 1, 3, 'Apple iPhone 13 128GB', 'https://cf.shopee.vn/file/sg-11134201-22100-wtuyqs0tr2iv41', 'iPhone 13\r\n\r\nHệ thống camera kép tiên tiến nhất từng có trên iPhone. Chip A15 Bionic thần tốc. Bước nhảy vọt về\r\n\r\nthời lượng pin. Thiết kế bền bỉ. Mạng 5G siêu nhanh.1 Cùng với màn hình Super Retina XDR sáng hơn.\r\n\r\n\r\n\r\nTính năng nổi bật\r\n\r\n• Màn hình Super Retina XDR 6.1 inch2\r\n\r\n• Chế độ Điện Ảnh làm tăng thêm độ sâu trường ảnh nông và tự động thay đổi tiêu cự trong video\r\n\r\n• Hệ thống camera kép tiên tiến với camera Wide và Ultra Wide 12MP; Phong Cách Nhiếp Ảnh, HDR thông\r\n\r\nminh thế hệ 4, chế độ Ban Đêm, khả năng quay video HDR Dolby Vision 4K\r\n\r\n• Camera trước TrueDepth 12MP với chế độ Ban Đêm và khả năng quay video HDR Dolby Vision 4K\r\n\r\n• Chip A15 Bionic cho hiệu năng thần tốc\r\n\r\n• Thời gian xem video lên đến 19 giờ3\r\n\r\n• Thiết kế bền bỉ với Ceramic Shield\r\n\r\n• Khả năng chống nước đạt chuẩn IP68 đứng đầu thị trường4\r\n\r\n• Mạng 5G cho tốc độ tải xuống siêu nhanh, xem video và nghe nhạc trực tuyến chất lượng cao1\r\n\r\n• iOS 15 tích hợp nhiều tính năng mới cho phép bạn làm được nhiều việc hơn bao giờ hết với iPhone5\r\n\r\n\r\n\r\nBộ sản phẩm bao gồm\r\n\r\n1. Điện thoại\r\n\r\n2. Dây sạc\r\n\r\n\r\n\r\nPháp lý\r\n\r\n1.Cần có gói cước dữ liệu. Mạng 5G chỉ khả dụng ở một số thị trường và được cung cấp qua một số nhà mạng.\r\n\r\nTốc độ có thể thay đổi tùy địa điểm và nhà mạng. Để biết thông tin về hỗ trợ mạng 5G, vui lòng liên hệ nhà\r\n\r\nmạng và truy cập apple.com/iphone/cellular.\r\n\r\n2.Màn hình có các góc bo tròn theo đường cong tuyệt đẹp và nằm gọn theo một hình chữ nhật chuẩn. Khi tính\r\n\r\ntheo hình chữ nhật chuẩn, kích thước màn hình là 6.06 inch theo đường chéo. Diện tích hiển thị thực tế nhỏ\r\n\r\nhơn.\r\n\r\n3.Thời lượng pin khác nhau tùy theo cách sử dụng và cấu hình. Truy cập apple.com/batteries để biết thêm thông\r\n\r\ntin.\r\n\r\n4.iPhone 13 có khả năng chống nước, chống tia nước và chống bụi. Sản phẩm đã qua kiểm nghiệm trong điều\r\n\r\nkiện phòng thí nghiệm có kiểm soát đạt mức IP68 theo tiêu chuẩn IEC 60529. Khả năng chống tia nước, chống\r\n\r\nnước và chống bụi không phải là các điều kiện vĩnh viễn. Khả năng này có thể giảm do hao mòn thông thường.\r\n\r\nKhông sạc pin khi iPhone đang bị ướt. Vui lòng tham khảo hướng dẫn sử dụng để biết cách lau sạch và làm\r\n\r\nkhô máy. Không bảo hành sản phẩm bị hỏng do thấm chất lỏng.\r\n\r\n5.Một số tính năng không khả dụng tại một số quốc gia hoặc khu vực.\r\n\r\nThông số kỹ thuật\r\n\r\nTruy cập apple.com/iphone/compare để xem cấu hình đầy đủ.', 700, 813.88, '2022-12-02 15:27:14', '2022-12-02 15:27:14');
INSERT INTO `product_new` (`id`, `id_shop`, `id_category`, `product_name`, `product_image`, `product_description`, `product_quanlity`, `product_price`, `created_at`, `updated_at`) VALUES
(37, 1, 4, 'Laptop Huawei Matebook D15/Silver/15.6\"HD Fullview/i3-10110U/8GB RAM/256SSD', 'https://cf.shopee.vn/file/b733b6ba395da31132e07c82cc116d99', 'Laptop Huawei Matebook D15/Silver/15\"HD Fullview/i3-10110U/8GB RAM/256SSD\r\nMáy Tính Xách Tay Huawei MateBook D15 (8GB/256GB) | Màn Hình HUAWEI Fullview | HUAWEI Share | Phím Nguồn Kết Hợp Bảo Mật Vân Tay\r\n\r\nHUAWEI MateBook D 15 trang bị bộ vi xử lý Intel® Core™ i3-10110U thế hệ thứ 10, đồ họa Intel® UHD Graphics 620 là một máy tính xách tay có thiết kế nhọ gọn và có lớp vỏ bằng kim loại cùng với dung lượng bộ nhớ lớn.\r\nHệ Điều Hành: Hệ Điều Hành Windows 10 Home\r\nKích Thước và Trọng Lượng:\r\nChiều Dài 357,8 mm x Chiều Rộng 229,9 mm x Chiều Cao 16,9 mm. Khoảng 1,62 kg (SSD+HDD)\r\nKích thước sản phẩm, trọng lượng sản phẩm và các thông số kỹ thuật liên quan chỉ là giá trị lý thuyết. Các phép đo thực tế giữa các sản phẩm riêng lẻ có thể khác nhau. Tất cả các thông số kỹ thuật là tùy thuộc vào sản phẩm thực tế.\r\nChất Liệu: Hợp kim nhôm A/C/D, B Mylar\r\nBạc Huyền Ảo\r\nMàn Hình:\r\nKích thước màn hình: 15,6 inch.\r\nLoại màn hình: IPS .\r\nĐộ phân giải: 1920 x 1080 .\r\nTỷ lệ màn hình so với thân máy: 87%\r\nTỷ lệ tương phản: 800:1. Độ sáng: 250 nit. Góc nhìn: 178°. Tỷ lệ khung hình: 16:9\r\nBộ Vi Xử Lý: Bộ Vi Xử Lý Intel® Core™ i3-10110U thế hệ thứ 10\r\nĐồ Họa: đồ họa Intel® UHD Graphics 620\r\nBộ Nhớ: 8GB DDR4\r\nDung Lượng Bộ Nhớ: Ổ Cứng 256GB NVMe PCIe SSD. 42 Wh (Công suất định mức)\r\nGiá trị lý thuyết. Công suất thực tế có thể thay đổi một chút. Dung lượng này là dung lượng pin danh nghĩa. Dung lượng pin thực tế cho từng sản phẩm có thể cao hơn hoặc thấp hơn một chút so với dung lượng pin danh định.\r\nWi-Fi: IEEE 802.11a/b/g/n/ac, 2,4 GHz và 5 GHz, 2x2 MIMOBluetooth 5.0, tương thích với Bluetooth 4.2, Bluetooth 2.1+EDR\r\nNút: nguồn tích hợp hai trong một và cảm biến vân tay. Cổng: USB-A 3.0 x 1. USB-A 2.0 x 1. USB-C x 1. HDMI x 1 . Tai nghe có mic 3.5 mm và jack micrô tích hợp 2 trong 1x1\r\nBàn phím chiclet, Bàn phím kích thước đầy đủ. Hỗ trợ chuột cảm ứng\r\nCamera ẩn: Độ phân giải camera: 1MP (720P HD)\r\nCông suất loa: 2W/loa x 2. Số lượng micrô: 2\r\nCảm biến từ tính, Cảm biến trọng lực, Cảm biến vân tay\r\nTrình quản lý HUAWEI PC Manager, Monitor Manager (Chế độ bảo vệ mắt), khôi phục cài đặt gốc\r\n m Thanh:\r\nCông suất loa: 2W/loa x 2\r\nSố lượng micrô: 2\r\nCảm Ứng: Cảm biến từ tính, Cảm biến trọng lực, Cảm biến vân tay\r\nỨng Dụng: Trình quản lý HUAWEI PC Manager, Monitor Manager (Chế độ bảo vệ mắt), khôi phục cài đặt gốc\r\nPhụ Kiện Trong Hộp:\r\nPC x 1\r\nBộ đổi nguồn HUAWEI USB-C AC Adapter x 1\r\nCáp chuyển đổi nguồn(USB-C) x 1\r\nHướng dẫn bắt đầu nhanh x 1\r\nĐối với điện thoại thông minh, máy tính bảng, laptop, đồng hồ, vòng đeo thông minh, tai nghe freebuds, SoundX:\r\nBảo hành 12 tháng\r\nEmail: mobile.vn@huawei.com\r\nĐịa điểm trung tâm bảo hành, vui lòng truy cập trang web của Huawei hoặc ứng dụng Hỗ Trợ (Support) trên điện thoại\r\nMọi chi tiết vui lòng liên hệ hotline 1800 1085', 1500, 507.03, '2022-12-02 15:32:23', '2022-12-02 15:32:23'),
(38, 1, 4, 'Máy Tính Lenovo Thinkpad L380 - Core i5-8250u, Ram16G | SSD256G | Màn 13,3 inch | Bảo Hành 12 tháng', 'https://cf.shopee.vn/file/sg-11134201-22110-kc62386w2cjv20', 'Thông Tin Sản Phẩm\r\nCPU: 8th Gen Intel® Core™ i5 8250U Processor 1.6GHz (8*1.6Ghz) (6MB Cache, upto 3.4GHz)\r\nRAM: 8Gb DDR4 Bus 2400Mhz\r\nĐĩa cứng: 256Gb SSD M.2 2280 NVMe\r\nVGA: Intel UHD Graphics 620\r\nMàn hình: 13.3 inche Anti-glare LED backlit High Definition HD (1366*768)\r\nOS: Windown 10 Pro 64bit License\r\nGiao tiếp: Realtek 8822BE Wireless LAN 802.11ac PCI-E NIC W/ Bluetooth\r\nCổng kết nối: HDMI, 2x USB 3.0, 2x USB Type-C\r\nOptions: Camera: YES | Bàn phím có đèn nền: NO | Fingerprint: YES\r\nPin: 3 Cells 45Whr\r\nWeight: 1.4KG\r\nbảo hành: Bảo hành 12 tháng\r\nColor: Black\r\n🔵 máy siêu mỏng, văn phòng dùng cực nhanh\r\n🔵 bàn phím bấm êm, máy chạy mát\r\n🔵 Đảm bảo như mới 95%\r\n🔵 chơi tốt game tầm trung, máy nhẹ để di chuyển\r\nthông tin liên hệ : 0876567555\r\ncơ sở 2 : 215 trần đăng inh , dịch vọng , cầu giấy , hà nội', 890, 254.58, '2022-12-02 15:32:23', '2022-12-02 15:32:23'),
(39, 1, 4, 'Máy tính xách tay 15.6 inch mới nhất 2021', 'https://cf.shopee.vn/file/f2a2ae206912b0a6d318fccda5baba3b', ' Model NO.:TK-E156J * OS: Windows 10 * CPU: Intel J3455 * Tốc độ: 2.3GHz * Bộ nhớ: DDR4 8GB * NAND Flash: 128GB SSD(Tùy chọn 256GB, 512GB, 1TB) \r\n* Máy ảnh, Mặt trước 0,3MP \r\n* IPS 15,6 inch, Độ phân giải: 1920 * 1080 \r\n* 3,7V, Pin lớn 9000mAH \r\n* WIFI: IEEE 802.11 b / g / n WIFI và 10-100M Ethernet Access \r\n* 2.4 G VÀ 5G WIFI\r\nCấu hình tiêu chuẩn vật lý của hệ thống:\r\nKiểu\r\nThông tin chi tiết\r\nMô tả\r\nMẫu sản phẩm\r\nMẫu sản phẩm\r\nTấm thẳng\r\nKích thước\r\n371 * 240 * 21mm\r\nLCD\r\nKích thước màn hình\r\n15,6 \'\r\nĐộ phân giải màn hình\r\nMàn hình 1920 * 1080\r\nẮc quy\r\nKiểu\r\nPin lithium-ion polymer\r\nSức chứa\r\n3.7V / 9000mAH\r\nSức bền\r\nkhoảng 6-8 giờ\r\nCấu hình phần cứng hệ thống:\r\nKiểu\r\nThông tin chi tiết\r\nMô tả\r\nCPU\r\nKiểu\r\nJ3455, Lõi tứ\r\nTốc độ, vận tốc\r\n2.3GHz\r\nGPU\r\nKiểu\r\nRAM\r\nSức chứa\r\n8GB DDR3\r\nSSD\r\nSức chứa\r\n128GB (Tùy chọn: 256GB / 512GB)\r\nMáy ảnh\r\nĐằng trước\r\n0,3MP\r\nPhần phía sau\r\nKhông\r\nLoa\r\nKích thước\r\nLoa 8Ω / 0.8W tích hợp x 2\r\nCảm biến G\r\nĐược xây dựng trong\r\nCảm biến gia tốc trọng lực', 700, 303.88, '2022-12-02 15:35:05', '2022-12-02 15:35:05'),
(40, 1, 4, 'Laptop Asus ROG Strix G15 G513IH-HN015W/Ryzen 7-4800H/15.6\"FHD/8GB/512GB/GTX 1650 4GB', 'https://cf.shopee.vn/file/097cda6bb8a346c33db5f5c578372999', 'Laptop Asus ROG Strix G15 G513IH-HN015W/Ryzen 7-4800H/15.6\"FHD/8GB/512GB/GTX 1650 4GB\r\n\r\nTên sản phẩm\r\nAsus ROG Strix G15 G513IH-HN015W\r\nNhóm thuộc tính\r\nLaptop | Laptop Asus Gaming | Laptop Gaming \r\nBộ vi xử lý \r\nBộ vi xử lý\r\nAMD Ryzen 7-4800H\r\nTốc độ\r\n2.9GHz up to 4.2GHz, 8 cores 16 threads\r\nBộ nhớ đệm\r\nL2 Cache: 4MB\r\nL3 Cache: 8MB\r\nBộ nhớ trong (RAM)\r\nDung lượng\r\n8GB DDR4 3200MHz \r\nSố khe cắm\r\n(2x SO-DIMM slot)\r\nỔ cứng \r\nDung lượng\r\n512GB M.2 NVMe™ PCIe® 3.0 SSD\r\nTốc độ vòng quay\r\n \r\nKhe cắm SSD mở rộng\r\n \r\nỔ đĩa quang (ODD) \r\n \r\nHiển thị \r\nMàn hình\r\n15.6 inch FHD (1920 x 1080) IPS, Non-Glare, 144Hz AdaptiveSync, Nanoedge\r\nĐộ phân giải\r\n1920 x 1080\r\nĐồ Họa (VGA) \r\nCard màn hình\r\nNVIDIA Geforce GTX 1650 4GB GDDR6\r\nKết nối (Network) \r\nWireless\r\nIntel Wi-Fi 6(Gig+)(802.11ax)\r\nLAN\r\n \r\nBluetooth\r\nBT\r\nBàn phím , Chuột \r\nKiểu bàn phím\r\nBàn phím tiêu chuẩn - 4-Zone RGB KB\r\nChuột\r\nCảm ứng đa điểm\r\nGiao tiếp mở rộng \r\nKết nối USB\r\n- 1x Type C USB 3.2 Gen 1 with Power Delivery and Display Port\r\n- 3x USB 3.2 Gen 1 Type-A\r\n\r\nKết nối HDMI/VGA\r\n- 1 x HDMI 2.0b\r\n- Tai nghe\r\n- 1x 3.5mm Combo Audio Jack\r\nCamera\r\n\r\nCard mở rộng\r\n\r\nLOA: 2 Loa\r\nKiểu Pin: 4-cell, 56WHrs\r\nSạc pin: Đi kèm\r\nHệ điều hành (bản quyền) đi kèm : Windows 11 Home\r\nKích thước (Dài x Rộng x Cao): 35.4(W) x 25.9(D) x 2.26 ~ 2.72(H) cm\r\nTrọng Lượng: 2.1Kg\r\nMàu sắc: Xám\r\nXuất xứ: Trung Quốc\r\nBảo hành: 24 tháng', 280, 80.75, '2022-12-02 15:35:05', '2022-12-02 15:35:05'),
(41, 1, 4, 'Máy tính HPI 450G3 Core i5-2.3GHz (6200U) / 8GB / 256GB / DVD multi / 15.6 / Win10Pro64bit', 'https://cf.shopee.vn/file/sg-11134201-22110-xlc4f7xv1cjva3', 'CPU Intel Core i5 6300U 2.4 Ghz 2 nhân 4 luồng ( up to 3.0 Ghz )\r\n\r\nRam 8 GB DDR4 buss 2133 mhz\r\n\r\nỔ cứng SSD 240GB\r\n\r\nMàn hình 15.6 HD ( FHD 1920*1080 + 500K )\r\n\r\nVGA Intel Graphics 520\r\n\r\nTình trạng Đã qua sử dụng\r\nHP ProBook 450 G3 được thiết kế với kiểu dáng mỏng, nhỏ gọn, trọng lượng nhẹ, thuận tiện mang theo bên mình. Chip Core i5 Skylake mới giúp máy tính xách tay HP ProBook 450 G3 xử lý các tác vụ mạnh mẽ và tiết kiệm điện năng sử dụng. HP ProBook 450 G3 trang bị màn hình lớn 15.6 inches giúp việc thao tác trên laptop dễ dàng hơn.\r\nĐẶC ĐIỂM NỔI BẬT\r\nThiết kế hiện đại, sang trọng cùng ngoại hình nhỏ gọn, dễ mang theo bên mình.\r\n\r\nChip Intel Core i5 Skylake và RAM dung lượng 8 GB, cho khả năng xử lý mạnh mẽ.\r\n\r\nỔ đĩa cứng SSD 256 GB.\r\n\r\nMàn hình 15.6 inches đem đến hình ảnh sắc nét.\r\n\r\nCó phiên bản Card màn hình AMD Radeon M340 2 GB.\r\n\r\nHệ thống âm thanh DTS sống động, mạnh mẽ.', 170, 233.75, '2022-12-02 15:38:23', '2022-12-02 15:38:23'),
(42, 1, 4, 'Laptop ASUS E410MA (Intel Celeron N4020/4GB/128GB SSD/14.0 HD/ 1.3KG', 'https://cf.shopee.vn/file/6cc4803307d9a7451423a40302df7a27', 'Thiết kế\r\nĐược thiết kế để “vượt quá sự mong đợi” của một laptop thân thiện với ngân sách, Laptop Asus E410 là một laptop 14 inch cung cấp trải nghiệm máy tính cơ bản hàng ngày thỏa mãn. Nó có một hình thức nhỏ gọn và nhẹ, với một thiết kế mới, mới mẻ và độc đáo\r\nTính năng\r\nLà một laptop kinh tế, laptop Asus E410 đi kèm với một số tính năng thú vị. Asus tuyên bố, chiếc laptop này được tạo ra để giúp người dùng làm được nhiều việc hơn, với các tính năng giúp tăng năng suất. Một ví dụ là tính năng NumberPad sáng tạo để nhập dữ liệu dễ dàng\r\nchiếc laptop này có thể xoay tới 180 độ, giúp người dùng cộng tác hoặc chia sẻ nội dung với đồng nghiệp hoặc đối tác kinh doanh dễ dàng hơn. Những thiết kế như thế này thường xuất hiện trên các dòng laptop doanh nhân hoặc các dòng laptop cao cấp.\r\nVà cũng giống như VivoBook thế hệ tiếp theo, Asus cũng cung cấp một yếu tố màu sắc đặc biệt trên nút enter. Việc tạo ra màu sắc đặc biệt này tạo thêm điểm nhấn tươi mới cho chiếc laptop giá rẻ này\r\nĐối với kết nối, mặc dù laptop này có giá cả phải chăng, bạn sẽ tìm thấy nhiều loại cổng hiện đại ở đó. Bạn có thể đặt tên cho nó, một USB 3.1 Kiểu C, USB 3.1 Kiểu A, USB 2.0, HDMI, giắc cắm kết hợp âm thanh và đầu đọc thẻ MicroSD\r\nAsus E401 là một laptop được thiết kế cho tính di động. Mặc dù có kích thước 14 inch và là dòng laptop phổ thông nhưng trọng lượng của chiếc laptop này không hề nặng, chỉ 1,3 kg. Về đồ họa, Intel HD Graphics 600 chắc chắn không phải là chip dành cho đa phương tiện chứ chưa nói đến chơi game. Hiệu suất rất cơ bản và chỉ dành cho công việc, duyệt web hoặc hội nghị truyền hình\r\n\r\nTHÔNG SỐ KỸ THUẬT\r\nMàn hình: 14.0 inch, 1366 x 768 (HD) Pixels, 200 nits, Anti-glare LED-backlit\r\nCPU: Intel Celeron N4020\r\nRAM: 4GB, DDR4, 2400 MHz\r\nỔ cứng: SSD 128 GB NVME\r\nĐồ họa: Intel UHD Graphics\r\nHệ điều hành: Windows 10 Home bản quyền\r\nTrọng lượng: 1.3 kg\r\nTình Trạng: Mới 100% fullbox\r\n\r\n•	Máy đã cài sẵn: win 10, office, unikey, goole\r\n•	Bảo hành 12 tháng , 1 đổi 1 trong 15 ngày đầu tiên nếu có lỗi\r\n•	Tặng phụ kiện gồm :  túi xách cao cấp, chuột xịn, bàn di chuột bo viền\r\n•	Mua hàng online thật dễ dàng, ở nhà mà vẫn mua được sản phẩm ưng ý mà không cần phải đi đâu\r\n•	Bạn ở xa còn phân vân chưa biết ở đâu bán hàng chất lượng thì hãy đến với shop LAPTOPGAME\r\n•	Uy tín và chất lượng đã được Khách hàng khẳng định qua những sản phẩm chúng tôi bán ra\r\n•	Hỗ trợ tư vấn khách hàng chọn mua laptop nhiệt tình chu đáo tận tâm.', 600, 280.50, '2022-12-02 15:38:23', '2022-12-02 15:38:23'),
