(49, 1, 5, 'Kem dưỡng trắng da body Rmon White Label Dia Whitening Cream 200ml, da sáng đều màu trắng hồng tự nhiên, luhacosmetics', 'https://cf.shopee.vn/file/sg-11134201-22100-j5qdgcerm8ivc0', 'Kem dưỡng trắng da body Rmon White Label Dia Whitening Cream 200ml, da sáng đều màu trắng hồng tự nhiên, luhacosmetics\r\n\r\n* THÔNG TIN SẢN PHẨM :\r\n- Thương hiệu: Rmon\r\n- Xuất xứ: Hàn Quốc\r\n- Quy cách: 200ml\r\n\r\n* THÀNH PHẦN KEM DƯỠNG TRẮNG DA BODY RMON:\r\n- Tế bào gốc sống: tái tạo da tới tận từng lớp hạ bì, nuôi dưỡng làn da trắng hồng từ sâu bên trong.\r\n-  Niacinamide: giúp làm trắng da, cải thiện cấu trúc làn da và chống nắng.\r\n-  Glutathione: có khả năng ngăn cản các gốc tự do, ức chế quá trình sản sinh hắc sắc tố melanin. \r\n- Nước hoa hồng chưng cất: tạo mùi thơm nhẹ nhàng cho sản phẩm.\r\n-  Đậu tương lên men, vỏ cây liễu trắng: chống lão hóa, cải thiện các vấn đề về lỗ chân lông.\r\n-  Ngoài ra, trong sản phẩm còn có chiết xuất cam thảo, men bia và tảo biển giúp dưỡng ẩm cho da, làm trắng và kích thích trao đổi chất trên da.\r\n\r\n* CÔNG DỤNG KEM DƯỠNG TRẮNG DA BODY RMON\r\n- Làm trắng da toàn thân, kích thích tái tạo tế bào da mới trắng hồng rạng rỡ.\r\n- Giúp loại bỏ hắc sắc tố gây sạm nám, làm da không đều màu.  \r\n- Cải thiện các dấu hiệu lão hóa ở body như làm mờ các đốm nâu, sạm nám,…  \r\n- Hỗ trợ phục hồi làn da bị tổn thương, thô ráp. Tăng cường sức đề kháng, duy trì làn da khỏe đẹp, tươi tắn.\r\n\r\n* HƯỚNG DẪN SỬ DỤNG :\r\n- Bước 1: Tắm sạch cơ thể với sữa tắm chuyên dụng rồi dùng khăn bông mềm lau khô nhẹ nhàng.\r\n-  Bước 2: Lấy một lượng kem vừa đủ thoa đều khắp cơ thể.\r\n-  Bước 3: Dùng các ngón tay massage nhẹ nhàng để dưỡng chất thẩm thấu sâu vào da. \r\n\r\n* Lưu ý: Sử dụng sản phẩm đều đặn mỗi ngày để đạt hiệu quả dưỡng trắng da tốt nhất. Nên kết hợp dùng thêm kem chống nắng để tăng cường khả năng bảo vệ làn da trước tác hại của ánh nắng mặt trời. Không thoa kem ở những vùng da bị trầy xước và có vết thương hở. Bảo quản nơi khô thoáng, tránh để nơi có nhiệt độ cao.\r\n-----------------------------------------------------------------\r\n✔ Với phương châm \"Khách Hàng Là Thượng Đế”\r\n✔ Chất lượng là sự sống còn của cửa hàng\r\n ✔ LuHa_Cosmetics luôn lắng nghe trải nghiệm sử dụng sản phẩm của khách hàng. \r\n ✔ Cam kết Chính Hãng 100%', 300, 15.94, '2022-12-02 15:52:17', '2022-12-02 15:52:17'),
(50, 1, 5, 'Serum dưỡng sáng, làm đều màu da URIAGE DÉPIDERM SÉRUM CORRECTEUR ÉCLAT 30ml', 'https://cf.shopee.vn/file/sg-11134201-22110-vi4iqa6lkckv1e', 'MÔ TẢ SẢN PHẨM\r\nSerum dưỡng sáng da, giúp làm đều màu da URIAGE DEPIDERM SERUM CORRECTEUR giúp dưỡng sáng da, làm đều màu da, loại bỏ các vùng da tối màu, ngăn ngừa các đốm nâu, tàn nhang, cho làn da sáng hồng tự nhiên, đều màu rạng rỡ\r\n\r\n51% làm đều màu da. *\r\n(* Thử nghiệm được tiến hành với 27 tình nguyện viên có tình trạng da nhiều đốm nâu và xỉn màu dưới sự giám sát của các bác sĩ da liễu. Thoa 2 lần/ngày trong 28 ngày.)\r\n\r\nLoại sản phẩm\r\n- Serum dưỡng ẩm, sáng da giúp làm đều màu da, giúp da sáng khỏe hơn mỗi ngày.\r\n\r\nLoại da phù hợp\r\n- Dành cho mọi loại da có nhu cầu dưỡng sáng da.\r\n\r\nĐộ an toàn\r\nKhông gây kích ứng - Không gây dị ứng\r\nĐã được kiểm tra da liễu\r\n\r\nCông dụng\r\n- Làm đều màu da, ngăn ngừa tàn nhang đốm nâu: Với thành phần gồm nước khoáng Uriage và phức hợp Cx, sản phẩm giúp làm giảm các đốm nâu, làm đều màu da.\r\n- Dưỡng sáng da, làm mịn da: Sự kết hợp giữa chiết xuất hạt ngọc trai và các thành phần cấp ẩm giúp làm giảm làm mịn da và dưỡng sáng da.\r\n- Dưỡng ẩm cho da: Sản phẩm cung cấp độ ẩm cần thiết cho da mang lại cảm giác dễ chịu và giúp da mềm mịn.\r\n\r\nThành phần\r\n•	Cx complex 20%: giảm sản sinh melanin, làm sáng da:\r\no	Pea extract + Sucrose: giảm sự phát triển melanosome và ức chế hoạt động của enzyme tyrosinase\r\no	Vitamin C hàm lượng cao: tăng cường khả năng chống gốc tự do và giảm oxy hóa melanin cho làn da sáng mịn hơn\r\no	Enoxolone: giảm viêm, ngăn kích thích tế bào sinh melanin.\r\no	Nước khoáng Uriage: làm dịu và ngăn gốc tự do. \r\n•	Niacinamide: cải thiện vấn đề sắc tố, tăng cường làm sáng da\r\n•	Chiết xuất ngọc trai: làm sáng da.\r\n•	Creatine, vitamin E: chống oxy hóa.\r\n•	Fucogel, glycerin: dưỡng ẩm cho da.\r\n•	Hương thơm dịu nhẹ\r\n\r\nHướng dẫn sử dụng\r\n- Sử dụng vào buổi sáng và tối sau bước xịt khoáng và trước các bước kem dưỡng khác. Thoa trên toàn khuôn mặt.\r\n\r\nBảo quản\r\nĐể sản phẩm ở nhiệt độ phòng, nơi khô ráo, thoáng mát.\r\nTránh ánh nắng trực tiếp và những nơi gần nguồn nhiệt, ẩm mốc.\r\nTránh xa tầm với của trẻ em.\r\n\r\nHSD: xem trên bao bì sản phẩm \r\nXuất xứ thương hiệu: Pháp \r\nNơi sản xuất: Tây Ban Nha\r\n\r\nTHÔNG TIN THƯƠNG HIỆU \r\nUriage là một trong những hãng Dược mỹ phẩm hàng đầu của Pháp\r\nNhững lợi ích độc đáo của nước khoáng Uriage được chắt lọc, bổ sung và kết hợp tuyệt vời với những thành phần sáng chế độc quyền, mang đến các dòng sản phẩm chăm sóc và bảo vệ da hiệu quả, giúp làn da sáng khỏe hơn mỗi ngày. Các sản phẩm Uriage được nghiên cứu và được công nhận hiệu quả điều trị các bệnh lý da liễu, được các chuyên gia Da liễu tin dùng ở nhiều quốc gia trên thế giới.', 580, 27.20, '2022-12-02 15:52:17', '2022-12-02 15:52:17'),
(51, 1, 5, 'Bút Kẻ Mắt SUAKE Nét Mảnh', 'https://cf.shopee.vn/file/2a23856ddd35d0c731bad7750b6d8827', 'Bút kẻ mắt dạng lỏng lâu trôi màu đen, bút kẻ mắt dạng lỏng siêu chống thấm nước và lâu trôi\r\nĐặc điểm:\r\n-Dễ Viết, nhanh khô, không vết bẩn\r\n-Lasting 24 giờ\r\n-Làm Cho mắt nổi bật và hấp dẫn\r\n-Có Vết trang điểm suốt cả ngày.\r\n-Dễ Dàng rửa sạch. Đầu cọ dễ viết, đường nét tự nhiên, sắc nét.\r\n\r\nCách sử dụng\r\n-Áp Dụng trên các đường mi trên và dưới để tăng âm lượng.\r\nKhối lượng mắt sắc nét và quyến rũ: 0,55m', 80, 0.17, '2022-12-02 15:54:41', '2022-12-02 15:54:41'),
(52, 1, 5, 'Son Lì Chống Dính Cốc Lâu Trôi Không Thấm Nước Kakashow', 'https://cf.shopee.vn/file/fec608e0865c6b85b10346c8bd6eaebf', 'Thương hiệu: Kakashow\r\n\r\nChức năng: tăng cường màu sắc, dễ lên màu, chống dính cốc\r\n\r\nNó có phải là mỹ phẩm chuyên dụng không: Không\r\n\r\n\r\n\r\n🌈Chào mừng đến với Cửa hàng, 💕Chúc các bạn ngày càng xinh đẹp!!\r\n\r\n✅【Tập Trung vào các sản phẩm trang điểm】\r\n\r\n✅【Hàng Sẵn sàng 100%】\r\n\r\n🚚【1-2 Ngày ship nhanh, thời gian đến trung bình 7~10 ngày sau khi ship!】\r\n\r\n👍【Giá Cực thấp, Đảm bảo chất lượng】\r\n\r\n📦【Kiểm Tra kỹ trước khi giao hàng, Đóng gói an toàn】\r\n\r\n👉👉Rất khuyến khích👈👈\r\n\r\n\r\n\r\nNếu màu son sai, vui lòng liên hệ với bộ phận chăm sóc khách hàng, chúng tôi sẽ giải quyết nó cho bạn.\r\n\r\n100% nguyên bản\r\n\r\nThời hạn sử dụng: 3 năm\r\n\r\nĐóng GÓI: 1 CÁI / hộp\r\n\r\nGhi chú:\r\n\r\n1. Màu sắc thực của son môi có thể hơi khác so với hình ảnh hiển thị trên trang web do nhiều yếu tố như độ sáng của màn hình và độ sáng.\r\n\r\n2. Xin vui lòng cho phép sai số nhỏ do đo lường thủ công\r\n\r\n', 150, 1.19, '2022-12-02 15:54:41', '2022-12-02 15:54:41'),
(53, 1, 5, 'Son Tint Bóng Lì nội địa trung PINKCOCO mềm mịn như nhung chống thấm nước chống khô môi lâu', 'https://cf.shopee.vn/file/sg-11134201-22100-x0igxpmhq2iv3f', 'Thời gian giao hàng dự kiến của sản phẩm là 7-15 ngày\r\n\r\n\r\n\r\nThương hiệu:PINKCOCO\r\n\r\n100% hàng chính hãng\r\n\r\nMỹ phẩm mục đích đặc biệt: Không\r\n\r\nThời hạn sử dụng: 3 năm\r\n\r\n\r\n\r\n🌈Chào mừng bạn đến Wowcolor,💕Chúc bạn ngày càng xinh đẹp!!\r\n\r\n✅Tập trung vào các sản phẩm trang điểm\r\n\r\n👉👉Theo dõi tôi để được thông báo giá sản phẩm mới thấp nhất👈👈\r\n\r\n\r\n\r\nThành phần chính: sáp ong, sáp vi tinh thể, sáp nến nhỏ, vitamin E, chất tạo màu, v. v.\r\n\r\nPhân loại màu: 1 #,2 #,3 #,4 #,5 #,6 #\r\n\r\nGói bao gồm: 1 thỏi son\r\n\r\nTrọng lượng: 3g\r\n\r\n\r\n\r\nKết cấu mịn và tinh tế, nhẹ và mềm, vừa vặn và thoải mái.\r\n\r\nĐược làm bằng nhiều loại thành phần nuôi dưỡng và phục hồi, cảm giác mềm mại, thoải mái và đầy đủ dưỡng ẩm sau khi áp dụng.\r\n\r\nKhông thấm nước, chống mồ hôi, dễ tẩy trang\r\n\r\nNhỏ và nhẹ, dễ mang theo.\r\n\r\nHoàn hảo cho tất cả các dịp.', 120, 1.02, '2022-12-02 15:57:03', '2022-12-02 15:57:03'),
(54, 1, 5, 'Combo Kem + Serum Nám Lasmar Mờ Nám Da, Tàn Nhang, Đồi Mồi Lâu Năm Từ Bên Trong', 'https://cf.shopee.vn/file/cebbd2b6ea005febe2a5686f24e1bded', 'Serum xoá mờ nám Lasmar giảm nám, tàn nhang 20ml\r\n\r\n\r\n\r\nCHI TIẾT SẢN PHẨM \r\n\r\n- Thương hiệu : Lasmar\r\n\r\n- Sản phẩm : Combo kem + serum nám Lasmar hỗ trợ nám, tàn nhang\r\n\r\n- Dung tích: 20ml\r\n\r\n- Xuất xứ :Việt Nam\r\n\r\n- Phù hợp với mọi loại da.\r\n\r\n\r\n\r\n- Serum xoá mờ nám Lasmar là giải pháp cho những ai đang gặp phải tình trạng: Da Nám Chân Sâu, Da Nám Mảng, Da Nám Hỗn Hợp, Nám Ăn Sâu Khó Chữa, ….\r\n\r\n- Sản phẩm phù hợp cho mọi loại da, kể cả da nhạy cảm. phù hợp cho những trường hợp da có vết thâm, nám cần phục hồi …\r\n\r\n\r\n\r\n Thành phần: TRANEXAMIC ACID, ARBUTIN, VITAMIN B3, CHIẾT XUẤT HOA\r\n\r\nNGHỆ T Y, VITAMIN B5, HYALURONIC ACID\r\n\r\n\r\n\r\n Công dụng:\r\n\r\n- Kết hợp cùng Kem Bôi Lasmar để đẩy nhanh hiệu quả làm mờ các loại nám\r\n\r\n- Serum Lasmar giúp tái tạo tế bào mới, làm mờ nám do mụn, nám thâm ở vùng da nhạy cảm, nám cũ và những vết thương khác, giúp nám trở lại màu sắc da tự nhiên.\r\n\r\n- Bổ sung dưỡng chất làm tăng độ đàn hồi cho da sáng mịn và đều màu hơn. \r\n\r\n- An toàn cho da, hiệu quả làm mờ nám nhanh chóng\r\n\r\n\r\n\r\n HƯỚNG DẪN SỬ DỤNG\r\n\r\nCó thể sử dụng cho tất cả các vùng da trên cơ thể. Dùng 1 lần vào buổi tối, thoa trực tiếp vào các vùng da bị nám.\r\n\r\n- Da mặt: Sử dụng sau khi rửa mặt khô\r\n\r\n- Vùng da cơ thể: Sử dụng sau khi tắm\r\n\r\n\r\n\r\nTHÔNG TIN THƯƠNG HIỆU LASMAR\r\n\r\nLasmar là thương hiệu chuyên về dược mỹ phẩm, chuyên sâu về sản phẩm mờ nám và chăm sóc sắc đẹp được nghiên cứu sản xuất trên tiêu chuẩn FDA. Được xây dựng trên nền tảng khoa học, áp dụng những phát minh công nghệ mới nhất, các sản phẩm Lasmar chất lượng cao cấp đáp ứng nhiều nhu cầu làm đẹp của phụ nữ  Việt. Các sản phẩm đều tuân theo quy trình kiểm soát chất lượng nghiêm ngặt và đồng đều của FDA. Các sản phẩm chính hãng đều có tem nhãn nên các bạn hoàn toàn yên tâm về chất lượng sản phẩm.\r\n\r\n\r\n\r\nCHÍNH SÁCH BẢO HÀNH:\r\n\r\n+ Đổi trả 100% nếu lỗi của nhà sản xuất.\r\n\r\n- Hàng hoá vẫn còn mới, chưa qua sử dụng.\r\n\r\n- Hàng hoá bị lỗi hoặc hư hỏng do vận chuyển hoặc do nhà sản xuất.\r\n\r\n- Miễn phí đổi trả hàng trong 7 ngày theo chính sách của Shopee.\r\n\r\n\r\n\r\n--> Nên kết hợp kem nám cùng serum và viên uống để có hiệu quả tốt nhất\r\n\r\n*** NÊN SỬ DỤNG KẾT HỢP KEM BÔI LASMAR VÀ SERUM LASMAR ĐỂ ĐẠT HIỆU QUẢ TỐT NHẤT VÀ NHANH NHẤT!\r\n\r\nSản phẩm không phải là thuốc và không có tác dụng thay thế thuốc chữa bệnh', 390, 46.71, '2022-12-02 15:57:03', '2022-12-02 15:57:03'),
