(58, 1, 5, 'Kem dưỡng da mềm mịn Redwin Vitamin E Cream 300g', 'https://cf.shopee.vn/file/e0b11a2b294ebf359fde837f202911e2', '(shop auth87 chuyên hàng chính hãng \r\nquý khách hàng xin vui lòng đọc kỹ về sản phẩm. bao bì sản phẩm khác nhau tùy thuộc từng lô sản phẩm, mẫu cũ mẫu mới....HSD sản phẩm in trên bao bì)\r\n\r\nCông dụng của Kem Dưỡng Da Mềm Mịn Redwin Vitamin E Cream Của Úc\r\n- Nuôi dưỡng và làm mềm làn da, giúp khóa độ ẩm sâu trong da của bạn và liên tục dưỡng ẩm làn da suốt cả ngày, làm mềm và mịn da khô, làm giảm nhược điểm và tăng độ đàn hồi da.\r\n\r\n- Kem dưỡng da Redwin giúp giữ ẩm hoàn hảo làm mềm mịn, sáng da và hiệu quả dưỡng ẩm cảm nhận rõ nét sau lần sử dụng đầu tiên.\r\n\r\n- Thành phần chính của kem Chiết xuất hoa anh đào (EPO) tạo mùi thơm nhẹ, cải thiện sự thô ráp, nứt nẻ do ảnh hưởng của xuất hiện của các vấn đề tuổi tác trên da.\r\n\r\n- Dành cho mọi loại da. Nên dùng cho người có làn da khô và nhạy cảm.\r\n\r\n- Chiết xuất từ thiên nhiên, thẩm thấu nhanh qua da. Glycerine & Sorbitol giữ độ ẩm cho da, giúp da mềm mịn Thích hợp cho mọi độ tuổi.\r\n\r\nHướng dẫn sử dụng\r\n- Khi sử dụng chỉ nên lấy 1 lượng kem nhỏ rồi thoa đều lên vùng da cần làm ẩm nhé các bạn.\r\n- Sử dụng mỗi ngày sau khi tắm và sau khi tiếp xúc với ánh nắng mặt trời\r\n\r\nHạn sử dụng: 24 tháng từ khi mở nắp sử dụng, Hãng không có để NSX\r\n\r\n\r\n(shop auth87 chuyên hàng chính hãng \r\nquý khách hàng xin vui lòng đọc kỹ về sản phẩm. bao bì sản phẩm khác nhau tùy thuộc từng lô sản phẩm, mẫu cũ mẫu mới....HSD sản phẩm in trên bao bì)', 129, 3.61, '2022-12-02 16:02:05', '2022-12-02 16:02:05'),
(59, 1, 5, 'Sáp Wax vuốt tóc GENTLEMAN\"S Clay Wax (BARBERSHOP)', 'https://cf.shopee.vn/file/b4e9a2c34360fa39d65999b593a3fbb5', '[CHÍNH HÃNG]_[SÁP VUỐT TÓC CLAY WAX \r\nSáp Vuốt Tạo Kiểu Tóc Clay Wax Barber Shop 100ml\r\n+ Trọng lượng: 100gr \r\n+ Ðộ giữ nếp:10/10. \r\n+Thời gian giữ nếp: 10-12 giờ \r\n+ Độ bóng: 1/10 \r\n+ Ðộ tạo phồng: 9/10 \r\nNói về dòng sáp clay đất sét thì không cần phải bàn cãi về độ giữ nếp cực cao nữa rồi. Đây là phiên bản barber, là sự kết hợp giữa chất sáp clay với kiểu dáng là hũ thủy tinh cao cấp mà các barber chuyên dùng. \r\n-Sản Phẩm dùng không bị bóng \r\n-Không Bị Bết \r\n- Sáp dễ tan khi xoa trong lòng bàn tay nên không bị bết dính. \r\nĐặc biệt giữ nếp tốt mà không ảnh hưởng tới kiểu dáng tóc mà bạn đã tạo sau khi đội mũ bảo hiểm. Mùi hương rất dễ chịu nhẹ nhàng .', 390, 3.19, '2022-12-02 16:05:10', '2022-12-02 16:05:10'),
(60, 1, 5, 'Nước Hoa Nam Mini Sexy Man 💖 Nước Hoa Nam Chính Hãng Thơm Lâu Phong Cách Sexy Nam Tính', 'https://cf.shopee.vn/file/caf19a35bcbaceb28716e0688a476883', '[Sexy Style] Nước Hoa Nam Mini Sexy Man 💖 Nước Hoa Nam Chính Hãng Thơm Lâu Sexy Man Mang phong cách Sexy Nam Tính.\r\nHương thơm dịu nhẹ, Đẳng cấp phái mạnh mang đặc trưng riêng biệt của hãng Nước Hoa Nam Mini Sexy\r\nNước Hoa Nam Mini Sexy được lấy cảm hứng từ không gian mở tự nhiên với bầu trời xanh, núi đá dưới ánh mặt trời, hương hoa tự nhiên thoang thoảng đem lại cảm giác tự tin, mạnh mẽ và cuốn hút.\r\n➡Nước Hoa Nam Mini Sexy Man: Nam tính, mạnh mẽ, cá tính mang đến cho bạn phong cách tự tin, Nam Tính.\r\n👉🏻 Hương đầu: cam bergamot, bạc hà, Hoa Huệ, osmanthus và Chanh.\r\n👉🏻 Hương giữa: hoa oải hương, cỏ vetiver, Hoa Sen, Hoa Hồng, Nhài và Táo.\r\n👉🏻 Hương cuối: bách hương, hoa labdanum, ambroxan, Quế, Đào.\r\n➡ Mùi hương dịu nhẹ tươi mát, đầy gợi cảm, tạo đẳng cấp cho phải mạnh.\r\n➡ Độ lưu hương: 5 - 7 giờ Tùy mức độ vận động của bạn.\r\n➡ Khoảng cách toả hương: 1-2m\r\n➡ Xịt ở những vị trí dễ toả mùi: cổ tay, gáy\r\n➡ Sử dụng theo hướng dẫn để có hiệu quả tốt.', 400, 3.40, '2022-12-02 16:05:10', '2022-12-02 16:05:10'),
(61, 1, 5, 'Xịt thơm Body mist mùi nam Victoria Fleur - 236ml', 'https://cf.shopee.vn/file/4158c4bd6edd3d692b339dc48d14bdeb', '⚠️ E về sẵn sll mùi Nam rồi nè mấy A/E ơi ☺️\r\n\r\n🔥 Hàng shop chỉ đổi trả nếu lỗi vỡ thôi nhé khách. Không đổi trả lý do không thích mùi hay không thơm,…\r\n🔥 Khách xem kĩ mô tả trc khi mua hàng để tránh về sau nhé\r\n\r\n- Xịt FLEUR này là hàng nội địa Trung không phải hàng Rep hay F.A.K.E cả nhà ơi. Dung tích 236ml thơm tầm 2 tiếng trên quần áo\r\n- Các mùi đa số đều rất nhẹ nếu có mùi nồng thì chỉ là lớp hương đầu khi xịt mà thôi khoảng 5-10’ sau lớp nồng sẽ bay đi nha mọi người', 50, 1.79, '2022-12-02 16:07:49', '2022-12-02 16:07:49'),
(62, 1, 5, 'Dầu xả cao cấp HACHI VIETNAM Cascade 480g xanh ngọc tinh chất bạc hà dầu Oliu dành cho tóc gàu ngứa', 'https://cf.shopee.vn/file/3edc0d08f844eb23fe6cb407ba571e96', 'Dầu xả cao cấp HACHI VIETNAM Cascade 480g xanh ngọc Tinh chất bạc hà dầu Oliu liên kết cấu trúc tóc, da đã bị hư tổn\r\n\r\nHoà mình vào dòng nước mát lạnh, tinh khiết từ thác nước thiên nhiên đem lại cảm giác sảng khoái, tươi mới. HACHI Cascade mang đến sự the mát của bạc hà, giúp bạn đắm chìm vào thiên nhiên sống động.\r\n\r\nThành phần\r\n1. Tinh chất bạc hà:\r\n- Cis-carveol và Carvone: Kháng khuẩn và nấm, giảm sản sinh dầu thừa trên da đầu, cân bằng PH.\r\n\r\n2. Tinh dầu Oliu: \r\n- Polyphenol, vitamin A, E: Thúc đẩy tăng trưởng, tạo thành lớp màng bảo vệ tóc & da đầu.\r\n\r\n3. Hoạt chất Zinc:\r\n- Zinc Pyrithione: Kháng khuẩn Malassezia (nguyên nhân gây gàu).\r\n\r\n4. Keratin & Collagen: \r\n- Liên kết cấu trúc tóc & da đã bị hư tổn.\r\n\r\nCông dụng\r\n- Giảm gàu hiệu quả/ Anti Dandfuff\r\n\r\n- Duy trì độ ẩm da đầu/ Scalp Regeneration\r\n\r\nHướng dẫn sử dụng\r\n- Bước 1: Làm ướt tóc với nước, lấy lượng dầu gội vừa đủ, xoa đều lên da đầu, massage da đầu nhẹ nhàng làm sạch bụi bẩn và các tạp chất trên da đầu, xả sạch dầu gội với nước.\r\n\r\n- Bước 2: Lấy lượng dầu xả vừa đủ, xoa đều ngọn tóc (cách da đầu 3 - 5 cm). Sau 3 - 5 phút, xả sạch với nước.\r\n\r\n- Bước 3: Sấy tóc với máy sấy để cách xa tóc khoảng 15 cm, sấy không quá khô khiến tóc mất nước trong ngọn. Tận hưởng mái tóc bồng bềnh cùng HACHI VIETNAM.\r\n\r\nSản phẩm HACHI VIETNAM Cascade khuyên dùng\r\n- Tóc Gàu (bệnh lý)\r\nĐặc điểm: Da đầu dầu, nhanh bết, có nhiều gàu, ngứa….\r\n\r\nCam Kết\r\nChuẩn Hàng công ty chính hãng\r\n- Về chất lượng sản phẩm: \r\n+ Shop cam kết cả về CHẤT LIỆU cũng như HÌNH DÁNG (đúng với mô tả, hình ảnh sản phẩm chân thực.\r\n- Về dịch vụ: Shop sẽ cố gắng phản hồi mọi thắc mắc của quý khách nhanh nhất có thể\r\n- Thời gian chuẩn bị hàng: Hàng có sẵn, thời gian chuẩn bị tối ưu nhất. \r\n- Quyền Lợi của Khách Hàng:\r\n Chính sách bao đổi trả hàng khi sản phẩm kém chất lượng và không giống hình, số lượng, lỗi từ xưởng sản xuất...', 290, 7.23, '2022-12-02 16:07:49', '2022-12-02 16:07:49'),
(63, 1, 6, 'Set 6/9/10 Dụng Cụ Lấy Ráy Tai Đa Năng Tiện Dụng', 'https://cf.shopee.vn/file/781cb30451f4c4f5803be88c0296f3cb', 'Mô tả:\r\nBịt tai bằng thép không gỉ, không gỉ và bền. giúp massage tai tốt hơn. Thích hợp để cạo ráy tai khô, ẩm hoặc nén chặt. Thiết kế chống trượt với vẻ ngoài trang nhã. Rất dễ sử dụng và làm sạch.\r\n\r\nĐặc điểm:\r\nLàm sạch xoắn ốc 1.360 độ, bề mặt của đầu tai nhẵn và không bị châm khi sử dụng.\r\n2.Thìa tai phóng to đầu hình thìa, hiệu quả vệ sinh tốt hơn.\r\n3.Bốn vòng chắc chắn và bề mặt hình ô nhẵn, lý tưởng để làm sạch ráy tai cứng.\r\n4.Mịn và tròn mà không làm tổn thương tai, đánh bóng cẩn thận.\r\n\r\nSự chỉ rõ:\r\nLoại sản phẩm: Earpicker\r\nChất liệu: thép không gỉ\r\nMàu sắc: bạc\r\nGói bao gồm: 6/9/10 Cái\r\n\r\nLưu ý:\r\n1. Do màn hình và hiệu ứng ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể hơi khác so với màu sắc hiển thị trên hình ảnh. Cảm ơn bạn!\r\n2. Vui lòng cho phép sai số 1-3cm về số đo do cách đo lường thủ công', 100, 0.43, '2022-12-02 16:10:31', '2022-12-02 16:10:31'),
(64, 1, 6, 'Túi chườm nóng lạnh bằng chất liệu mềm mại JP6', 'https://cf.shopee.vn/file/65abdf464e04704d265c6befa32f460c', 'Mô tả sản phẩm:\r\nChức năng\r\nNếu được sử dụng đúng cách, đúng lúc và đúng bệnh, chườm nóng mang lại rất nhiều lợi ích cho sức khỏe. Sản phẩm này có thể giúp bạn giảm đau mỏi vai gáy, giảm đau bụng kinh, duy trì thân nhiệt, giảm đau nhức xương khớp, thúc đẩy tuần hoàn máu, cải thiện giấc ngủ… Đôi khi chườm nóng còn tốt hơn cả uống thuốc?\r\nGiảm đau bụng kinh hiệu quả\r\nDo có tác dụng làm giãn nở mạch máu và thúc đẩy tuần hoàn máu cục bộ nên mỗi khi bị đau bụng kinh, bạn hãy chườm một chai nước nóng lên vùng bụng khoảng 20 - 30 phút sẽ thấy có sự cải thiện rõ rệt.\r\nGiúp giảm đau\r\nTác dụng giữ ấm: Túi chườm nóng còn rất thích hợp để giữ ấm vào mùa lạnh, giúp người bệnh nhanh chóng phục hồi sức khỏe bằng cách giữ nhiệt hiệu quả.\r\nHạ sốt: Chườm một túi nhiệt nhỏ lên trán, bẹn và nách là một trong những cách hạ sốt tại nhà rất hiệu quả.\r\nLưu ý: Việc sử dụng túi giữ nhiệt mang lại nhiều lợi ích cho sức khỏe nhưng nếu lạm dụng thì không nên.\r\nthủ công\r\nBước 1: Đổ nước nóng vào bình\r\nNhiệt độ nước nóng (60-90 độ C), không dùng nước sôi 100 độ C (dễ gây bỏng và ảnh hưởng đến độ giãn nở của bình nhựa). Sử dụng túi chườm lạnh cũng tương tự. Khả năng cách nhiệt của túi nóng lạnh là -20 ° C-90 ° C.\r\nBước 2: Bóp nhẹ để đẩy hết không khí ra ngoài, sau đó đậy nắp lại\r\nKhông ấn bất cứ thứ gì lên bình nước nóng trong quá trình bảo quản.\r\nNếu sử dụng thường xuyên, bạn chỉ cần đổ bỏ nước cũ, lau khô nơi thoáng mát rồi tiếp tục sử dụng vào lần sau.\r\nChất liệu: nhựa và nhồi bông mềm.\r\nKích thước: 18x 11,5cm\r\nMàu sắc: như hình\r\nGói hàng bao gồm: 1 * túi chườm nước nóng\r\nXin lưu ý:\r\n1. Xin vui lòng cho phép sai lệch nhỏ do đo lường thủ công.\r\n2. Do sự khác biệt về ánh sáng và màn hình, màu sắc của sản phẩm có thể hơi khác so với hình ảnh, cảm ơn bạn đã thông cảm.', 60, 0.85, '2022-12-02 16:10:31', '2022-12-02 16:10:31'),
(65, 1, 6, 'Hộp 50 cái Khẩu Trang 3D Mask', 'https://cf.shopee.vn/file/3fbbf7f0d5e1b1f9916ab0a2d7eaf61d', 'Hộp 50 cái Khẩu Trang 3D Mask\r\n\r\n Nắng bụi bặm thế này mà không có khẩu trang thần thánh này thì không thở được đâu ạ\r\nE thề luôn là chưa bao giờ e đeo 1 loại khẩu trang nào lại sướng như loại nàyy !!! Không hổ danh Khẩu trang 3D Mask mọi người ạ !! Thích em nó vì quá nhiều lí do :\r\n** Đặc điểm của khẩu trang 3D Mask\r\n💯 Phần thân được làm từ Polyester và vải lọc, có cấu trúc đa lớp giúp ngăn khói, bụi, phấn hoa, vi khuẩn xâm nhập phòng chống các dịch bệnh nguy hiểm lây qua đường hô hấp.\r\n💯 Thích hợp với các hoạt động thể thao, đi xe đạp trong thành phố nơi có nhiều bụi và khí thải từ động cơ đốt trong và bụi từ các công trường xây dựng, công nhân làm việc ngoài công trường, xưởng, kho,… nơi phát sinh ra bụi mịn PM2.5,....\r\n💯 Quai khẩu trang được làm từ Elastic Fabric, co giãn và mềm mại, không gây đau và khó chịu khi sử dụng.\r\nThiết kế 3D thông minh cùng cấu trúc lọc đa lớp giúp ôm vừa khuôn mặt cho cảm giác thoải mái, dễ dàng hít thở mà vẫn giữ nhiệt, độ ẩm cho mũi và họng (vào mùa đông). Sử dụng hiệu quả khi lưu thông trên đường.\r\nThoải mái giao tiếp. không lem son môi.\r\n💯 Khẩu trang không dính vào miệng, dễ thở cực kì, đây là điểm quan trọng của khẩu trang tốt đấy ah. \r\n💯 Thiết kế 3D nên ôm vừa vặn khuôn mặt, cảm giác thoải mái lắm luôn! \r\n💯 ĐẶC BIỆT KHÔNG DÍNH SON MÔI LÊN KHẨU TRANG . Cái này e phải cho mấy lần 💯💯💯 điểm =))) bởi vì ghét nhất đeo khẩu trang quẹt hết son đi đến nơi lại phải đánh lại lần nữa 😂\r\n💯 Thêm 1 điểm nữa khiến e k thể k yêu e này chính là KHÔNG LÀM MỜ KÍNH KHI ĐEO !! Chỉ ai đeo kính như e mới hiểu nỗi khổ vừa đeo kính vừa đeo khẩu trang !! \r\n💯  Quai đeo êm ái, mềm mại, không làm đau tai và không gây hằn trên khuôn mặt khi đeo lâu.\r\n💯 Với các bé có thể buộc lại phần tai đeo để đeo nhé\r\nKhẩu trang 3D FA (màu Trắng)\r\n', 67, 0.89, '2022-12-02 16:13:13', '2022-12-02 16:13:13'),
(66, 1, 6, 'Đai chống gù lưng - vai - eo - chất liệu bền-thoáng - ​có nẹp cố định cột sống', 'https://cf.shopee.vn/file/16a204d733737ae9048cfc049556f5f1', 'THÔNG SỐ KỸ THUẬT:\r\n+Kích thước hộp: 45x20x5\r\n+Trọng lượng: 300 gram\r\n+Chất liệu: Vải Velcro + lưới Sandwich + thun co giãn đàn hồi\r\n+5 kích thước lựa chọn:\r\n(140-160cm)	(43-50kg)	     XS\r\n(150-170cm)	(50-55kg)	     S\r\n(165-175cm)	(55-70kg)	     M\r\n(170-180cm)	(70-85kg)	     L\r\n(175-185cm)    (80-90kg)     XL\r\n\r\nTÍNH NĂNG ƯU VIỆT:\r\n✅ Điều chỉnh dáng đứng và dáng ngồi thẳng để không ảnh hưởng cột sống và phòng chống đau, gù lưng, chuyên dụng cho dân văn phòng, học sinh ngồi làm việc & học tập nhiều.\r\n✅ Có 02 thanh trợ lực bằng thep ở phía sau \r\n✅ Giải thoát bạn khỏi các cơn đau lưng một cách nhanh chóng nhờ công dụng hỗ trợ hoạt động của vai và cổ tối đa.\r\n✅ Tiện lợi và dễ dàng sử dụng: trọng lượng gọn nhẹ, chất liệu cao cấp trong thiết kế hiện đại và thích nghi tối đa với cơ thể.\r\n✅ Nam châm từ trường giúp làm dịu cơn đau ở cột sống thắt lưng và thúc đẩy lưu thông máu..\r\n✅ Nhiều kích cỡ phù hợp với trẻ em, người lớn. Hữu ích khi ngồi làm việc, học tập, thể thao....mang hàng ngày thoải mái.\r\n\r\nHƯỚNG DẪN SỬ DỤNG:\r\n-Chỉ cần đeo từ 2-4h mỗi ngày và đeo một cách đầy đặn\r\n-Chăm chỉ đeo mỗi ngày chỉ với thời gian ngắn bộ nhớ cơ sẽ tự động hình thành ngay cả khi bạn không đeo đai. \r\n-Cơ thể sẽ tự điều chỉnh và trở nên khỏe mạnh hơn một cách rất tự nhiên.\r\n\r\nHƯỚNG DẪN CHỌN SIZE\r\n(150-170cm)	(45-55kg)	     S\r\n(165-175cm)	(55-70kg)	     M\r\n(170-180cm)	(70-85kg)	     L\r\n(175-185cm)    (80-90kg)     XL\r\n\r\n*LƯU Ý : BẠN NÊN CHỌN SIZE ĐAI GÙ LƯNG NHỎ HƠN 1 SIZE ÁO SƠ MI MÌNH ĐANG MẶC.\r\nVí dụ: nếu bạn đang mặc áo sơ mi size L thì bạn nên chọn đai chống gù lưng size M để đạt hiệu quả tối đa.', 300, 2.98, '2022-12-02 16:13:13', '2022-12-02 16:13:13');
INSERT INTO `product_new` (`id`, `id_shop`, `id_category`, `product_name`, `product_image`, `product_description`, `product_quanlity`, `product_price`, `created_at`, `updated_at`) VALUES
(67, 1, 6, 'Miếng Dán Massage Xung Điện EMS Tích Hợp 6 Chế Độ, Giảm Nhức Mỏi Cổ Vai Gáy Hiệu Quả, Thư Giãn Cơ', 'https://cf.shopee.vn/file/8204083a82297f51e897a65c1b86c577', 'Miếng Dán Massage Xung Điện EMS Tích Hợp 6 Chế Độ, Giảm Nhức Mỏi Cổ Vai Gáy Hiệu Quả, Thư Giãn Cơ\r\nSản phẩm có 2 phân loại hàng, các bạn lưu ý đọc thông tin trước khi đặt hàng nhé. Về công năng cả 2 loại đều giống nhau, chỉ khác về nguồn pin thôi bạn nhé \r\n- Pin Tiểu AA: Dùng pin tiểu (pin dùng cho điều khiển tivi, máy lạnh..) để hoạt động, sử dụng hết pin thì thay pin mới phía sau nắp. \r\n- Pin Sạc USB: Tích hợp sạc USB, dùng hết pin chỉ cần cắm dây sạc như điện thoại bình thường. Không cần thay pin. Thời gian sạc đầy pin 30-45 phút. Sử dụng liên tục từ 100 - 160 phút. \r\nLoại sạc USB xài tiết kiệm hơn dùng pin tiểu nhiều bạn nhé\r\n\r\n✔️ Miếng dán mỏng nhẹ ôm khít vào vùng cổ, vai gáy, tay chân\r\n✔️ Xung điện EMS cực mạnh với tốc độ 1000 lần/phút\r\n✔️ Làm mềm cơ, xua tan các cơn đau mỏi nhanh chóng\r\n✔️ Dòng điện EMS tần số từ 1-100Hz tùy chỉnh\r\n✔️ Massage linh hoạt với 6 kiểu và nhiều cường độ\r\n✔️ Có thể sử dụng với nhiều vị trí trên cơ thể\r\n✔️ Thiết bị rất gọn nhẹ, có thể mang theo bất cứ đâu\r\n\r\n🎯 Lưu ý:\r\n- Khi massage bạn nên nới lỏng các cơ bắp để liệu pháp massage được hiệu quả hơn.\r\n- Miếng dán sau khi sử dụng nên dùng miếng dán bảo vệ dán vào, tránh dơ và khô lớp gel miếng dán.\r\n- Khi mở máy ra khỏi miếng dán nên dùng một lực vừa đủ tránh làm hư miếng dán.\r\n\r\n🎯 Thông số kỹ thuật :\r\nĐiện áp: Pin Lithium 4.7V\r\nChế độ massage: 6 (A-F)\r\nTần số: 1-100Hz\r\nThời gian sử dụng: 15 phút\r\nĐiện áp đầu ra: 9.8mA\r\nKích thước đóng gói: 13.5x15.3x2.8cm\r\nTrọng lượng đóng gói: 120g\r\n\r\n🎯 CAM KẾT HẬU MÃI:\r\n    ✔ Shop sẽ hỗ trợ khách hàng nhận hoàn trả sản phẩm trong 3 ngày với các trường hợp sau:\r\n    ▪ Sản phẩm bị lỗi do nhà sản xuất\r\n    ▪ Sản phẩm bị hư hại trong quá trình vận chuyển', 65, 2.93, '2022-12-02 16:15:37', '2022-12-02 16:15:37'),
(68, 1, 6, 'Massage đầu cây mát xa đầu thư giãn thông minh (MSD01)', 'https://cf.shopee.vn/file/cac6df564b7e2df1e9c153beb046fa95', 'THÔNG TIN SẢN PHẨM\r\n\r\n– Cây massage đầu giúp thư giãn xua tan căng thẳng học tập , làm việc mệt mỏi cuộc sống có nhiều chọn lựa khó khăn\r\n\r\n– Những lúc da đầu ngứa ngáy, khó chịu bạn cũng có thể sử dụng cây massage này.\r\n\r\n– Sử dụng cây massage đầu thường xuyên có thể giúp cho trí nhớ tốt hơn, thần kinh thoải mái hơn.\r\n\r\n– Thích hợp cho gia đình, du lịch và văn phòng sử dụng\r\n\r\n– Loại bỏ các và mệt mỏi cơ bắp và cải thiện lưu thông máu bằng cách massage đầu hoặc điểm trên cơ thể\r\n\r\n– Chất liệu chính: Thép\r\n\r\n– Màu sắc: đa dạng - giao ngẫu nhiên\r\n\r\n– Kích thước: 22 cm\r\n\r\n– Trọng lượng: 35g\r\n\r\nTHÔNG TIN HÀNG HÓA:\r\n– Đơn vị sản xuất: Pingxiang Xin\'an Industry Co.,Ltd\r\n– Địa chỉ: Anyuan district, Pingxiang city, Jiangxi province, China\r\n– Xuất xứ: Trung Quốc\r\n– Thương nhân nhập khẩu, phân phối, chịu trách nhiệm sản phẩm và bảo hành: Công ty cổ phần ecotop\r\n– Địa chỉ: Số 22 ngách 44 ngõ 158 Trương Định, phường Trương Định, Hai Bà Trưng, Hà Nội\r\n– MST: 0109773706\r\n\r\nCAM KẾT:\r\n– Liên tục cập nhật những mặt hàng mới nhất với giá cả rẻ nhất để khách hàng lựa chọn\r\n– Giao hàng tận nhà – nhận hàng tận nơi trong thời gian ngắn nhất\r\n– Được đổi trả 1 đổi 1 hoàn toàn miễn phí nếu sản phẩm khi nhận hàng bị vỡ – hỏng – không giống hình ảnh\r\n– Hỗ trợ giải quyết đơn hàng trong thời gian sớm nhất với phương án tốt nhất để khách hàng luôn cảm thấy hài lòng và yên tâm khi mua sắm.', 659, 0.30, '2022-12-02 16:15:37', '2022-12-02 16:15:37'),
(69, 1, 6, 'Bao Tay Cao Su Y Tế Đen Không Bột hộp 100 chiếc ( 50 đôi). Găng Tay Đen Siêu Dai Sử Dụng Trong Tóc Spa Phun Xăm Thẩm Mỹ', 'https://cf.shopee.vn/file/sg-11134201-22100-wt7v574rf5iv1d', 'Bao Tay Cao Su  Y Tế Đen Không Bột Găng Tay Đen Siêu Dai Sử Dụng Trong Tóc Spa Phun Xăm Thẩm Mỹ\r\n🌈 Shop BT Company cung cấp thiết bị, vật dụng tiêu hao cho spa với giá cả rẻ nhất  thị trường VN, đảm bảo chất lượng tới khách hàng!\r\n🔸🔸🔸Hãy FOLLOW shop để nhận Voucher ưu đãi của shop🔸🔸\r\n----------------❤️❤️❤️----------------- \r\nTHÔNG TIN SẢN PHẨM Bao Tay Cao Su  Y Tế Đen :\r\n✔️ Được Sử dụng trong lĩnh vực yte thực phẩm dược mỹ phầm các dịch vụ làm đẹp\r\nsalon tóc spa phun săm tattoo Bao tay Y tế không bột Bao tay đen\r\n✔️ Hàng của công ty chính hãng\r\nHàng Tái Sử Dụng Nhiều lần \r\nLƯU Ý: \r\n- Khách yêu vui lòng đo bảng size shop hướng dẫn phía trên sản phẩm ( Với việc khách nhận size không vừa tay shop không nhận giải quyết)\r\n\r\n- Với Các đơn hàng có hộp, mẫu hộp giao ngẫu nhiên tuỳ vào từng đợt lô hàng về mà có sự thay đổi mẫu mã khác nhau . Rất mong Quý Khách Hàng cảm thông cho việc này! hãy inbox shop để chọn mẫu hộp nhé!\r\n\r\n- Mẫu găng bên shop có 2 phân loại là 3,5gr/chiếc và 4gr/chiếc; Tuỳ theo mục đích sử dụng mà khách hàng inbox riêng hoặc ghi chú cho shop nhé! Nếu không có shop xin lựa chọn ngẫu nhiên ạ!\r\n\r\n- Bao Tay Cao Su  Y Tế Đen  là một loại găng tay bảo hộ lao động được sử dụng phổ biến hiện nay với nhiều tính năng và đặc điểm nổi bật, nó thường được sử dụng đặc biệt trong các môi trường phòng sạch đòi hỏi độ tinh sạch cao.\r\n\r\n– Size: S -  M \r\n– Màu sắc: Đen\r\n– Đóng gói: 50 đôi / 1 hộp = 100 chiếc\r\n– Đặc điểm: không trơn trượt, không thấm nước, không hôi mùi\r\n– Lĩnh vực ứng dụng: Xăm hình, thẩm mỹ viện, phòng thí nghiệm, cơ khí, làm sạch, sơn…\r\n\r\n- Bao Tay Cao Su  Y Tế Đen là loại cao su tổng hợp, có tính chống nước, kháng dầu tốt nên găng tay  được ứng dụng rộng rãi trong tất cả các ngành nghề đòi hỏi vệ sinh cao như kiểm nghiệm, nha khoa và chăm sóc sức khoẻ cũng như ngành nghề ngoài y khoa như công nghiệp, chế biến thực phẩm. . .\r\n\r\n---------------❤️❤️❤️----------------- \r\n🌈🌈 Shop BT Company cam kết:\r\n1. Sản phẩm Bao Tay Cao Su  Y Tế Đen chính hãng.\r\n2. Sản phẩm được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách.\r\n3. Hàng có sẵn, giao hàng ngay khi nhận được đơn.\r\n4. Shop sẽ cố gắng trả lời hết những thắc mắc xoay quanh sản phẩm nhé.\r\n--------------------------\r\nII. HỖ TRỢ ĐỔI TRẢ THEO QUY ĐỊNH\r\n- Điều kiện áp dụng (trong vòng 2 ngày kể từ khi nhận sản phẩm)\r\n- Hàng hoá bị rách, in lỗi, bung chỉ, và các lỗi do vận chuyển hoặc do nhà sản xuất.\r\n1. Trường hợp được chấp nhận:\r\n- Hàng giao sai size khách đã đặt hàng\r\n- Giao thiếu hàng\r\n2. Trường hợp không đủ điều kiện áp dụng chính sách:\r\n- Quá 2 ngày kể từ khi Quý khách nhận hàng\r\n- Gửi lại hàng không đúng mẫu mã, không phải sản phẩm\r\n- Không thích, không hợp, đặt nhầm mã, nhầm màu,...\r\n\r\n💝Shop xin cảm ơn bạn đã tin tưởng và chọn sản phẩm của Shop.\r\n💝Hy vọng bạn hài lòng với sản phẩm của Shop và  đừng quên giới thiệu bạn bè của bạn nhé!', 100, 2.51, '2022-12-02 16:18:25', '2022-12-02 16:18:25'),
(70, 1, 6, 'NƯỚC NGÂM KÍNH ÁP TRÒNG - NUỚC NHỎ MẮT ( AQUA B5 )', 'https://cf.shopee.vn/file/e97bea77f748474966858d7ad110649d', 'LƯU Ý KHI ĐẶT HÀNG\r\n♥︎ Giá trên sản phẩm là giá 1 cặp, không phải giá 1 chiếc\r\n♥︎ TẶNG KÈM KHAY GƯƠNG CÓ BỘ DỤNG CỤ ĐEO\r\n♥︎ Lens cận sẽ thường xuyên cập nhật số lượng nên các mẫu sẽ không cố định độ\r\n♥︎ Khách muốn check lens độ có sẵn vui lòng DIRECT qua INSTAGRAM : @glossylens.vn\r\n\r\nTHÔNG SỐ KĨ THUẬT\r\n♥︎ DIA : 14.2mm \r\n♥︎ Graphic DIA : 13.5mm\r\n♥︎ HẠN SỬ DỤNG  : 3 - 6 tháng ( 3 năm khi chưa khui )\r\n♥︎ SẢN XUẤT : Hàn Quốc\r\n\r\n♥︎ BẢO HÀNH MIỄN PHÍ KHI LENS CÓ DẤU HIỆU CỘM VÀ BẤT KỲ CÁC TRƯỜNG HỢP LỖI\r\n\r\n♥︎ Xem tổng hợp hình ảnh FEEDBACK của khách hàng tại INSTAGRAM \r\n\r\n♥︎ HOTLINE : 090 866 2973\r\n♥︎ INSTAGRAM : glossylens.vn\r\n♥︎ SHOPEE : glossylens.vn', 340, 2.17, '2022-12-02 16:18:25', '2022-12-02 16:18:25'),
(71, 1, 6, 'Nước Ngâm + Nhỏ Mắt Chuyên Dụng Cho Lens Thương Hiệu Fresh Eye Xanh Hồng', 'https://cf.shopee.vn/file/sg-11134201-22100-3s1xicb6azivb7', '💧💧 Nước Ngâm chuyên dụng 150ml:\r\n🌵Thành phần chính: 20% polyhexamethylenbiguanide Hydrochloride, boric Acid, Sodium chloride, potassium chloride, Poloxamer 407, Hydroxyethylcellulose, Hypromellose, Sodium Hyaluronate, Purified Water.\r\n🌵Tác dụng: Rửa kính áp tròng, khử trùng, bôi trơn loại bỏ protein. Là sản phẩm rất cần thiết khi sử dụng kính áp tròng, với tác dụng làm sạch, bảo vệ kính, tránh vi khuẩn. Giúp kính luôn giữ ở trạng thái tốt nhất, chống khô mắt, đảm bảo an toàn và kéo dài tuổi thọ cho kính.\r\n\r\n✅Hướng dẫn sử dụng: Rửa thật sạch trước khi lấy kính áp tròng ra khỏi mắt. Nhỏ 3 giọt nước ngâm Aqua B5 lên bề mặt kính áp tròng và thoa nhẹ trong khoảng 20 giây. Tráng sơ lại kính áp tròng trong 5 giây. Đặt kính vào khay đã đựng dung dịch Aqua B5. Ngâm ít nhất 4 tiếng. Luôn luôn sử dụng nước ngâm mới cho mỗi lần ngâm kính áp tròng.\r\n\r\n💧💧 Nước nhỏ mắt :\r\n🌵 Thành phần: Dung dịch Acid Hyaluronic đã được sử lý tiệt trùng.\r\n🌵 Tác dụng: Cung cấp độ ẩm cho mắt, giúp bạn không bị mỏi hay khô mắt. Ngoài ra, dung dịch còn có khả năng làm ẩm kính áp tròng trong khi sử dụng.\r\nNhỏ mắt trước khi đeo kính để rửa trôi những bụi bám trong mắt trước, phòng khi đeo kính vào bị cộm, khó chịu. Và nhỏ mắt trước khi tháo kính, phòng trường hợp mắt bạn khô, khiến kính khô, khi tháo ra dễ bị dính kính hay hỏng kính.\r\n🌵 Chống chỉ định : Không sử dụng sản phẩm khi có dấu hiệu mẫn cảm với thành phần Drop Aqua B5\r\n✅ Hướng dẫn sử dụng : Trong quá trình sử dụng, nhỏ 2 hoặc 3 giọt và chớp mắt khi mắt có cảm giác khó chịu. Nếu tình trạng không được khắc phục, lập tức lấy kính ra khỏi mắt và liên hệ bác sĩ.\r\n🌵 Hạn sử dụng 3 tháng sau khui lọ, các tình yêu nên note ngày khui trên lọ để tiện theo dõi nhé\r\n🌵 Chế độ bảo hành; 1 đổi 1 nếu sản phẩm sai khác về mẫu mã,bể vỡ hàng hóa vui lòng liên hệ 0347282838 để được hướng dẫn !', 128, 1.91, '2022-12-02 16:21:16', '2022-12-02 16:21:16'),
(72, 1, 6, 'Dụng Cụ Mát Xa Cổ Cầm Tay Giúp Giảm Áp Lực Tiện Dụng', 'https://cf.shopee.vn/file/935e878f810fb6da14085f600e477888', 'Thông tin chi tiết:\r\n100% hàng mới, chất lượng cao\r\nThông tin chi tiết:\r\nChất liệu: PP + TPR\r\nKích thước: 35 * 18 cm\r\nMàu sắc: hồng, xanh\r\nTrọn gói bao gồm: 1x Máy mát xa cột sống cổ\r\n\r\nĐặc điểm:\r\n1. Máy mát xa cột sống cổ này có sáu đầu massage con lăn mềm mại và đàn hồi, cho phép bạn thoải mái điều chỉnh hướng của đầu massage và massage các điểm cột sống cổ theo nhu cầu thực tế.\r\n2. Thiết kế đường cong kép giúp vai và cổ thoải mái hơn, thuận tiện hơn cho bạn thư giãn cột sống cổ mọi lúc, mọi nơi.\r\n3. Hỗ trợ đàn hồi được làm bằng chất liệu nhựa PP thân thiện với da, bền, đàn hồi và không dễ gãy.\r\n4. Tay cầm chống trượt phù hợp với thiết kế tiện dụng, dễ dàng kiểm soát độ bền và sử dụng, cho cảm giác cầm nắm thoải mái.\r\n5. Nó không chỉ có thể được sử dụng trên cổ, mà còn có nhiều phần của toàn bộ cơ thể.\r\n6. Nó phù hợp cho những người ngồi lâu lúc làm việc, những người có đầu hạ thấp, khó chịu cổ tử cung và những người có tư thế ngồi không chính xác.\r\n\r\nGhi chú:\r\n1. Do sự khác biệt về ánh sáng và màn hình, màu sắc của sản phẩm có thể hơi khác so với hình ảnh.\r\n2. Vui lòng cho phép sự khác biệt kích thước nhỏ do đo lường thủ công khác nhau. Cảm ơn bạn đã thông cảm! Mua sắm vui vẻ!\r\nDụng cụ mát xa cổ Con lăn Dụng cụ Massage cổ đeo vai Trigger Point Giảm áp lực Sơ mi sâu Cầm tay Mới cầm tay', 150, 2.64, '2022-12-02 16:21:16', '2022-12-02 16:21:16'),
