(75, 1, 7, 'BÓNG ĐÁ SỐ 4 DA CAO CẤP SIÊU PHẨM MỚI(TẶNG TÚI LƯỚI+KIM BƠM+1 ĐÔI TẤT DÀI ĐÁ BÓNG) TRẮNG ĐỎ', 'https://cf.shopee.vn/file/4c9d91aabad9e5406973c0bf2c286e5e', 'Bóng đá số 4  MẪU MỚI 2021 là bóng luyện tập và thi đấu chính thức tại các giải thi đấu \r\nBóng được làm từ chất liệu da cao cấp cao cấp.\r\nBóng có cấu tạo nhiều lớp, ruột làm bằng cao su cao cấp, giữ hơi tốt.\r\nBóng có phù hợp với nhiều loại sân như sân cỏ thường, sân cỏ nhân tạo...\r\nMẫu bóng ngoại hạng dưới đây với gam màu chính là đen, xanh, trắng khỏe khoắn. Khi lăn trên sân chắc chắn sẽ tạo ra hiệu ứng phối màu bắt mắt, thể thao.    \r\n.\r\nMàu sắc: Trắng pha mầu\r\nKích thước: 680 – 700mm.\r\nTrọng lượng: 410 – 450g.\r\nĐộ nảy: 115 -155cm.\r\nĐộ ổn định: 3,8mm.\r\nĐộ thấm nước: 15%.\r\nNhà sản xuất: CTY BÁCH HIỀN', 450, 3.83, '2022-12-02 21:32:44', '2022-12-02 21:32:44'),
(76, 1, 7, 'Giầy đá bóng ba sọc KHÂU FULL ĐẾ + TRỰC TIẾP TỪ XƯỞNG + BẢO HÀNH 3 THÁNG', 'https://cf.shopee.vn/file/073518d71677823f6785d2f23387f455', 'GIẦY ĐÁ BÓNG PHỦI 3 SỌC CT3 có đế TF , cổ thấp , thích hợp đá bóng trên mặt sân cỏ nhân tạo Nhưng cũng có thể đá trên sân cỏ tự nhiên ko vấn đề, sản phẩm được giới đá bóng phủi săn lùng . Giá tiền lại rất hợp lý cho a e chuyên bóng đá phủi !\r\n\r\n■ Size: 38-39-40-41-42-43\r\n■ Chất liệu da PU, chống thấm nước\r\n■ Đế giầy cao TF giúp tăng khả năng bám trụ\r\n■ Họa tiết logo sắc nét\r\n■ Full khâu đế , chắc chắn , bền bỉ\r\n\r\n_________________________________________________\r\nPDS - hệ thống cửa hàng thể thao chuyên nghiệp cam kết với khách hàng :\r\n1. Giao hàng đúng hình ảnh và miêu tả\r\n2. Hoàn tiền 100% nếu sai sự thật\r\n2. Đổi trả miễn phí nếu giao sai hàng do lỗi người bán ( Nếu sản phẩm giao đúng thỏa thuận nhưng không vừa khách hàng vẫn có thể đổi trả nhưng phí người mua sẽ trả )\r\n* Chú ý :\r\n- Liên hệ shop để được tư vần Size cho phù hợp\r\n- Liên hệ để shop kiểm tra chi tiết hàng tồn và giao cho bạn sản phẩm ưng ý nhất\r\n- Liên hệ để đặt buôn và được hỗ trợ phí ship\r\nLiên hệ ngay để đặt đội có nhiều ưu đãi :\r\n✓ Miễn phí thiết kế logo + in ấn\r\n✓ Giảm giá + tặng thêm quà\r\n✓ Miễn phí ship hàng toàn quốc ( hoặc hỗ trợ 1 phần nếu ship quá cao )\r\n✓ Tặng mã giảm giá cho toàn đội khi mua thêm sản phẩm khác tại shop\r\nLIÊN HỆ: 0866174762', 320, 4.68, '2022-12-02 21:32:44', '2022-12-02 21:32:44'),
(77, 1, 7, 'Bó Gối Thể Thao Bảo Vệ Đầu Gối Chơi Đá Bóng Bóng Rổ Bóng Chuyền Băng Đầu Gối Tập Gym Chạy Bộ Tennis Cầu Lông Đạp Xe Yoga', 'https://cf.shopee.vn/file/cc25bddbc4edb9cef0906e8b5996a915', '❖ ĐẶC ĐIỂM NỔI BẬT CỦA BÓ GỐI THỂ THAO BG/02\r\n\r\n✔ Vải dệt 3D thoáng khí, không tạo cảm giác khó chịu, bí bách\r\n\r\n✔ Bó gối thiết kế dạng ống, ôm chắc khớp gối, dây chằng và xương bánh chè. Phù hợp với form chân người Việt\r\n\r\n✔ Chất liệu mềm mại, an toàn với da, co giãn 4 chiều dễ dàng đeo tháo\r\n\r\n✔ Thiết kế nguyên khối, không có vết cuộn tạo sự hằn đỏ ngăn lưu thông máu\r\n\r\n--------------------------------------------\r\n\r\n❖ VÌ SAO BĂNG BẢO VỆ KHỚP GỐI LẠI CẦN THIẾT CHO BẠN?\r\n\r\n-  Chấn thương đầu gối là loại chấn thương bạn dễ gặp phải nhất khi hoạt động thể thao, đặc biệt với các môn có cường độ cao, đòi hỏi sự vận động liên tục như bóng đá, bóng rổ, chạy bộ, tập gym...Vì vậy, với các công dụng dưới đây, bó gối thể thao là phụ kiện không thể thiếu dành cho bạn.\r\n\r\n✔ Bảo vệ đầu gối trước các chấn thương:\r\n\r\n  • Tổn thương dây chằng chéo trước\r\n\r\n  • Bong gân, rách gân cơ\r\n\r\n  • Trật khớp, rách sụn chêm\r\n\r\n  • Viêm bao hoạt dịch khớp\r\n\r\n  • Tổn thương dây chằng hai bên\r\n\r\n  • Tổn thương xương bánh chè\r\n\r\n✔ Tạo cảm giác tự tin khi thi đấu hay tập luyện\r\n\r\n  • An toàn, thoái mái trong vận động giúp bạn nâng cao hiệu quả tập luyện và thành tích thi đấu\r\n\r\n  • Loại bỏ tâm trạng lo lắng, vừa lo đối phó với đối phương, vừa lo cơ thể bị chấn thương đặc biệt là tại vùng gối.\r\n\r\n✔ Đặc biệt cần thiết với người có tiên sử chấn thương khớp gối\r\n\r\n  • Giữ ấm đầu gối, cải thiện tuần hoàn máu\r\n\r\n  • Giảm sưng, giảm đau, giảm áp lực khi thực hiện các bài tập nặng\r\n\r\n  • Bảo vệ toàn diện vùng gối, khiến quá trình hồi phục diễn ra nhanh hơn.', 300, 1.91, '2022-12-03 09:08:44', '2022-12-03 09:08:44'),
(78, 1, 7, 'Áo bóng đá 22/23 ,manchester united, man city, arsenal, liverpool, tottenham, psg, milan, munich, real madrid, barcelona', 'https://cf.shopee.vn/file/sg-11134201-22110-akkm0bgzzzjvd0', 'XIN LƯU Ý : VÌ LÀ SET QUẦN ÁO THỂ THAO NÊN SP SẼ PHÙ HỢP CHO CẢ NAM LÂN NỮ\r\n\r\n•    Chất vải thun lạnh Việt Nam chất lượng.\r\n•    Co dãn nhẹ, thoáng mát thoải mái vận động, an toàn sức khỏe\r\n•    KHÔNG XÙ – KHÔNG BAI NHÃO\r\n•    Chi tiết in - thêu sắc nét, chắc chắn, không lo bong tróc\r\n\r\n•    Đường may kỹ càng, chắc chắn\r\n\r\n     - Bộ bóng đá  thích hợp dùng cho nhiều môn thể thao khác nhau\r\n\r\n     - Bộ quần áo bóng đá không chỉ dành để đi đá bóng mà còn có thể mặc tham gia các hoạt động thể thao thường ngày khác nhau hoặc đơn giản là mặc ở nhà, rất thoải mái.\r\n\r\nQUÝ KHÁCH CẦN IN TÊN SỐ VUI LÒNG MUA THÊM PHẦN IN CHUNG 1 ĐƠN VỚI BỘ QUẦN ÁO BÓNG ĐÁ ĐỂ NHÂN VIÊN SHOP ĐÓNG HÀNG TRÁNH BỎ SÓT PHẦN IN ẤN \r\n\r\nBộ áo gồm có 5 size :\r\n_Size S phù hợp cho người cao 1m50- 1m60 nặng 45- 53kg.\r\n\r\n_Size M phù hợp cho người cao 1m60- 1m68, nặng 53-60kg.\r\n\r\n_Size L : phù hợp cho người cao 1m68-1m75, nặng 60-70kg.\r\n\r\n_Size XL : phù hợp cho người cao 1m75-1m80, nặng 70-80kg.\r\n\r\n_Size XXL : phù hợp cho người cao 1m75 trở lên và nặng 80-88kg.\r\n\r\n***lưu ý : bảng size chỉ có giá trị tham khảo, các trường hợp đặc biệt vui lòng ib shop để được tư vấn thêm\r\nHƯỚNG DẪN GIẶT\r\n– Giặt bằng tay, giặt với nước lạnh\r\n– Nên giặt riêng sản phẩm trong những lần giặt đầu tiên\r\n– Không ngâm đồ quá lâu trong dung dịch có độ tẩy cao.\r\n– Không để xà phòng, hóa chất trực tiếp lên sản phẩm có hình in.\r\n– Nếu cần ủi đồ, hãy ủi ở nhiệt độ thấp và tránh ủi trực tiếp các chi tiết in lụa (nếu có)\r\n\r\n\r\nPhom áo chuẩn người Việt \r\n\r\nThân áo in chuyển nhiệt đẹp\r\n\r\nLogo dệt sắc nét\r\n\r\nVải thun lạnh thoáng mát, thấm hút mồ hôi\r\n\r\n HUNGSPORT TN  Áo Bóng Đá _CAM KẾT : \r\n1 :Giao nhanh\r\n2 : Đúng mẫu.\r\n3 : Đúng size.\r\n4 : Bao đổi trả trong 3 ngày sau khi nhận hàng theo quy định của shopee và 7 ngay theo chính sách riêng của HUNGSPORT TN \r\n***( Riêng với những áo đã in tên số theo yêu cầu quý khách vui lòng chọn kỹ size áo. ) \r\n\r\n - khi nhận hàng, nếu kiểm tra có bất kỳ sai sót nào từ phía Shop như: in sai tên, in sai số hoặc in nhầm size áo (theo bảng thông tin in đã xác nhận với quý khách trước khi in) thì quý khách vui lòng báo lại, nếu kiểm tra đúng sai sót từ phía shop, shop sẽ làm lại những bộ sai và gửi lại quý khách hoàn toàn miển phí\r\n\r\n_Địa chỉ cửa hàng : số 698, Tôn Đức Thắng , Long Thành Nam, thị xã Hòa Thành, Tây Ninh\r\n\r\nĐặt đội các bạn liên hệ CSKH : 0856777957 (có Zalo )', 700, 4.04, '2022-12-03 09:08:44', '2022-12-03 09:08:44'),
(79, 1, 7, 'Áo giữ nhiệt nam dài tay full size thể thao 6 màu cá tính Áo thun nam cổ tròn vải mềm mại siêu co giãn 2c', 'https://cf.shopee.vn/file/6e7cf8b70a2e9613881022ec14755d78', 'Áo giữ nhiệt nam dài tay thể thao  màu. Áo thun nam cổ tròn basic vải mềm mại 2c\r\n\r\n- Áo giữ nhiệt nam được thiết kế theo đúng form chuẩn của nam giới Việt Nam\r\n- Chất liệu cực mềm mịn (áo vải thun mịn co dãn)\r\n- Đem lại sự thoải mái tiện lợi nhất cho người mặc\r\n\r\n♥️ Áo thun nam là phụ kiện thời trang đơn giản nhưng không thể thiếu. Các anh có thể mặc áo thun nam ờ nhà, hay mặc đi chơi đi dạo phố......\r\n\r\nKhéo léo kết hợp trang phục cùng phụ kiện, bạn dễ dàng mang lại một set đồ hài hòa, thể hiện được cá tính riêng của bạn\r\n🎀Trong thế giới thời trang của phái mạnh Áo thun nam thể thao hay Áo giữ nhiệt nam luôn chiếm một vị trí quan trọng.\r\n\r\nÁo thun nam thể thao hợp dáng người, hợp màu sắc không chỉ khỏe khoắn mà còn rất thời trang.\r\n\r\nMang tới cho các anh chàng sự thoải mái khi đi dạo phố hoặc hẹn hò bè bạn , những chiếc áo giữ nhiệt nam cao cấp đã trở thành người bạn không thể thiếu của các chàng\r\n\r\nVà nếu bạn cũng đang đi tìm một áo thun nam đẹp thời trang thể thể hiện được cá tính của bản thân một cách rõ nét nhất và đang... lạc lối, thì hãy cùng khám phá và cảm nhận trên sản phẩm của LT.Sport chúng mình nhé\r\n\r\n🔸  Mẹo Nhỏ Giúp Bạn Bảo Quản Quần áo nam : \r\n-  Đối với sản phẩm quần áo mới mua về, nên giặt tay lần đâu tiên để tránh phai màu sang quần áo khác\r\n-  Khi giặt nên lộn mặt trái ra để đảm bảo độ bền \r\n-  Sản phẩm phù hợp cho giặt máy/giặt tay\r\n - Không giặt chung đồ Trắng và đồ Tối màu \r\n\r\na) Thành phần : vải Cotton co giãn\r\nb) Thông số kỹ thuật; \r\n♥️ Màu sắc có 6 màu : Đen, Trắng, Đỏ, Xanh, Than, Xám\r\nHướng dẫn chọn size áo thun nam:\r\n- M (45-52Kg, <1m67)\r\n- L (53-62Kg, <1m73)\r\n- XL (63-72Kg, <1m77)\r\n- 2XL (73-80Kg, <1m80)\r\nc) Thông tin cảnh báo;\r\n- Với tất cả các sản phẩm thời trang -> Giặt 1 lần trước khi sử dụng để đảm bảo an toàn cho da\r\nd) Hướng dẫn sử dụng, hướng dẫn bảo quản;\r\n- Không dùng móc dị dạng phơi áo\r\n- Khi giặt Lộn trái áo để quần được bền nhất\r\n- Không giặt chung với chất tẩy rửa mạnh\r\nđ) Năm sản xuất: 2022\r\n\r\n🔸 CK STORE CAM KẾT\r\nSản phẩm 100% giống mô tả. Kiểu dáng hoàn toàn giống ảnh mẫu\r\nÁo được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách\r\nHàng có sẵn, giao hàng ngay khi nhận được đơn \r\nHoàn tiền nếu sản phẩm không giống với mô tả\r\nChấp nhận đổi hàng khi size không vừa\r\nGiao hàng trên toàn quốc, nhận hàng trả tiền \r\nHỗ trợ đổi trả theo quy định của Shopee\r\nDo màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%', 49, 1.28, '2022-12-03 09:12:39', '2022-12-03 09:12:39'),
(80, 1, 7, 'Tất đá bóng 💙FREESHIP💙 vớ đá banh, tất bóng đá chống trượt cao cấp', 'https://cf.shopee.vn/file/c0ecbb778be11c405bab1121721779f5', '👑👑 👑 Mô tả sản phẩm 👑 👑 👑 \r\n\r\n🔥 Tất chống trơn, vớ chống trượt đá bóng 🔥 \r\n➡️Tất bóng đá chống trơn sẽ là phụ kiện giúp các cầu thủ không phải lo lắng việc bàn chân của mình bị trượt trong giày. \r\n➡️Bề mặt tất được phủ bởi các miếng cao su nổi hình vuông ở ngoài mặt tất cũng như trong lòng tất. Chính vì vậy bàn chân sẽ được bám tốt hơn với mặt tất, tránh cho bàn chân bị trượt trong lòng giày khi bạn chơi bóng với tốc độ cao. \r\n➡️Thiết kế co giãn, ôm chân, tạo cảm giác thoải mái, độ bền cao \r\n➡️Màu sắc bắt mắt, giúp bạn luôn nổi bật trên sân cỏ \r\n➡️Gồm 6 màu sắc khác nhau : Trắng, Đen, Xanh Dương, Đỏ, Vàng, Xanh Chuối\r\n\r\n✨✨✨Shop CAM KẾT✨✨✨ \r\n\r\n✔️Về sản phẩm: Cam kết hàng chính hãng 100%\r\n\r\n✔️Về giá cả : Shop nhập với số lượng nhiều và trực tiếp nên chi phí sẽ là RẺ NHẤT nhé. \r\n\r\n✔️Về dịch vụ: Shop sẽ cố gắng trả lời hết những thắc mắc xoay quanh sản phẩm nhé. \r\n\r\n✔️Thời gian chuẩn bị hàng: Hàng có sẵn, thời gian chuẩn bị tối ưu nhất. \r\n\r\n🎁🎁🎁 Quyền Lợi của Khách Hàng 🎁🎁🎁 \r\n\r\n✔️Chính sách bao đổi trả hàng miễn phí khi sản phẩm kém chất lượng và không giống hình, nhầm số lượng và loại hàng. \r\n\r\n✔️Khách hàng cũ : Mua lần thứ 2 trở đi sẽ được nhận mã giảm giá của shop << ib ngay cho mình nha>> để nhận nào . ', 500, 0.64, '2022-12-03 09:12:39', '2022-12-03 09:12:39'),
(81, 1, 7, 'Dây nhảy giảm cân đốt mỡ bụng lõi thép đàn hồi có tạ 2.9m tập thể dục gym muay thái tại nhà fashion86_store', 'https://cf.shopee.vn/file/f9ea6204a4338d8370f618f72e9ffd6e', 'Dây nhảy giảm cân đốt mỡ bụng dây lõi thép đàn hồi có tạ 2.9m tập thể dục gym muay thái tăng thể lực sức khỏe tại nhà\r\n\r\nThông tin chi tiết sản phẩm dây nhảy\r\n🍀 Tên sản phẩm: dây nhảy thể dục GIÁ RẺ\r\n 🍄  Màu sắc: nhiều màu\r\n 🍄Chất liệu: dây làm bằng sợi PVC và tay cầm làm bằng nhựa PP + mút\r\n 🍄 Dây dài và có độ bền rất cao, sự mài mòn thấp​\r\n 🍄Chiều dài cán cầm: ~13,5cm\r\n 🍄Độ dài dây: ~1,35m (bao gồm cán cầm)\r\n 🍄Trọng lượng: ~125g\r\n  \r\n🍀 DÂY NHẢY THỂ DỤC LỖI THÉP 2,9M KHÔNG TẠ (0tạ)\r\n 🍄Màu sắc: nhiều màu\r\n 🍄Chất liệu: dây làm bằng sợi PVC CÓ LÕI THÉP và tay cầm làm bằng nhựa PP và mút\r\n 🍄Chiều dài cán cầm: ~13cm\r\n 🍄Độ dài dây: ~2,9m (bao gồm cả tay cầm)\r\n 🍄Trọng lượng: ~142g\r\n\r\n🍀 DÂY NHẢY THỂ DỤC LỖI THÉP 2,9M CÓ TẠ\r\n🍄Màu sắc: nhiều màu\r\n 🍄Chất liệu: dây làm bằng sợi PVC CÓ LÕI THÉP và tay cầm làm bằng nhựa PP và mút\r\n 🍄Chiều dài cán cầm: ~13cm\r\n 🍄Độ dài dây: ~2,9m (bao gồm cả tay cầm)\r\n 🍄Trọng lượng: ~315g (đã bao gồm tạ)\r\n 🍄Trọng lượng tạ: ~81g/cục *2 cục\r\n\r\n- Dây nhảy được làm từ chất liệu cao cấp có độ bền rất cao, không bị đứt và có khả năng co giãn rất tốt. Phần tay cầm của dây nhảy được làm từ nhựa cứng PP khá bền bỉ và được bọc mút để chống trơn trượt trong quá trình sử dụng kể nhất là đối với những người hay bị ra mồ hôi tay.\r\n \r\n- Tay cầm của dây nhảy được thiết kế để có thể thêm tạ giúp độ nặng thích hợp và dễ sử dụng hơn.\r\n \r\nSản phẩm dây nhảy giảm cân là 1 dụng cụ vô cùng tuyệt vời để rèn luyện cơ thể, giúp tăng sức dẻo dai, sức bền, giảm cân và giữ cơ vô cùng hiệu quả. Mồ hôi được tiết ra giúp cơ thể thêm khỏe mạnh hơn. Ngoài ra, nhảy dây còn giúp giảm căng thẳng mệt mỏi.\r\n \r\nChỉ với 1 sợi dây nhảy bạn có thể luyện tập được ở mọi lúc, mọi nơi trong mọi hoàn cảnh khác nhau vô cùng tiện. Sản phẩm dây nhảy giảm cân khá nhỏ gọn để cất giữ và mang theo bất kỳ nơi đâu.\r\n \r\nChiếc dây nhảy giảm cân này được thiết kế có thể sử dụng được cho cả nam và nữ, dây không quá dài và cũng không quá ngắn, có khả năng co giãn đàn hồi rất tốt và đặc biệt là nó khá bền. Khi sử dụng bạn sẽ không bị vướng và vấp ngã. \r\nSản phẩm dây nhảy giảm cân được thiết kế thân thiện, tạo cảm giác thoải mái cho người dùng.\r\n\r\n🔥 CAM KẾT\r\n✅ SẢN PHẨM GIỐNG MÔ TẢ, MỚI 100%\r\n✅ CHẤT LƯỢNG VƯỢT TRỘI TRONG TẦM GIÁ\r\n✅ 1 đổi 1 trong vòng 7 ngày kể từ khi nhận hàng nếu lỗi do nhà sản xuất.\r\n✅ Hàng luôn có sẵn, đóng gói ngay khi nhận được đơn.\r\n✅ Tư vấn nhiệt tình, tận tâm, nhanh chóng mang đến trải nghiệm mua sắm tuyệt vời nhất cho khách hàng.', 129, 0.85, '2022-12-03 09:16:38', '2022-12-03 09:16:38'),
(82, 1, 7, 'Túi đựng giày dép du lịch thể thao đá bóng dây rút MAKAN', 'https://cf.shopee.vn/file/f2b7e12dde9f643ebb020dc2045d9026', 'Túi đựng giày dép du lịch thể thao đá bóng dây rút MAKAN!\r\n• MAKAN chuyên sản xuất đồ thể thao xuất khẩu áo đá bóng, đá banh. MAKAN có hơn 10 năm trong lĩnh vực may mặc quần áo đá bóng xuất khẩu đi các nước trên thế giới.\r\n• Chất liệu vải MÈ nhập khẩu cao cấp theo tiêu chuẩn đồ quần áo đá banh chuyên nghiệp\r\n• ÁO BÓNG ĐÁ vĩnh viễn Không bong tróc, không nhăn, không xù, không phai màu • Chất liệu vải thấm hút mồ hôi cực tốt cho quần áo đá bóng.\r\n• Thiết kế mạnh mẽ, hiện đại\r\n • ÁO BÓNG ĐÁ MAKAN mặc thoáng, mát, in sắc nét, không bong tróc theo tiêu chuẩn đồ xuất khẩu quần áo đá bóng.\r\nBạn có thể giặt máy đồ thoải mái mà không sợ bong tróc. ', 290, 0.81, '2022-12-03 09:16:38', '2022-12-03 09:16:38'),
(83, 1, 7, 'Băng keo thể thao đá bóng cuốn cổ chân cổ tay cao su non vải chống chấn thương hỗ trợ thi đấu và tập luyện', 'https://cf.shopee.vn/file/sg-11134201-22110-kay5vdr3tyjve4', 'Sport Line chuyên sỉ lẻ dụng cụ thể dục thể thao.\r\nBăng keo thể thao, Băng cuốn thể thao hiện đang được rất nhiều người chơi thể thao chuyên nghiệp và nghiệp dư ưa chuộng giúp bó các cơ khi chơi các môn thể thao, tránh chấn thương...\r\n- Độ bám cao giúp cố định các bộ phận cực chắc.\r\n- Tránh giãn khớp, giữ chắc nó để tránh những chấn thương trật khi chơi thể thao.\r\n- Giúp bạn cảm giác vô cùng thoải mái, tự tin hơn khi vận động.\r\n- Được thiết kế khá mỏng và được làm bằng cao su non giúp đảm bảo độ đàn hồi cũng như độ thông thoáng cho da, có thể sử dụng từ 2 đến 3 lần.\r\n- Sản phẩm y hình (ảnh chụp từ sản phẩm).\r\nĐặc tính băng keo thể thao:\r\n- 100% thương hiệu mới, chất lượng cao.\r\n- Nói KHÔNG với dính lông chân, làm đau khi tháo băng.\r\n- Không thấm nước và thoáng khí.\r\n- Hỗ trợ cho những người chơi thể thao, đặc biệt là những môn thể thao đòi hỏi cường độ vận động lớn và dễ tổn thương cơ như : bóng đá, bóng chuyền, tennis, bóng rổ.\r\n- Bảo vệ người dùng khỏi chấn thương nặng hơn.\r\n- Cao su non với độ xoắn cao, cung cấp sức mạnh rất mạnh, độ đàn hồi rất tốt.\r\n- Xé rất dễ dàng với chất liệu cao su non\r\n\r\nCAM KẾT TỪ Shop Sport Line\r\n✔️Sản phẩm 100% như hình\r\n✔️Bảo hành 1 đổi 1 do lỗi của nhà sản xuất\r\n✔️Bán buôn, bán lẻ giá tốt nhất\r\n✔️Giao hàng ngay khi có đơn.\r\n✔️Phương châm của shop uy tín và chất lượng đặt lên hàng đầu.\r\n✔️ Tư vấn miễn phí, hệ thống chăm sóc khách hàng 24/7\r\n✔️  Follow Shop ngay, để được nhận ngay các Mã Giảm Giá  và ƯU ĐÃI DÀNH RIÊNG cho  Follower.\r\n✔️ Bấm lưu  sản phẩm để bạn xem/mua khi cần. ', 290, 0.34, '2022-12-03 09:19:16', '2022-12-03 09:19:16'),
(84, 1, 7, 'Găng tay thể thao thoáng khí chống nắng thích hợp để chơi thể thao ngoài trời', 'https://cf.shopee.vn/file/733a5f3a1b566d8a69a954d5f8ba8d03', 'Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\r\n\r\nMô tả sản phẩm:\r\n  1. Găng tay có thể co giãn và kéo dài ra, không dễ tuột\r\n  2. Sản phẩm ôm chặt bắp tay một cách thoải mái, đem lại cảm giác dễ chịu\r\n  3. Quy trình đan chữ V giải phóng áp lực cho tay\r\n  4. Cổ tay được xử lí các đường may thẳng đứng, giúp bạn duỗi thẳng tay một cách tự do mà không bị hạn chế\r\n  \r\n   Thông tin sản phẩm:\r\n  Thương hiệu: Nike\r\n  Trọng lượng: 40g/ cặp\r\n  Chống nắng: UPF50 +\r\n  Kích thước: Một kích thước\r\n  Dành cho: tất cả các môn thể thao ngoài trời\r\n  Chất liệu: nylon + spandex', 100, 1.57, '2022-12-03 09:19:16', '2022-12-03 09:19:16'),
(85, 1, 7, 'Áo bra tập Gym, Yoga ba khuy cài sau chất đẹp (CÓ SIZE) ms 889', 'https://cf.shopee.vn/file/65afda9c0ed5f52e5d81fd515c4c4bd7', '✔️ Chất Liệu Vải: Thun co dãn bốn chiều SIÊU MỀM\r\n✔️mẫu này có mút đệm sẵn bên trong áo, có thể thay thế được, đi tập tự tin lắm vì ôm khít người luôn\r\n✔️ SIZE M: Dưới 50 kg\r\n-, SIZE L: DƯỚI 56KG.\r\n-xl dưới 65kg\r\n-Thiết kế moc cài tiện lợi chị em tah hồ nhảy tập \r\n✔️ Kiểu Dáng: Form chuẩn phù hợp với vóc dáng phụ nữ Việt Nam.\r\n✔️ Sản Xuất : Hàng Quảng Châu Cao Cấp\r\n✔️ ĐƯỢC CHỌN MẪU THEO Ý THÍCH', 230, 1.66, '2022-12-03 09:22:13', '2022-12-03 09:22:13'),
(86, 1, 7, 'Quần chun mông tập gym cạp cao, quần legging tập gym nữ, tập mông co giãn 8 chiều QCM01', 'https://cf.shopee.vn/file/18f4fa2158c13786932b2794110a3372', 'Quần tập gym chun mông cạp cao, quần legging tập gym nữ, quần tập mông co giãn 8 chiềucập kho Fit & Beauty phục vụ các eva nhé, mặc khôn phê không lấy tiền ạ\r\n\r\nCHỌN SIZE: Ảnh 3 (hoặc ib shop để được tv size chuẩn nhất ạ)\r\n\r\nCHI TIẾT QUẦN LEGGING TẬP GYM NỮ CHUN MÔNG:\r\n- Kiểu dáng quần chun mông bodyfit ôm sát, nâng mông, tôn dáng định hình chống chảy sệ mông thích hợp cho vận động mạnh như chơi thể thao, tập gym, yoga và chạy bộ...\r\n- Chất liệu: Quần legging tập gym chun mông được làm từ sợi vải dệt tổng hợp loại 1 (12% spandex, loại vải cao cấp co giãn 8 chiều chuyên dùng trong ngành thời trang tập gym\r\n- Xuất xứ quần tập chun mông: Quảng Châu tận xưởng\r\n- Màu sắc quần chun mông có nhiều màu gồm Hồng, Xanh, Xám, Đen\r\n- Size số S,M,L, XL đủ số cho các eva lựa chọn ạ (Cân nặng)\r\n+ Size S (dưới 50kg)\r\n+ Size M (51~59kg)\r\n+ Size L (60~68kg)\r\n+ Size XL (69 ~78kg)\r\n# Khách có thắc mắc về chất vải, kích cỡ và free ship cho quần tập mông hãy ib cho shop để đc tư vấn nhanh và kỹ hơn trước khi mua nhé ( hạn chế việc đổi trả, phiền cho khách và cho cả shop ạ\r\n\r\nSHOP CAM KẾT\r\n- Giao HỎA TỐC 2h (Hà Nội)\r\n- Quần chun mông tập gym y hình, y mô tả\r\n- Giao hàng toàn quốc, chuẩn bị hàng nhanh\r\n- Thanh toán khi nhận hàng\r\n- Shop nhận đổi, trả trong 3 - 7 ngày với các trường hợp sau:\r\n+ Đổi size nếu không vừa\r\n+ Shop giao sai mẫu, sai màu và sai cỡ khách chọn ( shop chịu phí ship quay đầu)\r\n+ Sản phẩm đổi trả phải còn nguyên tem mác, nguyên vẹn không hư hại, chưa bị giặt hay là ủi.\r\n+ Quần áo mặc không vừa khách muốn đổi sang size khác hoặc mẫu khác đều đc ( ko chấp nhận trả hàng trong TH này ạ)\r\n', 345, 0.51, '2022-12-03 09:22:13', '2022-12-03 09:22:13'),
(87, 1, 8, 'Dưỡng tâm giàu có dưỡng thân nghèo khó', 'https://cf.shopee.vn/file/d9b7fba7a0ba28eac1bd4881e362d40d', 'Tên sản phẩm: Dưỡng tâm giàu có dưỡng thân nghèo khó\r\n\r\nTác giả: Nguyễn Anh Dũng\r\n\r\nNhà xuất bản: Nhà xuất bản Thế Giới\r\n\r\nNăm xuất bản: 2020\r\n\r\nNhà phát hành: Công ty CP Sbooks\r\n\r\nKích thước sản phẩm: 13x20x0.72 (cm)\r\n\r\nTrọng lượng: 72 (gram)\r\n\r\nSố trang: 144\r\n\r\nHình thức bìa: Bìa mềm\r\n\r\n_____________\r\n\r\n“Dưỡng tâm giàu có Dưỡng Thân Nghèo Khó” là cuốn sách mang lại định nghĩa hoàn hảo về “sự giàu có”. Sự giàu có là một đáp án khiến tôi mất nhiều năm để nhận thức nên, cũng chính là triết lý xuyên suốt giúp tôi sống tốt hơn mỗi ngày. Tôi đã thực sự tin rằng, giàu có không chỉ là khi tích cóp thật nhiều mà nó còn tồn tại khi tôi đem cho đi. Chính vì suy nghĩ tích cực này, đã đem tôi đến bên những câu chuyện khó khăn của mỗi người, chia sẻ và hạnh phúc bên niềm vui của họ. “Dưỡng tâm giàu có Dưỡng Thân Nghèo Khó” đã đưa tôi đến thế giới của an yên, từ bi, đạo hạnh mà bao người mơ ước. Đừng vội đem những khó khăn bạn đang gặp phải so bì với hạnh phúc người khác. Người ta sinh cùng giờ còn có số mệnh khác nhau mà. Chỉ cần bạn cảm thấy vừa đủ thì đó đã là một sự sung túc bao người mong ước rồi. Tôi tin chắc rằng cuốn sách nhỏ này sẽ giúp bạn tự tin sống cuộc đời của mình, dũng cảm đối mặt với khó khăn, và rộng lượng chia sẻ cùng mọi người. Mong rằng trái tim bạn sẽ sớm giàu có.\r\n\r\n\r\n\r\n- Tác giả: Nguyễn Anh Dũng, Sáng Lập Sbooks\r\n\r\n\r\n\r\nBằng những câu chuyện kể với giọng văn nhẹ nhàng, dễ thương, những triết lý nhân sinh gần gũi với cuộc sống đời thường, cuốn sách sẽ mang lại cho bạn những trải nghiệm quí giá để xây dựng cho mình một cuộc sống thật bình yên và hạnh phúc. Không phải ai cũng có thể hài lòng với những gì mình đang sở hữu, bởi họ cho rằng giàu có chính là sự sung túc về vật chất và tiền bạc. Vì vậy mà suốt cuộc đời, họ cứ mải miết chạy theo những giá trị vật chất bình thường mà quên đi còn vô số những giá trị khác nữa song hành bên họ. Một khi con người ta biết đủ thì mọi thiếu thốn về vật chất cũng chính là một sự sung túc trong tâm thức của mình. Một khi tâm con người ta không còn sân si thì đó chính là lúc trái tim mình luôn giàu có tình thương yêu vô bờ bến. “Dưỡng tâm giàu có - Dưỡng thân nghèo khó” là cuốn sách giá trị cho mọi độ tuổi để làm cho cuộc sống trở nên nhẹ nhàng và hạnh phúc hơn. Trong thực tế, hiếm có ai cảm thấy hạnh phúc khi bản thân sống trong cảnh nghèo túng nhưng cũng ít người vui vẻ khi giàu có. Khái niệm hạnh phúc cần được cắt nghĩa và làm rõ sâu hơn nữa so với những điều người ta gán ghép cho nó hiện nay. Hãy đọc những cuốn sách giá trị như “Dưỡng tâm giàu có - Dưỡng thân nghèo khó” để xây dựng lối sống yêu thương lành mạnh, để bồi dưỡng thân tâm mình dù nghèo khó vẫn luôn lạc quan và giàu năng lượng tích cực. Cuốn sách cũng sẽ giúp cho chúng ta tự xây dựng cho mình một cuộc sống thật hạnh phúc theo đúng nghĩa mà mình luôn mong muốn.\r\n\r\n', 1914, 2.08, '2022-12-03 09:25:24', '2022-12-03 09:25:24'),
(88, 1, 8, 'Sách - Bộ 7 Cuốn: 30 Ngày Thay Đổi Bản Thân - Loại Bỏ 30 Thói Quen Xấu Đánh Cắp Thời Gian Của Bạn', 'https://cf.shopee.vn/file/723cccc40bcd98cd05b1f2c7f052fa1d', 'Sách - Bộ 7 Cuốn: 30 Ngày Thay Đổi Bản Thân - Loại Bỏ 30 Thói Quen Xấu Đánh Cắp Thời Gian Của Bạn\r\n\r\n\r\n\r\nTrước khi muốn làm chủ cuộc sống thì đầu tiên hãy thay đổi bản thân. Bản thân mình tốt thì cuộc sống sẽ tốt. Hãy theo chân Damon Zahariades để từng bước loại bỏ những thói quen xấu, từ đó hình thành và duy trì những thói quen tốt để trở thành một con người \"thành công\" trong chính cuộc sống của mình.\r\nTừ khi sinh ra, môi trường sống tạo nên nhân cách của chúng ta, nhưng đến một lúc nào đó bạn trưởng thành hơn, có suy nghĩ của riêng mình, bạn phải học cách phân biệt cái nào tốt và cái nào xấu để thay đổi bản thân ngày một tốt hơn.\r\n\r\n\r\n\r\nChúng ta đều cần trở nên tốt hơn và thay đổi bản thân luôn là thử thách lớn nhất trong quá trình cải thiện chính mình. Nhưng thay đổi bản thân không có nghĩa là biến mình thành một con người khác, mà là khiến mình trở nên tự chủ, giành lại quyền chủ động lựa chọn cách sống của cuộc đời mình.\r\n\r\n\r\n\r\n7 cuốn sách dưới đây sẽ góp phần trong quá trình thay đổi bản thân của bạn, giúp bạn loại bỏ được những thói quen xấu và bắt đầu hình thành những thói quen tốt như biết cách quản lý thời gian, lập mục tiêu, sắp xếp công việc hiệu quả, loại bỏ những suy nghĩ tiêu cực ra bên ngoài,\r\n\r\n\r\n\r\nSuy cho cùng, mục đích của việc thay đổi bản thân là khiến cho bạn hạnh phúc, bạn nắm trong tay khả năng làm chủ cuộc sống của mình, thực hiện những điều mình muốn, sống thật hạnh phúc thì lúc đó bạn đã “thành công” rồi.\r\n\r\n\r\n\r\nHãy đọc ngay 7 cuốn sách dưới đây để thay đổi bản thân – làm chủ cuộc sống ngay từ hôm nay.\r\n\r\n\r\n\r\n1. 30 Ngày thay đổi bản thân – Tập 1,2\r\n\r\nMỗi giây trôi qua không bao giờ lấy lại được, vì vậy trước khi làm việc gì bạn nên có kế hoạch cụ thể, quản lý thời gian một cách khoa học nhất, tránh bị lãng phí thời gian một cách vô bổ. Nếu bạn chưa có kế hoạch quản lý thời gian một cách hiệu quả thì hãy đọc ngay cuốn 30 ngày thay đổi bản thân – Loại bỏ 30 thói quen xấu đánh cắp thời gian của bạn.\r\n\r\n\r\n                                              THAY ĐỔI BẢN THÂN – LÀM CHỦ CUỘC SỐNG\r\n\r\n\r\n\r\n7 CUỐN SÁCH GIÚP BẠN LOẠI BỎ CÁC THÓI QUEN XẤU ĐỂ TRỞ THÀNH NGƯỜI “THÀNH CÔNG”', 74, 20.40, '2022-12-03 09:25:24', '2022-12-03 09:25:24'),
(89, 1, 8, 'Sách - Tôi Quyết Định Sống Cho Chính Tôi (Bản Không Sổ To Do List)', 'https://cf.shopee.vn/file/08c6b26ad02f3c5e9c649bf5904d3bc6', 'GIỚI THIỆU SÁCH\r\nTÔI QUYẾT ĐỊNH SỐNG CHO CHÍNH TÔI\r\n-	KIM SUHYUN –\r\n\r\nCuốn sách đạt giải thưởng “Cuốn sách của năm” tại Hàn Quốc vào năm 2017.\r\nĐã tái bản hơn 100 lần kể từ lần xuất bản đầu tiên vào năm 2016.\r\nĐược nhiều nghệ sĩ chọn đọc và giới thiệu đến các fan của mình, đơn cử là JungKook (BTS).\r\n\r\nNhư tác giả Kim Suhyun đã chia sẻ về quá trình sáng tác cuốn sách này:\r\n“Tôi đã cố gắng ghi ra những điều quan trọng nhất trong cuộc sống như: \r\nCông việc, các mối quan hệ, niềm vui, tinh thần, thể chất, sức khỏe…\r\nTôi đã không lường trước những việc có thể xảy ra . Mà tôi chỉ làm (Do) những việc tôi muốn (Want) và có thể (Can).  \r\nMột công thức đơn giản là Want + Can = Do\r\nThay vào đó, hãy làm việc chăm chỉ. \r\nTôi dần tránh những mối quan hệ chỉ nhấn chìm tôi hoặc không quan trọng với tôi và tự nhủ rằng tôi sẽ không cho phép bản thân làm bất kể điều gì một cách tùy tiện nữa. 	\r\nTôi dành thời gian tìm kiếm niềm vui trong cuộc sống. \r\nCó những ngày, tôi ngồi ngắm bầu trời vài lần để cảm nhận cuộc sống. Tôi đối diện với những vấn đề còn bỏ ngỏ, giải quyết chúng và cố gắng sống lành mạnh. \r\nVì những đáp án do xã hội quy định khác xa những quan niệm thông thường của mọi người xung quanh chúng ta nên chỉ có một điều mà chúng ta biết chắc, đó là cuộc sống rất rõ ràng và nhẹ tựa lông hồng. \r\nVậy ý nghĩa của cuộc sống rốt cuộc là gì? \r\nSau nhiều lần chất vấn, câu trả lời tôi tìm thấy không còn là đáp án cá nhân mà trở thành đáp án của cả một cộng đồng, đó chính là hiện thực hóa giá trị của bản thân trong xã hội. \r\nTôi luôn quan tâm và khích lệ sự đóng góp của cá nhân cho một xã hội tương lai. \r\nBởi vì giải quyết các vấn đề xã hội chính là một cách trực tiếp để giải quyết các vấn đề cá nhân.\r\nNhưng đó không phải lí do duy nhất khiến chúng ta đóng góp một phần bản thân vào xã hội.\r\nThông qua cuốn sách này, tôi muốn lan truyền một làn sóng dù nhỏ nhưng có ý nghĩa đến mọi người.\r\nNhững câu hỏi không có hồi kết như “Chúng ta phải sống thế nào?” luôn nảy sinh trong cuộc sống. Để tôi nói cho bạn nghe câu trả lời của tôi nhé, đó chính là: “Hãy sống tốt với đời mình.” \r\nBạn không cần phải phức tạp hóa mọi vấn đề. \r\nBạn chỉ cần làm việc chăm chỉ, tâm sự với những người thân yêu, cùng nhau ăn những món ngon, chia sẻ với nhau những bài hát yêu thích, những cuốn sách hay vào một ngày đẹp trời bạn tận hưởng ánh mặt trời. \r\nTôi nghĩ rằng một cuộc sống tốt đẹp trọn vẹn chính là chuỗi ngày ấm áp, bình dị đang diễn ra. Nếu có thể, hãy bước thêm một nhịp để hướng tới cuộc sống có ý nghĩa.\r\nMặc dù trong vũ trụ này còn tồn tại những hạt bụi gây vẩn đục cuộc sống thì chúng ta vẫn phải vượt qua và giữ lấy phẩm giá, tôn nghiêm của chính mình. Bất chấp quy luật thành bại của thế giới, tôi vẫn muốn tự hào về một cuộc sống như vậy. \r\nCó một cuốn sách viết rằng: “Dù bạn sống thế nào, tôi vẫn luôn cổ vũ.”\r\nTuy nhiên, điều cần thiết không phải là người khác cổ vũ bạn mà bạn phải cổ vũ chính mình. \r\nGửi đến bản thân tôi - bạn đồng hành với tôi cho đến cuối cuộc đời:\r\n“Dù tôi sống thế nào, tôi vẫn luôn cổ vũ chính mình.””\r\nThông tin sách:\r\n-	Tên sách: Tôi quyết định sống cho chính tôi\r\n-	Tác giả: Kim Suhyun\r\n-	Người dịch: Đỗ Phương Nhung\r\n-	Thể loại: tản văn\r\n-	Giá bìa: 88.000 vnđ\r\n-	Số trang: 236 trang\r\n-	Khổ sách: 13,5 x 19.5 cm \r\n-	Loại bìa: bìa mềm tay gấp\r\n-	Phụ bản: Tặng kèm 1 sổ to do list 2020\r\n-	Nhà xuất bản liên kết: NXB Thanh Niên\r\n-	Đơn vị phát hành: công ty TNHH Văn hóa & TT AZ VIETNAM – Thương hiệu sách MINTBOOKS \r\n-	ISBN: 978-604-978-141-4\r\n-	Mã công ty: 8936186543999\r\n-	Ngày phát hành: 29/12/2019', 254, 2.64, '2022-12-03 09:29:52', '2022-12-03 09:29:52'),
(90, 1, 8, 'Sách - Rèn luyện tư duy phản biện', 'https://cf.shopee.vn/file/94a2733cc706ee029b1f1dcdcd688f3f', 'Công ty phát hành: 1980 Books \r\n\r\nTác giả: Albert Rutherford\r\n\r\nNhà xuất bản: NXB Phụ Nữ Việt Nam \r\n\r\nNăm xuất bản: 2019 \r\n\r\nSố trang: 204\r\n\r\nKích Thước: 13x19cm\r\n\r\nDịch: Nguyễn Ngọc Anh\r\n\r\n\r\n\r\nGiới thiệu sách:\r\n\r\nNhư bạn có thể thấy, chìa khóa để trở thành một người có tư duy phản biện tốt chính là sự tự nhận thức. Bạn cần phải đánh giá trung thực những điều trước đây bạn nghĩ là đúng, cũng như quá trình suy nghĩ đã dẫn bạn tới những kết luận đó. Nếu bạn không có những lý lẽ hợp lý, hoặc nếu suy nghĩ của bạn bị ảnh hưởng bởi những kinh nghiệm và cảm xúc, thì lúc đó hãy cân nhắc sử dụng tư duy phản biện! Bạn cần phải nhận ra được rằng con người, kể từ khi sinh ra, rất giỏi việc đưa ra những lý do lý giải cho những suy nghĩ khiếm khuyết của mình. Nếu bạn đang có những kết luận sai lệch này thì có một sự thật là những đức tin của bạn thường mâu thuẫn với nhau và đó thường là kết quả của thiên kiến xác nhận, nhưng nếu bạn biết điều này, thì bạn đã tiến gần hơn tới sự thật rồi! \r\n\r\nNhững người tư duy phản biện cũng biết rằng họ cần thu thập những ý tưởng và đức tin của mọi người. Tư duy phản biện không thể tự nhiên mà có. Những người khác có thể đưa ra những góc nhìn khác mà bạn có thể chưa bao giờ nghĩ tới, và họ có thể chỉ ra những lỗ hổng trong logic của bạn mà bạn đã hoàn toàn bỏ qua. Bạn không cần phải hoàn toàn đồng ý với ý kiến của những người khác, bởi vì điều này cũng có thể dẫn tới những vấn đề liên quan đến thiên kiến, nhưng một cuộc thảo luận phản biện là một bài tập tư duy cực kỳ hiệu quả. Việc lắng nghe những ý kiến của người khác cũng có thể giúp bạn nhận ra rằng phạm vi tri thức của bạn không phải là vô hạn. Không ai có thể biết hết tất cả mọi thứ. Nhưng với việc chia sẻ và đánh giá phê bình kiến thức, chúng ta có thể mở rộng tâm trí. Nếu điều này khiến bạn cảm thấy không thoải mái, không sao cả. Trên thực tế, bước ra ngoài vùng an toàn là một điều quan trọng để mở rộng niềm tin và suy nghĩ của bạn. Tư duy phản biện không phải là chỉ biết vài thứ, và chắc chắn không phải việc xác nhận những điều bạn đã biết. Thay vào đó, nó xoay quanh việc tìm kiếm sự thật – và biến chúng trở thành thứ bạn biết.', 9255, 2.93, '2022-12-03 09:29:52', '2022-12-03 09:29:52'),
(91, 1, 8, 'Sách - Hành Tinh Của Một Kẻ Nghĩ Nhiều', 'https://cf.shopee.vn/file/b132713a9ac9a1980cd2f9ddeeb77cb7', 'Hành Tinh Của Một Kẻ Nghĩ Nhiều\r\n\r\n\r\n\r\nTặng postcard có chữ viết tay lời nhắn nhủ và chữ ký của tác giả dành tặng 35 độc giả mua sớm nhất.\r\n\r\n\r\n\r\nTác giả:	Amateur Psychology Nguyễn Đoàn Minh Thư\r\n\r\nSố trang:	 184 trang\r\n\r\nKích thước:	13cm x 17cm\r\n\r\nĐơn vị phát hành:	Bloom Books\r\n\r\nNhà xuất bản:	Thế giới\r\n\r\nSố ISBN:	978-604-365-014-3\r\n\r\nMã AZ Việt Nam:	8935325005312\r\n\r\nGiá bìa:	86.000 VNĐ\r\n\r\nNgày phát hành:   13/06/2022\r\n\r\n\r\n\r\n* * *\r\n\r\nGiới thiệu sách: \r\n\r\n“Đó là mùa hè năm 2020, mùa hè của COVID-19 và một ngàn vạn khủng hoảng tuổi đôi mươi. Đó là mùa hè mình bắt chuyến bay sớm nhất có thể vào ngày 20 tháng 3 để chạy khỏi nước Anh đang bùng dịch, bị kẹt lại sân bay Bangkok trong 24 giờ đồng hồ vì chuyến bay quá cảnh về Sài Gòn bị huỷ.. \r\n\r\nĐó là mỗi đêm mùa hè nằm trên giường stress chuyện deadline luận văn, stress chuyện thất nghiệp không kiếm ra tiền, stress chuyện bỏ lỡ cơ hội thực tập giúp ích cho sự nghiệp của mình, stress chuyện học hành dở dang - không biết bao giờ mới có thể quay lại Anh và hoàn thành tấm bằng đại học, stress chuyện tồn tại một cách mơ hồ, không biết mình là ai.”\r\n\r\nHành tinh của một kẻ nghĩ nhiều là hành trình khám phá thế giới nội tâm của một người trẻ. Đó là một hành tinh đầy hỗn loạn của những suy nghĩ trăn trở, những dằn vặt, những cuộc chiến nội tâm, những cảm xúc vừa phức tạp cũng vừa rất đỗi con người. Một thế giới quen thuộc với tất cả chúng ta. \r\n\r\n\r\n\r\nChứa đựng những lời chia sẻ và kiến thức từ podcast của Amateur Psychology - Tay mơ học đời bằng Tâm lý học, tác giả sẽ dẫn lối và đưa bạn tới từng ngóc ngách thầm kín nhất của hành tinh ấy dưới một góc nhìn chuyên sâu hơn.  \r\n\r\n\r\n\r\nVà nếu bạn cũng là một kẻ nghĩ nhiều, chào mừng bạn đến với hành tinh này. \r\n\r\n\r\n\r\n“Sự cô đơn không nằm ở việc không có bạn bè hay người thân mà ngay cả trong sự sum vầy ta vẫn cảm thấy không có ai có thể hiểu mình tường tận từ sâu tâm hồn. Là sự cô đơn như thể chỉ có một mình mình trên một hành tinh đơn độc trong đầu, một hành tinh không bao giờ có khách viếng thăm”.', 1063, 2.59, '2022-12-03 09:33:01', '2022-12-03 09:33:01');
