(92, 1, 8, 'Sách Khi Bạn Đang Mơ Thì Người Khác Đang Nỗ Lực', 'https://cf.shopee.vn/file/4e94f5a3f0586ced11b148407a1ba240', 'Công ty phát hành	Minh Long\r\n\r\nTác giả	Vĩ Nhân\r\n\r\nNăm Xuất Bản  2022\r\n\r\nKích thước	14.5 x 20.5 cm\r\n\r\nNhà xuất bản	Nhà Xuất Bản Văn Học\r\n\r\nDịch Giả	Hân Ngọc\r\n\r\nLoại bìa	Bìa mềm\r\n\r\nSố trang	418\r\n\r\nSKU	3003517620928\r\n\r\n\r\n\r\n GIỚI THIỆU SÁCH\r\n\r\nKhi Bạn Đang Mơ Thì Người Khác Đang Nỗ Lực\r\n\r\nLời nói đầu\r\n\r\nTại sao bạn không đủ xuất sắc?\r\n\r\nCó rất nhiều người hỏi tôi: “Tại sao em có thành tích tốt, cũng không lười, nhưng vẫn không đủ xuất sắc?”. Tôi chỉ có một câu trả lời cho vấn đề này: Bạn vẫn chưa thực sự thay đổi bản thân nhưng lại ép mình phải thành công, vì thế bạn mãi mãi không biết mình có thể xuất sắc thế nào.\r\n\r\nMột huấn luyện viên dạy bơi cho trẻ em từng nói với tôi: “Ngài có biết làm thế nào để một đứa trẻ không biết bơi lại nhanh chóng học bơi được không? Rất đơn giản, chỉ cần  thả trẻ xuống nước, để trẻ giãy giụa, làm quen với cảm giác ở dưới nước”. Tôi hỏi cậu ấy, làm như thế có nguy hiểm quá không? Huấn luyện viên nói rằng không cần quá lo lắng, chỉ cần kịp thời giúp sức, cứ luyện tập từ từ, bất kể ai cũng đều có thể biết bơi. Bởi vì trong tình huống nguy hiểm, tiềm năng của con người mới được bộc lộ rõ, học tập hay làm việc đều vừa nhanh vừa hiệu quả.\r\n\r\nNhững lời của huấn luyện viên đó khiến tôi suy nghĩ, phần lớn chúng ta đều sống quá an phận. Chúng ta có mục tiêu nhưng thiếu lòng quyết tâm như những khi gặp tình huống nguy cấp, vì thế phần lớn cuộc sống của mọi người đều không có gì đặc biệt, con người khát vọng thành công nhưng lại không đủ kiên trì với bản thân. Đây chính là sự khác biệt giữa người thành công và người bình thường.\r\n\r\nDo tính chất công việc, trong mấy chục năm qua tôi đã từng tiếp xúc với vô vàn kiểu người, trong đó có doanh nhân, diễn viên điện ảnh nổi tiếng và các nhân sĩ thuộc giới chính trị. Cảm nhận lớn nhất của tôi là, trong huyết mạch của những người thành công luôn cuộn chảy nguồn sức mạnh hướng về phía trước, thứ sức mạnh này có thể được gọi là “ép buộc bản thân”, giống như tinh thần Olympic, con người không ngừng thay đổi để trở nên xuất sắc hơn, theo đuổi mục tiêu cao hơn.\r\n\r\nTheo tôi được biết, Oprah Winfrey đã “ép” bản thân đọc rất nhiều sách trong một năm và luôn giữ thói quen đọc sách đến giờ, điều này giúp cô ấy trở thành một trong những MC truyền hình có vốn kiến thức sâu rộng nhất hiện nay; ngôi sao bóng rổ Michael Jordan từ khi học cấp ba đã yêu cầu bản thân mỗi ngày luyện tập ít nhất 300 lần lên rổ, anh ấy nhanh chóng trở thành vận động viên nổi bật trong đội bóng và nhận được sự quan tâm của NBA (Hiệp hội bóng rổ quốc gia); Christian Bale ép bản thân giảm 30kg trong hai tháng để phù hợp với tạo hình của vai diễn chính trong The Machinist (Thợ máy)', 54, 3.95, '2022-12-03 09:33:01', '2022-12-03 09:33:01'),
(93, 1, 8, 'Sách Tuổi Trẻ Đáng Giá Bao Nhiêu', 'https://cf.shopee.vn/file/e558991a7192bb0ac88b798390c631ac', 'Công ty phát hành	Nhã Nam\r\nTác giả	Rosie Nguyễn\r\nNgày xuất bản	10-2020\r\nKích thước	14 x 20.5 cm\r\nNhà xuất bản	Nhà Xuất Bản Hội Nhà Văn\r\nLoại bìa	Bìa mềm\r\nSố trang	285\r\nSKU	2431864615280\r\nTuổi Trẻ Đáng Giá Bao Nhiêu\r\n\r\n\"Bạn hối tiếc vì không nắm bắt lấy một cơ hội nào đó, chẳng có ai phải mất ngủ.\r\n\r\nBạn trải qua những ngày tháng nhạt nhẽo với công việc bạn căm ghét, người ta chẳng hề bận lòng.\r\n\r\nBạn có chết mòn nơi xó tường với những ước mơ dang dở, đó không phải là việc của họ.\r\n\r\nSuy cho cùng, quyết định là ở bạn. Muốn có điều gì hay không là tùy bạn.\r\n\r\nNên hãy làm những điều bạn thích. Hãy đi theo tiếng nói trái tim. Hãy sống theo cách bạn cho là mình nên sống.\r\n\r\nVì sau tất cả, chẳng ai quan tâm.\"\r\n\r\nNhận định\r\n\r\n\"Tôi đã đọc quyển sách này một cách thích thú. Có nhiều kiến thức và kinh nghiệm hữu ích, những điều mới mẻ ngay cả với người gần trung niên như tôi.\r\n\r\nTuổi trẻ đáng giá bao nhiêu? được tác giả chia làm 3 phần: HỌC, LÀM, ĐI.\r\n\r\nNhưng tôi thấy cuốn sách còn thể hiện một phần thứ tư nữa, đó là ĐỌC.\r\n\r\nHãy đọc sách, nếu bạn đọc sách một cách bền bỉ, sẽ đến lúc bạn bị thôi thúc không ngừng bởi ý muốn viết nên cuốn sách của riêng mình.\r\n\r\nNếu tôi còn ở tuổi đôi mươi, hẳn là tôi sẽ đọc Tuổi trẻ đáng giá bao nhiêu? nhiều hơn một lần.\"\r\n\r\n(Đặng Nguyễn Đông Vy, tác giả, nhà báo)', 6289, 2.81, '2022-12-03 09:35:38', '2022-12-03 09:35:38'),
(94, 1, 8, 'Sách - Tôi Từng Nghĩ Mọi Thứ Sẽ Ổn Khi Trở Thành Người Lớn', 'https://cf.shopee.vn/file/57d015f508f825d8a48a8cc2d25eb672', 'THÔNG BÁO PHÁT HÀNH\r\nTÔI TỪNG NGHĨ MỌI THỨ SẼ ỔN KHI TRỞ THÀNH NGƯỜI LỚN \r\n\r\nTop 1 cuốn sách được tìm kiếm với từ khóa về Trầm Cảm, được độc giả cả nước săn lùng, giữ vị trí\r\nTop 10 cuốn sách Tâm lý bán chạy nhất 6 tháng cuối năm 2019. \r\nHơn 1 triệu bản đã được bán ra kể từ khi ra mắt tại Hàn Quốc.\r\n\r\n“Tôi từng nghĩ mọi thứ sẽ ổn khi trở thành người lớn” chính là cuốn sách chữa lành mọi đau đớn mà con người phải đối mặt hàng ngày dưới cái mác “người lớn”!\r\n21 chương sách lột tả chi tiết từng khía cạnh về 21 căn bệnh phổ biến của người hiện đại. Đó là căn bệnh Sợ thứ 2, bệnh Thích mang mặt nạ, bệnh Không thể ăn uống theo ý muốn của mình…. Khi các biểu hiện đã trở thành bệnh lý thì vấn đề sẽ trở nên nghiêm trong hơn, đó là căn bệnh Trầm cảm, Rối loạn cảm xúc lượng cực, Chứng rối loạn hoảng sợ, Nhân cách trầm uất…\r\nCuốn sách được kết hợp viết bởi Kim Hea Nam – bác sĩ Tâm thần – chuyên gia phân tâm học nổi tiếng hàng đầu tại Hàn Quốc – đã có kinh nghiệm làm việc với hàng trăm ca trầm cảm tại Bệnh viện Tâm thần Quốc gia và Park Jong Seok – trưởng khoa Y tế Sức khỏe Tâm thần với kinh nghiệm điều trị cho những người mắc các bệnh tâm thần khác nhau tại Bệnh viện Đại học Seoul.\r\nBằng kiến thức thực tiễn và kinh nghiệm làm việc lâu năm, cuốn sách đem lại những hiểu biết khoa học về các vấn đề, căn bệnh tâm lý của người hiện đại, thông qua việc triển khai: khái niệm, biểu hiện, cùng giải pháp chữa bệnh để bạn đọc có thể thực hành chữa lành bản thân trên hành trình trưởng thành. Bên cạnh đó 2 tác giả sử dụng chính những câu chuyện từ hàng trăm ngàn bệnh nhân của mình để lấy làm ví dụ thực tế, truyền cảm hứng và sự đồng cảm sâu sắc tới độc giả.\r\nNhư một sự thức tỉnh sau sự ra đi của rất nhiều ngôi sao nổi tiếng vì trầm Cảm tại Hàn Quốc, “Tôi từng nghĩ mọi thứ sẽ ổn khi trở thành người lớn” được coi như người bạn đồng hành an ủi hơn 1 triệu độc giả khắp cả nước. \r\n\r\nThông tin sách:\r\nTên: Tôi từng nghĩ mọi thứ sẽ ổn khi trở thành người lớn\r\nTác giả: Kim Haenam – Park Jongseok\r\nDịch giả: Sun Tzô\r\nThương hiệu: Peachbooks\r\nNXB Văn học\r\nSố trang: 304\r\nThể loại: tâm lý\r\nKhổ sách: 14,5x20,5cm\r\nGiá bìa: 96.000Đ\r\nPhụ bản: 1 bookmark\r\nISBN: 9786049973239\r\nMã công ty: 8936186545177\r\nDự kiến phát hành: 20/6/2020', 75, 2.85, '2022-12-03 09:35:38', '2022-12-03 09:35:38'),
(95, 1, 8, 'Sách Hai số phận (Bìa cứng)', 'https://cf.shopee.vn/file/82ca20d3bfaf7fe6a9621f4dc319db92', 'Công ty phát hành	Huy Hoang Bookstore\r\nNhà xuất bản	NXB Văn Học\r\nTác giả Jeffrey Archer\r\nNgày xuất bản	01-2018\r\nKích thước	13.5 x 20.5 cm\r\nDịch Giả	Nguyễn Việt Hải\r\nLoại bìa	Bìa cứng\r\nSố trang	768\r\n\r\nSách - Hai Số Phận (Bìa Cứng)\r\n“Hai số phận” không chỉ đơn thuần là một cuốn tiểu thuyết, đây có thể xem là \"thánh kinh\" cho những người đọc và suy ngẫm, những ai không dễ dãi, không chấp nhận lối mòn.\r\n“Hai số phận” làm rung động mọi trái tim quả cảm, nó có thể làm thay đổi cả cuộc đời bạn. Đọc cuốn sách này, bạn sẽ bị chi phối bởi cá tính của hai nhân vật chính, hoặc bạn là Kane, hoặc sẽ là Abel, không thể nào nhầm lẫn. Và điều đó sẽ khiến bạn thấy được chính mình.\r\nKhi bạn yêu thích tác phẩm này, người ta sẽ nhìn ra cá tính và tâm hồn thú vị của bạn!\r\n“Nếu có giải thưởng Nobel về khả năng kể chuyện, giải thưởng đó chắc chắn sẽ thuộc về Archer.” - Daily Telegraph\r\n“Hai số phận” (Kane & Abel) là câu chuyện về hai người đàn ông đi tìm vinh quang. William Kane là con một triệu phú nổi tiếng trên đất Mỹ, lớn lên trong nhung lụa của thế giới thượng lưu. Wladek Koskiewicz là đứa trẻ không rõ xuất thân, được gia đình người bẫy thú nhặt về nuôi. Một người được ấn định để trở thành chủ ngân hàng khi lớn lên, người kia nhập cư vào Mỹ cùng đoàn người nghèo khổ. \r\nTrải qua hơn sáu mươi năm với biết bao biến động, hai con người giàu hoài bão miệt mài xây dựng vận mệnh của mình . “Hai số phận” nói về nỗi khát khao cháy bỏng, những nghĩa cử, những mối thâm thù, từng bước đường phiêu lưu, hiện thực thế giới và những góc khuất... mê hoặc người đọc bằng ngôn từ cô đọng, hai mạch truyện song song được xây dựng tinh tế từ những chi tiết nhỏ nhất.) ', 923, 5.23, '2022-12-03 09:51:07', '2022-12-03 09:51:07'),
(96, 1, 8, 'Sách Khéo Ăn Nói Sẽ Có Được Thiên Hạ ( Tái Bản )', 'https://cf.shopee.vn/file/7a497a991fb1daf743471ed042a19b90', 'Công ty phát hành	Minh Long\r\nTác giả	Trác Nhã\r\nNgày xuất bản	06-2018\r\nNhà xuất bản	Nhà Xuất Bản Văn Học\r\nLoại bìa	Bìa mềm\r\nSố trang	406\r\nKích thước: 14.5 x 20.5\r\nSKU	2436878546179 GIỚI THIỆU SÁCH\r\nKhéo Ăn Nói Sẽ Có Được Thiên Hạ ( Tái Bản )\r\n\r\nTrong xã hội thông tin hiện đại, sự im lặng không còn là vàng nữa, nếu không biết cách giao tiếp thì dù là vàng cũng sẽ bị chôn vùi. Trong cuộc đời một con người, từ xin việc đến thăng tiến, từ tình yêu đến hôn nhân, từ tiếp thị cho đến đàm phán, từ xã giao đến làm việc... không thể không cần đến kĩ năng và khả năng giao tiếp. Khéo ăn khéo nói thì đi đâu, làm gì cũng gặp thuận lợi. Không khéo ăn nói, bốn bề đều là trở ngại, khó khăn. Trong thời đại thông tin và liên lạc phát triển nhanh chóng, tin tức được cập nhật liên tục, các công cụ thông tin và kĩ thuật truyền thông được ứng dụng rộng rãi như ngày nay thì việc khéo ăn nói đã trở thành “cái tài số một thiên hạ”. Trong khoảng thời gian ngắn nhất, nếu ai có thể nêu bật được khả năng, thực lực của mình cho đối phương biết thì đó sẽ là người chiến thắng. Chính vì vậy mà câu nói “Khéo ăn nói sẽ có được thiên hạ” rất có ý nghĩa. Vậy, như thế nào mới gọi là biết cách ăn nói? Nói năng lưu loát, không ấp úng có được gọi là biết cách nói chuyện không? Nói ngắn gọn, nói ít nhưng ý nghĩa thâm sâu có được gọi là biết cách nói chuyện không? Hay nhất định phải nói nhiều mới là biết nói chuyện?\r\n\r\nTrong cuộc sống thường ngày, chúng ta thấy rằng: Biết cách nói chuyện không nhất định là phải nói nhiều, quan trọng là phải nói đúng trọng tâm, đúng nội dung. Và điều quan trọng là phải nắm được vấn đề mình đang nói đến. Chắc chắn rất nhiều người đã gặp phải tình huống như thế này: Có những nhân viên tiếp thị khi gặp khách hàng thì giống như một cái máy, nói không ngừng nghỉ, không để ý tới phản ứng và cảm nhận của khách hàng, không cần biết vị khách đó có đang nghe lời giới thiệu về sản phẩm hay không. Nếu làm việc như vậy thì người đó nắm chắc phần thất bại. Trong cuộc sống và trong công việc, chúng ta cũng rất hay gặp phải hiện tượng như sau: Nhiều người khi nói chuyện với người quen thì nói rất hay, không bị mất bình tĩnh hay ấp úng. Thế nhưng khi gặp người lạ hoặc phải nói chuyện trong một đám đông, thì người đó dường như bị mất sự chủ động với ngôn ngữ, có lúc còn không biết mình đã nói gì. Vậy làm thế nào để cải thiện và tránh gặp phải những tình huống như trên? Làm thế nào để ăn nói khéo léo? Có phương pháp và quy luật nào được áp dụng khi giao tiếp không? Có nguyên tắc và bí quyết nào cho các cuộc nói chuyện không? Trong những tình huống khác nhau, với những người khác nhau thì phải nói chuyện như thế nào, và làm sao để trình bày những điều khó nói? Cuốn sách “Khéo ăn nói sẽ có được thiên hạ” này sẽ giải đáp những câu hỏi đó. Cuốn sách với ngôn từ rõ ràng, gần gũi với cuộc sống sẽ mang đến những kĩ năng và phương pháp giao tiếp thực dụng, chắc chắn sẽ giúp ích cho quý độc giả. ', 3955, 3.87, '2022-12-03 09:51:07', '2022-12-03 09:51:07'),
(97, 1, 9, 'Pcbfun Mô đun Chuyển đổi Tăng áp 1800w 40a Dc-dc', 'https://cf.shopee.vn/file/f5673a09ae06bb632633c2b014c65a26', 'Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\r\n\r\nĐặc điểm:\r\n1. Sử dụng chất liệu cao cấp, chất lượng được đảm bảo\r\n2. Cánh quạt tản nhiệt được sử dụng, hiệu quả tản nhiệt rất tốt, công suất đầu ra cao hơn\r\n3. Quạt kiểm soát nhiệt độ sử dụng quạt chịu lực thủy lực, đã đạt được sự cân bằng tốt về tiếng ồn và tản nhiệt. Khi tải đã sáng, quạt không quay. Khi nhiệt độ tải đạt khoảng 60 độ, quạt sẽ tự động xoay. Có thể giảm tiếng ồn hiệu quả và kéo dài tuổi thọ\r\n4. Tấm cách nhiệt ống điện chính được làm bằng nhôm chất lượng cao, dẫn nhiệt gấp 10 lần tấm cách nhiệt thông thường\r\n5. Vòng từ bằng nhôm ferrosilicon quá khổ, sử dụng bốn dây tráng men bằng đồng nguyên chất, chỉ số thấp và hiệu quả cao\r\n6. Với chức năng dòng điện không đổi, có thể được sử dụng để tăng pin ô tô, sạc pin, v.v.\r\n\r\nThông tin về sản phẩm:\r\nĐặc điểm làm việc:\r\nCông suất đầu ra: 1800W\r\nDải điện áp đầu vào: 10V-60V\r\nDải điện áp đầu ra: 12V-90V\r\nDòng điện đầu vào: 40A\r\nDòng điện đầu ra: 22A\r\nHiệu suất chuyển đổi: 48V đến 60V 8A (98,1%)\r\n48v đến 72V 8A (98,1%)\r\n48v 84V 8A (97,6%)\r\nQuy định phí: 10% đến 50% sạc (đầu ra 72V)\r\nHệ số nhiệt độ: 50% tải\r\nTần số và tiếng ồn: Tần số 20MHz (48V-72V 4A) 100mVp-p\r\nTần số chuyển mạch: VIN = 48V VO = 72V 4A (110khz)\r\nDòng không tải: VIN = 48V VO = 72V (18mA)\r\nBảo vệ đảo ngược đầu vào: có\r\nĐộ ẩm lưu trữ: 95%\r\nNhiệt độ hoạt động: -20 65 °C\r\nNhiệt độ bảo quản: -40 125 °C\r\nNhiệt độ hoạt động tăng: 48V đến 60V 5A (45 °C)\r\nBảo vệ quá nhiệt: 60°C\r\nPhương thức đấu dây: đầu vào, đầu ra (không mất điện, khối đầu cuối).\r\nPhương pháp làm mát: làm mát bằng không khí mạnh\r\n\r\nGói hàng bao gồm\r\nMô đun chuyển đổi tăng cường * 1', 10616, 13.35, '2022-12-03 09:54:12', '2022-12-03 09:54:12'),
(98, 1, 9, 'Mỏ Hàn Thiếc 60w Mỏ Hàn Điện Mini Điện Tử Chỉnh Nhiệt', 'https://cf.shopee.vn/file/sg-11134201-22110-a732hzrdu3jv2b', 'Mỏ Hàn Thiếc 60w Mỏ Hàn Điện Mini Điện Tử Chỉnh Nhiệt\r\n- Mỏ Hàn trên thị trường có rất nhiều loại như Mỏ Hàn Thiếc, Mỏ Hàn Chì, Mỏ Hàn Điện Tử.\r\n- Mỏ Hàn là thiết bị làm nung chảy miếng kim loại và hàn nối kim loại lại với nhau để truyền điện, truyền nhiệt trong các linh kiện kiện tử.\r\n- Mỏ hàn Thiếc 60W có thiết kế nhỏ gọn, trọng lượng nhẹ giúp người dùng sẽ dàng sử dụng và thao tác.\r\n-Bên cạnh đó Mỏ Hàn 60W còn có thể chỉnh nhiệt độ dao động từ 200 đến 450 độ C.\r\n- Mỏ hàn 60W thích hợp cho việc sửa chữa các thiết bị điện tử, dùng cho cá nhân hoặc dùng cho nhà máy sản xuất.\r\n- Với lần sử dụng đầu tiên khi sử dụng Mỏ Hàn Thiếc sẽ có ít khói bốc ra từ đầu mỏ hàn, khói này sẽ nhanh chóng biến mất. Từ lần hàn sau, sẽ không còn khói bốc ra.\r\n-------------------------------------------------------\r\n✔️THÔNG SỐ KỸ THUẬT:\r\n- Mỏ Hàn Thiếc có Công suất 60W\r\n- Mỏ Hàn Điện hoạt động: 220V\r\n- Mỏ Hàn ra nhiệt nhanh trong khoảng 55 đến 120 giây\r\n- Tay Hàn Chì có phích cắm tiêu chuẩn Châu Âu phù hợp cho mọi loại ổ cắm tại Việt Nam\r\n- Quý khách mua mỏ hàn 60w sẽ được tặng nhựa thông hộp hoặc bọt biển vệ sinh, nên mọi người nhớ kích vào phần quà tặng nhé ạ.\r\n- Thông số có thể có sai số do nhà sản xuất.\r\n-------------------------------------------------------\r\n✔️THÔNG TIN LIÊN HỆ:\r\n- Hotline bán hàng: 085.695.0800\r\n-------------------------------------------------------\r\n✔️LINH KIỆN ĐIỆN 666 XIN CAM KẾT:\r\n- Sản phẩm đúng với hình ảnh đã đăng.\r\n- Tất cả các sản phẩm được kiểm tra trước khi giao\r\n- Hoàn tiền 100% nếu sản phẩm không giống hình ảnh hoặc lỗi do nhà sản xuất. \r\n- Giá tốt thị trường, Dịch vụ sau bán hàng luôn làm hài lòng khách hàng khó tính.\r\n-------------------------------------------------------\r\n✔️QUÝ KHÁCH XIN LƯU Ý:\r\n- Cần có những kiến thức cơ bản trước khi đặt mua hàng \r\n- Các thông số ở trên được nhà máy cũng cấp nên có thể có sai số.\r\n- Shop sẽ không bảo hành những trường hợp: \r\n+ Hỏng hóc do tác động bên ngoài, kể cả thời tiết.\r\n- Shop cũng không hoàn tiền nếu Quý khách không có video khi bóc hàng.\r\n✔️SHOP XIN CẢM ƠN QUÝ KHÁCH!', 275, 2.17, '2022-12-03 09:54:12', '2022-12-03 09:54:12'),
(99, 1, 9, 'Kìm cắt chân linh kiện điện tử HOBO USA (3 1/2”) - Thép Cr-v không gỉ cao cấp - Hàng chất lượng', 'https://cf.shopee.vn/file/558b05e2b7d9bd9a3f01f1b75401ed67', 'Kìm cắt chân linh kiện điện tử HOBO USA (3 1/2”) \r\n- Hàng chất lượng \r\n- Thép cr-V không gỉ cao cấp \r\n- Size: 3 1/2', 912, 2.76, '2022-12-03 09:56:38', '2022-12-03 09:56:38'),
(100, 1, 9, 'Linh Kiện Điện Tử Diode Cầu', 'https://cf.shopee.vn/file/fcb353cd80e3f506c16a6f9dee38c9c6', 'Diode Cầu\r\nGiới thiệu Diode Cầu\r\nDiode là một linh kiện điện tử được cấu tạo từ 2 lớp bán dẫn tiếp xúc với nhau. Diode có 2 cực Anode và Cathode. Nó chỉ cho dòng điện đi theo 1 chiều từ Anode sang Cathode ( Chính xác là khả năng cản trở dòng điện theo chiều AK là rất nhỏ, còn KA là rất lớn).\r\n\r\nDiode Cầu có cấu tạo gồm 4 diode nhỏ, có 4 chân.\r\n\r\ndiode cau\r\n\r\nHình ảnh Diode Cầu 1\r\n\r\n \r\n\r\nThông số kỹ thuật\r\nNhiệt độ hoạt động: -55ºC~150ºC\r\n\r\nLoại: Diode bán dẫn\r\n\r\n\r\n\r\nHình ảnh Diode Cầu 2\r\n\r\n \r\n\r\nỨng dụng\r\n\r\nDiode Cầu có thể được sử dụng làm chỉnh lưu, bộ hạn chế tín hiệu, điều chỉnh điện áp, công tắc\r\n\r\nNgoài ra còn được sử dụng trong bộ điều biến tín hiệu, bộ trộn tín hiệu, bộ giải điều chế tín hiệu và bộ dao động.\r\n\r\n \r\n\r\nHướng dẫn sử dụng và lưu ý\r\n\r\nKhi hàn các boarch mạch thì các linh kiện bán dẫn thường được hàn sau cùng để tránh cháy hỏng', 2981, 0.34, '2022-12-03 09:56:38', '2022-12-03 09:56:38'),
(101, 1, 9, 'Đèn Led nháy 7 màu 5mm (vỏ trong suốt) / Led nhấp nháy 7 màu ngẫu nhiên / Linh Kiện Điện Tử', 'https://cf.shopee.vn/file/c629620eff9059d4cb93919bf75c7669', 'MÔ TẢ KỸ THUẬT:\r\n-       LED: diode phát quang (Light Emitting Diode)\r\n-	Điện áp 2.8 - 3.2V\r\n-	Dòng ~20mA\r\n-	Led nháy ngẫu nhiên khi cấp nguồn\r\n-       Đường kính: 5mm\r\n\r\nỨNG DỤNG:\r\n-       Chỉ thị, trang trí, bảng quảng cáo, chiếu sáng... \r\n\r\n-----------------------------------------------------------------------------\r\nLINH KIỆN ĐIỆN TỬ:\r\n-	Chất lượng sản phẩm tốt\r\n-	Cam kết giá rẻ cạnh tranh\r\n-	Hình ảnh đúng với thực tế\r\n-	Hàng hoá đa dạng  \r\n-	Tư vấn nhiệt tình \r\nĐịa chỉ: K368/40 Hoàng Diệu, TP Đà Nẵng\r\nSĐT: 0905.597.297 (Ms Lan)\r\n	CÓ THỂ LIÊN HỆ TRỰC TIẾP ĐỂ THỎA THUẬN ĐƠN HÀNG & HÌNH THỨC GIAO HÀNG', 875, 0.04, '2022-12-03 09:59:00', '2022-12-03 09:59:00'),
(102, 1, 9, 'Module relay 5V, 12V 1 kênh đóng cắt thiết bị điện 10A', 'https://cf.shopee.vn/file/a1710c2b2ee8ec8a92ed38467a435701', 'Module 1 Relay được sử dụng để đóng ngắt nguồn điện công suất cao AC hoặc DC.\r\nTiếp điểm đóng ngắt gồm 3 tiếp điểm NC (thường đóng), NO(thường mở) và COM(chân chung) được cách ly hoàn toàn với board mạch chính, ở trạng thái bình thường chưa kích NC sẽ nối với COM, khi có trạng thái kích COM sẽ chuyển sang nối với NO và mất kết nối với NC.\r\n\r\n\r\nThông số kỹ thuật:\r\nSử dụng điện áp nuôi DC 12V hay 5V DC.\r\nĐiện thế đóng ngắt tối đa: AC250V  ~ 10A hoặc DC30V ~ 10A.\r\nChân IN: kích mở relay( kích âm, nối mass module relay nhảy)\r\nKích thước: 1.97 in x 1.02 in x 0.75 in (5.0 cm x 2.6 cm x 1.9 cm)\r\n\r\nĐầu ra:\r\nCOM: Tiếp điểm relay 220V 10A ( Lưu ý tiếp điểm , không phải điện áp ra)\r\nNO: chân thường mở\r\nNC: chân thường đóng\r\n\r\nTham khảo bài hướng dẫn tại đây\r\nhttp://arduino.vn/bai-viet/302-module-relay-cach-su-dung-ro-le-va-nhung-ung-dung-hay-cua-no', 175, 0.55, '2022-12-03 09:59:00', '2022-12-03 09:59:00'),
(103, 1, 9, 'Thiết bị nhấp nháy màn hình điện thoại tử tự động có thể điều chỉnh,Thiết bị bấm tự động giữ màn hình sáng dùng khi chơi game màu', 'https://cf.shopee.vn/file/383c47c8ecd5dbea83b17833e89e5abb', 'Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\r\n\r\n\r\n\r\nMô tả:\r\n\r\nTỰ ĐỘNG: Tự động chạm vào màn hình với các khoảng thời gian đã đặt, chẳng hạn như trò chơi.\r\n\r\nYÊN TĨNH: Thiết bị bấm sử dụng công nghệ bấm trong không khí không tiếp xúc, không gây tiếng ồn.\r\n\r\nNHỎ GỌN: Thiết kế nhỏ và gọn nhẹ cho phép bạn mang đi mọi nơi một cách tiện lợi. Với đường kính khoảng 7cm.\r\n\r\nPIN: Phù hợp với pin lớn 300mAh, thiết bị bấm tự động này có thể kéo dài hàng giờ và cũng có thể được sử dụng trong khi sạc\r\n\r\nThông minh hơn và nhiều mức hơn: Lên đến 1000 mức, tương thích với nhiều ứng dụng hơn. Số lần nhấp dao động từ 35 đến 999 giây mỗi giây. Với chip thông minh được nâng cấp, công nghệ sinh học, thực sự mô phỏng thao tác bấm ngẫu nhiên của ngón tay người\r\n\r\nMô tả sản phẩm:\r\n\r\nDung lượng pin: 300mAh\r\n\r\nBảng kích thước:\r\n\r\n70x70x20mm/2,76x2,76x0,79 inch\r\n\r\nGói hàng bao gồm:\r\n\r\n1 set x Thiết bị bấm màn hình\r\n\r\n\r\n\r\nC：\r\n\r\nBluetooth Controlled: features timer shutdown and is controlled by Bluetooth, you need to scan the code to connect via the app.\r\n\r\n8 In 1: Intelligent connector support connects 8 s at the same time, you can set each individually, and adjust the speed as your need.\r\n\r\nUnique Design: The click device adopts contactless air mapping click technology, which will not hurt the screen, can provide a longer serving time, and stability without noise.\r\n\r\nBattery Powered: Simulated finger clicking tool with built in battery, can be charged while using, perfect for live broadcasts, games, gifts, like, reward tasks, etc.\r\n\r\nApplication: Continuous is suitable for phones, tablet, and other touch screen devices.\r\n\r\n\r\n\r\nLưu ý:\r\n\r\n1. Vui lòng cho phép sai số nhỏ về số đo do đo lường thủ công.\r\n\r\n2. Do sự khác biệt giữa các màn hình khác nhau, hình ảnh có thể không hiển thị đúng màu sắc thực tế của sản phẩm.\r\n\r\n3. Chúc bạn mua sắm trực tuyến vui vẻ!', 300394, 17.00, '2022-12-03 10:01:36', '2022-12-03 10:01:36'),
(104, 1, 9, 'Pin Maxell 2A , 3A cho camera thiết bị điện tử chuột không dây', 'https://cf.shopee.vn/file/29c5eded1230ba0efcc9fddb1b2f58a9', 'Pin AA Maxell than là loại pin thông dụng nhất, pin sử dụng chất liệu carbon giá thành rẻ so với pin Alkaline. Với chất liệu này pin được dùng rất phổ biến trong gia đình, cơ quan… pin dùng cho đồng hồ treo tường, điều khiển… Với nhu cầu sử dụng dòng điện bình thường, pin có thời gian lưu trữ của pin là 3 năm.\r\n- Loai pin rất chất lượng so với giá cả \r\n- Là loại Pin thông dụng nhất trên thị trường sử dụng hầu hết các thiết bị như: Chuột máy tính, đồng hồ, điều khiển, đồ chơi.\r\n- Thời gian lưu trữ Pin là 3 năm  \r\n- Đặc biệt khi dùng hết Pin không chảy nước => An toàn cho thiết bị\r\n\r\nThông Tin Chi Tiết Pin Aa Maxell Than\r\nTT sản phẩm: pin AA , pin AAA\r\nĐiện áp: 1,5V\r\nKích thước: 50,5 x 14,5mm\r\nNhà sản xuất: Maxell Nhật – Indonesia\r\nBảo hành: 6 tháng\r\nĐóng gói: 4 viên /vỉ , 2 viên / vỉ\r\n\r\n- Dùng cho các thiết bị cần năng lượng cao như: Máy chụp hình, máy nhắn tin, máy hát đĩa CD, trò chơi điện tử và các thiết bị y tế cầm tay, Radio, đồng hồ treo tường, Walkman, Flash chụp hình, đèn pin, remote, ...\r\n- Chất lượng: mẫu mã đẹp, bền.\r\n- Pin Maxell AAđến từ thương hiệu uy tín nhiều năm trên thị trường,\r\n- Đảm bảo thời lượng pin dài nhất, hiệu suất cao và an toàn cho mọi thiết bị của bạn.\r\n- Điện áp 1.5V, pin phù hợp các thiết bị phổ biến như máy nghe nhạc, đèn pin, đồ chơi, chuột không dây...\r\n- Loai pin rất chất lượng so với giá cả \r\n- Là loại Pin thông dụng nhất trên thị trường sử dụng hầu hết các thiết bị như: Chuột máy tính, đồng hồ, điều khiển, đồ chơi.\r\n- Thời gian lưu trữ Pin là 3 năm  \r\n- Đặc biệt khi dùng hết Pin không chảy nước => An toàn cho thiết bị', 7023, 0.85, '2022-12-03 10:01:36', '2022-12-03 10:01:36'),
(105, 1, 9, 'Đồng Hồ Đo Điện Vạn Năng DT9205A - Thích hợp cho thợ điện tử hay học sinh sinh viên học- bảo hành 1 tháng', 'https://cf.shopee.vn/file/sg-11134201-22100-dicdiydjqniv1b', '★ Bảo vệ người mua\r\n✅Bảo hành 1 tháng\r\n✅ Đổi trả sản phẩm trong vòng 7 ngày không cần lý do.\r\n✅ Đổi mới sản phẩm trong vòng 30 ngày do lỗi của nhà sản xuất.\r\n✅ Cam kết về chất lượng sản phẩm, hoàn tiền 💯% nếu hàng không đạt yêu cầu, kém chất lượng, sai mẫu mã.\r\n✅Hỗ trợ sau mua, nếu có thắc mắc hãy tìm đến cửa hàng, chúng tôi sẽ phục vụ bạn trực tuyến.\r\n✅Dịch vụ khách hàng trực tuyến: Thứ Hai đến Thứ Sáu, 8: 30-18: 30\r\n\r\n---------------------------------------------------------------------\r\n-Đồng hồ vạn năng đồng hồ đo điện\r\n-Màn hình đồng hồ LCD sắc nét\r\n-Phù hợp cho học sinh, sinh viên và anh em mới vào nghề cần một chiếc \r\n\r\n\r\n\r\nđồng hồ đo giá rẻ đầy đủ chức năng cơ bản phục vụ học tập và công việc:\r\n+Kiểm tra nối mạch: khi điện trở giữa 2 đầu đo gần bằng 0 (mạch thông) thì máy sẽ kêu “bíp”. Đồng thời có đèn led hiển thị hỗ trợ trong điều kiện làm việc ồn không nghe thấy tiếng Bip\r\n+Đặc biệt đồng hồ giá rẻ nhưng có tính năng đo tụ điện\r\n+Đo điện áp xoay chiều và một chiều lên tới 20A có cầu chì bảo vệ\r\n+Đo cường độ dòng điện.\r\n+Đo điện trở, độ tự cảm của quận cảm, và điện dung của tụ điện.\r\n+Kiểm tra các linh kiện như transistor, diode, led…\r\n🎨Kỹ thuật:\r\nVật chất: ABS\r\nMàn hình hiển thị: Màn hình LCD, 2000 đếm\r\nDải điện áp DC: 200mV / 2V / 20V / 200V / 1000V\r\nChính xác:\r\n100mV / 1V / 10V / 100V: ± (0,5% + 2)\r\n1000V: ± (0,8% + 2)\r\nĐộ phân giải điện áp dc: 100μV / 1mV / 10mV / 100mV / 1V\r\nDải điện áp xoay chiều: 200mV / 2V / 20V / 200V / 700V\r\nChính xác:\r\n200mV: ± (1.2% + 3)\r\n2V / 20V / 200V: ± (0,8% + 3)\r\n700V: ± (1,2% + 3)\r\nĐộ phân giải điện áp xoay chiều: 100μV / 1mV / 10mV / 100mV / 1V\r\nDải dòng điện MỘT CHIỀU: 2mA / 20mA / 200mA / 20A\r\nChính xác:\r\n2mA / 20mA: ± (1,2% + 2)\r\n200mA: ±(1.4%+2)\r\n20A: ± (2.0% + 2)\r\nĐộ phân giải dòng điện một chiều: 1μA / 10μA / 100μA / 10mA\r\nPhạm vi dòng điện xoay chiều: 2mA / 20mA / 200mA / 20A\r\nChính xác:\r\n2mA / 20mA: ± (1,2% + 3)\r\n200mA: ±(1.8%+3)\r\n20A: ± (3.0% + 7)\r\nĐộ phân giải dòng điện xoay chiều: 1μA / 10μA / 100μA / 10mA\r\nPhạm vi kháng cự: 200Ω / 2KΩ / 20KΩ / 200KΩ / 2MΩ / 20MΩ / 200MΩ\r\nChính xác:\r\n200Ω: ±(1.0%+2)\r\n2KΩ / 20KΩ / 200KΩ / 2MΩ: ± (0,8% + 2)\r\n20MΩ: ± (1,2% + 2)\r\n200MΩ: ± (5.0% + 10)\r\nĐộ phân giải điện trở: 0,1Ω / 1Ω / 10Ω / 100Ω / 1kΩ / 10kΩ / 100kΩ\r\nPhạm vi điện dung: 2nF / 20nF / 200nF / 2μF / 200μF\r\nĐộ chính xác: ± (4.0% + 5)\r\nĐộ phân giải điện dung: 1pF / 10pF / 100pF / 1nF / 100nF\r\nDải tần số: 2KHz / 20KHz\r\nChính xác:\r\n2KHz: ± (2.0% + 5)\r\n20KHz: ± (1.5% + 5)\r\nĐộ phân giải tần số: 1Hz / 10Hz\r\nPhạm vi nhiệt độ: (-20-1000) ° C / (0-1832) ° F\r\nĐộ phân giải nhiệt độ: 1 °C / 1 °F\r\nTrọng lượng: 300g\r\nKích thước đóng gói: 20 * 12 * 4,5cm\r\n \r\n🎨Danh sách đóng gói:\r\n1 * Đồng hồ vạn năng\r\n1 cặp * Kiểm tra chì\r\n1 * Hướng dẫn sử dụng\r\n', 464, 4.12, '2022-12-03 10:04:20', '2022-12-03 10:04:20'),
(106, 1, 9, 'Cân điện tử mini bỏ túi MH333, Cân tiểu ly 200g/0.01g, Thiết kế kiểu dáng nắp gập, bỏ túi tiện lợi', 'https://cf.shopee.vn/file/b657b5266b8732fe1068f33153033e34', '🛎️🛎️🛎️ LƯU Ý QUAN TRỌNG:\r\n1. Khách hàng nhận được sản phẩm không đúng thông tin đặt hàng hoặc sản phẩm bị hư hỏng do quá trình vận chuyển ----->>> Khách hàng vui lòng nhấn \"Trả hàng\" trong phần thông tin đơn hàng để hoàn trả lại sản phẩm cho shop, các đơn hàng thanh toán trước sẽ được hoàn tiền lại.\r\n2. Quy định chính sách của Shopee không cho phép đồng kiểm khi giao hàng nhưng sẽ được hoàn trả hàng khi sản phẩm nhận được không đúng hoặc bị hư hỏng do vận chuyển ----->>> Khách hàng thực hiện như Lưu ý số 1 đã nêu.\r\n3. Bảo hành: 06 tháng kể từ Ngày mua hàng thể hiện trên Phiếu bảo hành đi kèm.\r\n\r\n🌟🌟🌟🌟🌟🌟🌟🌟🌟🌟\r\n\r\n💛 GIỚI THIỆU TỔNG QUAN 💛\r\n- Cân điện tử MH333 200g/0.01g là dòng cân mini bỏ túi hầu như đáp ứng được tất cả các nhu cầu sử dụng cân linh động, chính xác như trong phòng thí nghiệm, nghiên cứu học tập, trong trường học, bệnh viện, cân vàng bạc, trang sức và các nhu cầu ứng dụng khác. Đạt độ chính xác cấp III theo chuẩn OIML với độ phân giải bên trong cao cho tốc độ xử lý nhanh.\r\n\r\n💛 TÍNH NĂNG SỬ DỤNG💛\r\n- Cân trọng lượng.\r\n- Trừ bì khi cân hàng có khay, thùng, hộp theo kèm.\r\n- Chuyển đổi đơn vị cân khác nhau để sử dụng.\r\n\r\n💛 THÔNG SỐ SẢN PHẨM 💛\r\n✅ Mức cân lớn nhất: 200g.\r\n✅ Mức cân nhỏ nhất: 0.2g.\r\n✅ Bước nhảy số/ Độ chia: 0.01g.\r\n✅ Sai số cho phép: ±0.005g.\r\n✅ Đĩa cân inox: 40mm x 40mm (Dài x Rộng)\r\n✅ Kích thước cân: 75mm x 42mm x 11mm(Dài x Rộng x Cao).\r\n✅ Màn hình hiển thị cân: Màn hình hiển thị LCD có đèn backlit. \r\n✅ Đơn vị cân: g, ct, dwt, oz, lb, đơn vị cân vàng tlt;\r\n✅ Nguồn điện: 1 pin CR2032.\r\n✅ Thiết kế dạng nắp gập dễ dàng bỏ túi khi mang đi.\r\n✅ Môi trường hoạt động: Khuyến cáo không tiếp xúc với nước.\r\n✅ Thương hiệu: MingHeng - Trung Quốc.\r\n\r\n💛 THÔNG SỐ SẢN PHẨM 💛\r\n+ Cân MH333;\r\n+ Pin CR2032 \r\n+ Hướng dẫn sử dụng;\r\n+ Phiếu bảo hành nhà cung cấp;\r\n', 198, 16.15, '2022-12-03 10:04:20', '2022-12-03 10:04:20'),
(107, 1, 9, 'BỘ TÔ VÍT SỬA ĐIỆN THOẠI, LINH KIỆN ĐIỆN TỬ (HARDEN) - 6 CHI TIẾT - 550121 DC-TOOLS', 'https://cf.shopee.vn/file/a30f185b8bf795f09bfe4bb66cd69140', '✔️  Kim khí giá sỉ Dũng Cảnh cam kết bán hàng chính hãng, đảm bảo 100% chất lượng\r\n✔️ Sản phẩm của chúng tôi hoàn toàn giống với mô tả\r\n✔️ Cam kết chất lượng tốt nhất với giá rẻ nhất tới người tiêu dùng\r\n✔️  Sỉ liên hệ: 0397600006\r\n\r\n📍 THÔNG TIN SẢN PHẨM:\r\n\r\nBộ tua vít sửa iphone, tua vít tháo laptop...\r\nBộ tua vít đa năng, tô vít nhiều đầu vặn, tô vít tháo ráp laptop, tô vít sửa đồng hồ\r\nBộ vít gồm nhiều đầu khác nhau \r\n- Được làm bằng thép cao cấp hợp kim Aluminum chống rỉ sét \r\n- Độ cứng cực cao đạt 60-HRC \r\n- Hộp được làm từ nhựa cao cấp rất tinh xảo và sang trọng \r\n- Kích thước nhỏ gọn, thẩm mĩ, dễ dàng mang bên mình\r\nThảo được hầu hết các loại đồng hồ, laptop, PC, camera...\r\n\r\n⚠️⚠️ KHI CÓ BẤT KỲ VẤN ĐỀ GÌ ĐỐI VỚI SẢN PHẨM NHẬN ĐƯỢC VUI LÒNG LIÊN HỆ VỚI SHOP QUA HOTLINE HOẶC INBOX SHOP ĐỂ ĐƯỢC XỬ LÝ KỊP THỜI VÀ NHANH NHẤT !!!', 81, 1.91, '2022-12-03 10:07:00', '2022-12-03 10:07:00'),
(108, 1, 9, 'Module Cảm Biến Khí GAS MQ2', 'https://cf.shopee.vn/file/10bebea9e8e44ffa9e4a27a47ab40eac', 'Cảm biến khí gas MQ2\r\n\r\n \r\n\r\n Thông số kĩ thuật :\r\n\r\nĐiện áp hoạt động: 3.3V-5V\r\nKích thước PCB: 3cm * 1.6cm\r\nLed đỏ báo nguồn vào, Led xanh báo gas\r\nIC so sánh : LM393\r\nVCC: 3.3V-5V\r\nGND: 0V\r\nDO: Đầu ra tín hiệu số (0 và 1)\r\nAO: Đầu ra Analog (Tín hiệu tương tự)\r\nCấu tạo từ chất bản dẫn Sno2\r\n \r\nCó  2 dạng tín hiệu: Analog( AO)  và Digital (DO)\r\n             \r\n\r\n             - Dạng tín hiệu : TTL đầu ra 100mA ( Có thể sử dụng trực tiếp Relay, Còi công suất nhỏ...)\r\n             - Điều chỉnh độ nhạy bằng biến trở.\r\n             - Sử dụng LM393 để chuyển AO --> DO\r\n', 30, 1.49, '2022-12-03 10:07:00', '2022-12-03 10:07:00'),
(109, 1, 9, 'Vôn Kế Điện Tử 0.36 Inch 4.5V-30VDC', 'https://cf.shopee.vn/file/f77449809016f0a142449fc311138e4e', 'Vôn Kế Điện Tử 0.36 Inch 4.5V-30VDC\r\nVôn Kế Điện Tử 0.36 Inch dải đo Chính xác khi không sử dụng nguồn nuôi : Red DC4.80V-30.0V, xanh lá cây DC2.70-32.0V, xanh Dương DC3.00-30.0V\r\nThông Số Kỹ Thuật\r\nĐiện áp đầu vào Max: 32VDC\r\nCó bảo vệ chống cắm ngược dây.\r\nTrở kháng đầu vào: >100K\r\nTốc độ phản ứng thay đổi điện áp: 300ms\r\nKích thước led: 15mm X 10 mm X 23mm ( tai gắn dào 33mm )\r\nKhối lượng: 5g\r\n\r\n-----------------------\r\nHOTLINE: 024.2021.4848\r\n      ZALO : 0987.988.041\r\nĐịa chỉ mua hàng tại Hà Nội: 26- Ngõ 106- Lê Thanh Nghị- Hai Bà Trưng- Hà Nội\r\n-----------------------\r\nLinh Kiện Điện Tử 3M cam kết: \r\nBán giá luôn cạnh tranh và dịch vụ sau mua tốt nhất thị trường.\r\nCam kết hoàn tiền 100% khi sản phẩm sai quảng cáo,hoặc lỗi do nhà sản xuất.\r\n Cam kết Sản Phẩm giống ảnh', 2920, 1.23, '2022-12-03 10:09:11', '2022-12-03 10:09:11'),
(110, 1, 9, 'Cầu chì ống 5x20 -0.2A -0.5A - 1A - 2A - 3A - 5A-6A-7A-8A - 10A-12A-15A-20A', 'https://cf.shopee.vn/file/e47b394695dae28c90f7211395e51152', '<>Thông số kỹ thuật (định danh):\r\n_Thông số kích thước quý khách tham khảo trên ảnh - có thể có sai số.\r\n\r\nLưu ý:\r\n**Định danh: Là thông số do nhà sản xuất cung cấp hoặc ghi trên sản phẩm, các thông số này có thể có sai số so với thực tế.\r\nCầu chì ống 5x20 -0.2A -0.5A - 1A - 2A - 3A - 5A-6A-7A-8A - 10A-12A-15A-20A\r\n\r\nCầu chì ống thủy tinh 5x20 (mm)\r\n', 30213, 0.04, '2022-12-03 10:09:11', '2022-12-03 10:09:11'),
(111, 1, 10, 'LIGE Đồng Hồ Nam Màu Đen Đồng Hồ Đeo Tay Thể Thao Chống Nước Chính Hãng Mới Nhất Lịch Và Hộp Đồng Hồ Bấm Giờ Wth', 'https://cf.shopee.vn/file/326856b5b12ec85f4564152f2fe9c472', '🚀Mô tả:\r\n\r\n-100% Nhãn hiệu mới và chất lượng cao;\r\n\r\n-3ATM / 30m chống thấm nước (không thích hợp để tắm, bơi lội và lặn);\r\n\r\n-24 Giờ và phút / giây chức năng hẹn giờ (làm việc ba mặt số phụ);\r\n\r\n- Vỏ thép không gỉ;\r\n\r\n-Dây Đeo silicon chất lượng cao\r\n\r\n\r\n\r\n🚀Thông số kỹ thuật (ước tính):\r\n\r\n-Đường Kính vỏ: 4,2 cm\r\n\r\n-Chiều Dày: 1,2cm\r\n\r\n-Chiều Rộng dây đeo: 2.0 cm\r\n\r\n-Tổng Chiều dài: 24 cm\r\n\r\n-Trọng Lượng tịnh: 75,5g\r\n\r\n\r\n\r\n🚀Gói hàng bao gồm:\r\n\r\n-1 X đồng hồ LIGE\r\n\r\n-1 X Hộp ban đầu\r\n\r\n-1 X Hướng dẫn sử dụng\r\n\r\n\r\n\r\nVề mặt hàng này:\r\n\r\n⌚Chống thấm nước đến 30 mét: Nói chung có thể chịu được nước bắn hoặc ngâm trong nước trong thời gian ngắn, Nó không thể được sử dụng trong bồn tắm nước nóng và phòng xông hơi khô. (Lưu ý: Không vận hành nút của đồng hồ dưới nước)\r\n\r\n\r\n\r\n⌚Bộ máy thạch anh: Bộ máy thạch anh chất lượng cao nhập khẩu từ Nhật Bản, Thời gian chính xác. Loại móc cài đồng hồ là một khóa ghim. Dễ đeo, Và dây đeo silicon có vẻ mềm mại rất chống mài mòn. Thiệt hại cho dây đeo tránh được.\r\n\r\n\r\n\r\n⌚Đồng hồ đa chức năng: Hoạt động đầy đủ, Hỗ trợ thời gian, đồng hồ bấm giờ, Phút và ngày tự động, Tất cả các mặt số nhỏ đều hoạt động tốt. Mặt số chứa phốt pho bên trong, Nó sẽ làm cho con trỏ phát sáng vào ban đêm (Cần hấp thụ đủ điểm nổi bật trước khi chiếu sáng) Nó sẽ là gia đình,Bạn bè, đối tác và món quà hoàn hảo của riêng bạn.\r\n\r\n\r\n\r\n⌚Chất liệu: Đồng hồ silicon có khả năng chống mài mòn, Chịu nhiệt độ cao, Không biến dạng, Không độc hại, Không vị, Không tác dụng phụ trên cơ thể con người và tính năng mềm mại, Không nứt, Tuổi thọ lâu dài, Không gây kích ứng da, v.v. (Không mang đồng hồ gần nguồn lửa Hoặc đặt ở những nơi tối và ẩm ướt, Hãy chú ý đến quá trình lão hóa pin ẩm)\r\n\r\n', 9918, 15.94, '2022-12-03 10:12:04', '2022-12-03 10:12:04'),
(112, 1, 10, 'Đồng Hồ Điện Tử Dạ Quang Thời Trang', 'https://cf.shopee.vn/file/sg-11134201-22110-5jkqkrqnfyjve5', '🌷Chào mừng bạn đến với cửa hàng của chúng tôi!🌷\r\n\r\n💗Tất cả các sản phẩm có sẵn.\r\n\r\n💗Chúng tôi gửi từ Trung Quốc. 7-15 ngày làm việc để đến giao hàng.\r\n\r\n💗 Chúng tôi sẽ vận chuyển cho bạn trong vòng 1~3 ngày làm việc.\r\n\r\n💗Trước khi Đặt hàng, hãy Nhận Phiếu Giảm Giá Và Thưởng Nhiều Giảm Giá Hơn, Vui Lòng Ghé thăm Trang Chủ Cửa Hàng Để Thu thập.\r\n\r\n🍀🍀🍀🍀🍀🍀🍀🍀🍀🍀🍀🍀🍀\r\n\r\nMô tả\r\n\r\nLoại: Đồng hồ điện tử LED\r\n\r\nVật chất:\r\n\r\nChất liệu khóa: Nhựa ABS\r\n\r\nChất liệu vỏ: Nhựa ABS\r\n\r\nChất liệu gương: PC sáng\r\n\r\nChất liệu dây đeo: TPU 80 độ chất lượng cao\r\n\r\nKích thước:\r\n\r\nĐường kính quay số: 40 * 34,5mm\r\n\r\nĐộ dày: 10,5mm\r\n\r\nChiều dài dây đai: 24cm\r\n\r\nMàu sắc: Như hình\r\n\r\nDung lượng pin: 200mAh\r\n\r\nTrọng lượng: Khoảng 21g\r\n\r\n💗Không bảo hành\r\n\r\n💗30m không thấm nước\r\n\r\nGói bao gồm: 1pc x Đồng hồ điện tử LED\r\n\r\n(Không Bao gồm vòng tay)\r\n\r\nGhi chú:\r\n\r\nCó thể có sự khác biệt nhẹ về màu sắc khi cài đặt các độ tương phản màn hình led khác nhau.\r\n\r\n1 Inch = 25,4mm hoặc 1mm = 0,0393 Inch\r\n\r\nVui lòng cho phép chênh lệch kích thước nhỏ 1-3mm do đo thủ công.\r\n\r\n🍀🍀🍀🍀🍀🍀🍀🍀🍀🍀🍀🍀🍀\r\n\r\n💕Dịch vụ sau bán hàng💕\r\n\r\n🥰Vui lòng liên hệ với chúng tôi trước (👉Trước khi xác nhận biên nhận👈)) Nếu bạn có bất kỳ vấn đề gì với sản phẩm bạn nhận được. Chúng tôi sẽ cố gắng hết sức để giải quyết vấn đề và làm hài lòng bạn.🥰\r\n\r\n✨Nếu bạn hài lòng với sản phẩm của chúng tôi, chúng tôi hy vọng bạn có thể cho chúng tôi⭐⭐⭐⭐⭐ Xếp hạng sao thuận tiện cho bạn.\r\n\r\n🌈Chia sẻ Video Sản phẩm Là Hỗ trợ Tốt nhất cho Chúng tôi.', 1530, 0.81, '2022-12-03 10:12:04', '2022-12-03 10:12:04'),
(113, 1, 10, 'Đồng hồ nam, nữ thể thao kiểu dáng mới khỏe khoắn máy cơ dây cao su SPORT WATER', 'https://cf.shopee.vn/file/sg-11134201-22110-uj66kh4hqwjv3f', 'Đồng hồ nam, nữ thể thao Mywatchs rất hân hạnh được chào đón quý khách hàng ghé thăm và lựa chọn sản phẩm ở tại Shop.Chúc quý khách sẽ lựa chọn được sản phẩm ưng ý và hài lòng nhất tại đây ạ^^\r\n\r\n*** ĐỒNG HỒ CHỈ CÓ CHỨC NĂNG XEM GIỜ VÀ CHẠY KIM BẰNG MÁY CƠ ***\r\n\r\n- Đây là một sản phẩm được thiết kế dựa trên nhu cầu sử dụng của các bạn nam, nữ có sở thích và phong cách thể thao,mạnh mẽ và cá tính.\r\n- Việc sở hữu cho mình một chiếc đồng hồ thể thao sẽ mang lại cho người dùng sự thoải mái,tiện lợi và đặc biệt là sự tự tin trong khi hoạt động và rất dễ để sử dụng.\r\nTHÔNG TIN CHI TIẾT VỀ SẢN PHẨM :\r\n- Chất liệu mặt đồng hồ thể thao : Kính cường lực(Mineral Crystal),là loại chống trầy và va đập khá tốt và được sử dụng phổ biến hiện nay\r\n- Chất liệu dây đeo : Dây cao su\r\n- Chống nước : 5 ATM , chịu nước ở mức rửa tay,rửa mặt, đi mưa .\r\n- Độ dày mặt đồng hồ : 12MM\r\n- Đường kính mặt đồng hồ thể thao : 36MM ( Luôn viền ngoài là 44MM),đây là size unisex nên sẽ khá to cho bạn nữ nhé, bạn nữ nào thích đeo to thì vẫn rất ok ạ !\r\n- Độ rộng dây đeo : 20mm\r\n\r\n⚠️ CAM KẾT : TẤT CẢ HÌNH ẢNH SHOP CHỤP VÀ MÔ TẢ ĐỀU CHÍNH XÁC 100%\r\n♻️  BẢO HÀNH & ĐỔI TRẢ :\r\n- Mywatchs xin cam kết đảm bảo quyền lợi tuyệt đối cho quý khách hàng sử dụng sản phẩm tại đây\r\n- Miễn phí 1 đổi 1 nếu sản phẩm có lỗi do nhà sản xuất\r\n- Bảo hành máy 6 tháng\r\n- Khi nhận hàng nếu sản phẩm KHÔNG MAY chưa làm quý khách hài lòng xin hãy liên lạc lại với shop qua mục \'\'CHAT\'\' hoặc số Hotline : 0379.70.85.70\r\n- Thời gian giao hàng : Từ 1-3 ngày đối với khách ở HN & các tỉnh xa phía bắc.\r\n                                         Từ 3-5 ngày đối với khách ở phía Nam.', 1309, 5.10, '2022-12-03 10:14:18', '2022-12-03 10:14:18'),
(114, 1, 10, 'Đồng hồ thời trang nữ Mstianq MH022 mặt hoa cúc cực đẹp, nhiều màu dể dàng phối đồ, cá tính, trẻ trung', 'https://cf.shopee.vn/file/5053a40cba408efff9e0710099f11d7e', '🎊CHÀO MỪNG ĐẾN CỬA HÀNG MADELINE🎉\r\n\r\n🏍MIỄN PHÍ VẬN CHUYỂN ĐƠN HÀNG TỪ 50K🏍\r\n\r\n🚀Sản phẩm có sẵn và được giao trong thời gian nhanh nhất!\r\n🍀Nếu có vấn đề sau khi nhận hàng, giao hàng thiếu, sản phẩm lổi, vận chuyển chậm,.. xin vui lòng liên hệ với chúng tôi bất cứ lúc nào để được hỗ trợ.\r\n\r\nTHÔNG TIN CHUNG:\r\nTÊN SẢN PHẨM: Đồng hồ thời trang nữ Mstianq MH022 mặt hoa cúc cực đẹp\r\nTHÀNH PHẦN:\r\n- Dây đeo: Dây da\r\n- Mặt kính : Mặt kính Mineral crytal chống trầy và va đập tốt\r\n- Khung: Hợp kim\r\n- Bộ máy: Time Module quartz movement \r\n\r\nTHÔNG SỐ KỸ THUẬT:\r\n- Kích thước mặt: 32mm\r\n- Chiều dài dây: 22 cm \r\n- Dày: 8mm\r\n- Chiều rộng dây:14mm\r\n- Chức năng: Xem giờ\r\n- Chống nước: 3ATM ( chống nước sinh hoạt )\r\n- Màu sắc: Đen số vạch, trắng số vạch, hồng số vạch, rêu số vạch, xám số vạch, đen số, hồng số, trắng số, xám số, rêu số, trắng số, nâu số\r\n- Xuất xứ: Trung Quốc\r\n\r\nTHÔNG TIN CẢNH BÁO:\r\nKhông sử dụng đồng hồ tiếp xúc hóa chất, xà phòng, ngâm nước, bơi lội trong thời gian dài\r\n\r\nHƯỚNG DẨN SỬ DỤNG:\r\n- Bạn rút nhẹ chốt giữ sau đó xoay chốt chỉnh giờ và ấn chốt sát vào để đồng hồ hoạt động\r\n\r\nTHÔNG TIN BẢO HÀNH:\r\n- Bảo hành 6 tháng về máy và 12 tháng về pin\r\n- Đổi mới trong 7 ngày:\r\n+ Sản phẩm đổi mới chưa qua sử dụng.\r\n+ Lổi do vận chuyển, sản xuất.\r\n\r\nNhà nhập khẩu: Công Ty Dịch Vụ Vận Tải Trường Phát Logistics\r\nĐịa chỉ: sô 78/12 đường Cộng Hòa , Phường 4, Quận Tân Bình, TP.HCM, Việt Nam\r\nNhà Phân phối: Hộ kinh doanh Madeline\r\n\r\nTHỜI GIAN GIAO HÀNG:\r\n- Giao hàng nhận hàng mới thanh toán.\r\n- Nội thành Hồ Chí Minh: 1-2 ngày nhận hàng\r\n- Ngoại thành:\r\n+ Thị trấn, huyện, thị xã: 2-3 ngày nhận hàng\r\n+ Ấp, thôn, xóm: 3-4 ngày nhận hàng.\r\n', 3089, 1.28, '2022-12-03 10:14:18', '2022-12-03 10:14:18'),
(115, 1, 10, '[SHOP CHÍNH HÃNG] Đồng hồ nam OLEVS 2881 Lịch dây đeo bằng thép không gỉ Có chức năng phát sáng chống thấm nước', 'https://cf.shopee.vn/file/sg-11134201-22110-e2x28f1defkv74', 'Chào mừng bạn đến với 【OLEVS-Official-Store】\r\nChúng tôi cam kết: 100% đồng hồ nguyên bản! Hàng đã sẵn sàng! Chuyển phát nhanh! Bao bì tốt! \r\n\r\n✅ Giao hàng: Đơn hàng sẽ được chuyển trong vòng 12 giờ.\r\n✅ Đến: 3-5 ngày làm việc sau khi vận chuyển.\r\n✅ Sau khi bán: Nếu đồng hồ của bạn có vấn đề về chất lượng hoặc bạn không hài lòng. Chúng tôi cung cấp một khoản hoàn lại đầy đủ.\r\n✅Chào mừng người bán buôn và người bán lại\r\n✅ Hy vọng bạn thích mua sắm của bạn.\r\n\r\n【Thông Tin sản phẩm】 ↓\r\nThương hiệu: OLEVS 2881\r\nTrọng lượng đồng hồ: 80g\r\nĐường kính đồng hồ: 42mm\r\nĐộ dày quay số: 11,5mm\r\nChiều rộng dây đeo: 19,5mm\r\nChiều dài dây đeo: 230mm\r\nBảo hành 12 tháng\r\n\r\nCác biện pháp phòng ngừa❌:\r\n- Vui lòng không va đập và để đồng hồ tiếp xúc với các chất ăn mòn, nhiệt độ cao hoặc từ trường mạnh.\r\n- Vui lòng tránh xa dung môi, chất tẩy rửa, chất tẩy rửa công nghiệp, keo, sơn.\r\n- Đeo đồng hồ có vòng đeo tay dễ trầy xước nên các bạn đeo dây đồng hồ đeo đồng hồ nhé.\r\n- Không điều chỉnh nút hẹn giờ khi đồng hồ bị ướt.\r\n- Vui lòng không đặt đồng hồ thay đổi nhiệt độ đột ngột.\r\n- Vui lòng không nhấn nút và đặt nó vào nước.\r\n\r\n【Mục Bao gồm】\r\n1 x đồng hồ chính hãng\r\n1 x hộp quà tinh tế (Quà tặng miễn phí)\r\n1 x Hướng dẫn sử dụng\r\n1 x thẻ olevs gốc\r\n\r\n【100% Hỗ trợ khách hàng】\r\n1. Chúng tôi là nhà sản xuất ban đầu.\r\n2. Tất cả các sản phẩm là 100% mới và nguyên bản.\r\n3. Chúng tôi nỗ lực hết mình để cung cấp các sản phẩm chất lượng cao nhất với giá cả hợp lý.\r\n4. Tận tâm cung cấp một trải nghiệm khách hàng tốt chắc chắn!\r\n5. Sự hài lòng của khách hàng luôn quan trọng đối với chúng tôi.', 3000, 17.43, '2022-12-03 10:16:53', '2022-12-03 10:16:53'),
(116, 1, 10, 'Đồng Hồ Nam Chính Hãng Geneva G22 TD3 Dây Thép Lưới Cao Cấp Phong Cách Thời Trang Đẹp giá Rẻ', 'https://cf.shopee.vn/file/3bc75428326306ba399926310d2bf1a2', 'Đồng hồ nam thời trang cao cấp GENEVA với kiểu dáng sang trọng, dây bằng thép không rỉ, thiết kế mặt đồng hồ độc đáo thể hiện đẳng cấp của người đeo. Sản phẩm vừa là món phụ kiện độc đáo vừa là quà tặng chất lượng, thay lời muốn nói gửi trao yêu thương vô cùng lý tưởng dành cho người ấy.\r\nĐây là dòng thiết kế thời trang, hiện đại, mang đến phong cách đầy sang trọng, lịch lãm, độ bền và độ chính xác rất cao.\r\nKiểu dáng sang trọng, lịch lãm phù hợp cho giới trẻ.\r\n\r\nTHÔNG TIN SẢN PHẨM\r\n- Thương Hiệu: GENEVA\r\n- Giới Tính: Nam\r\n- Kính: kính cứng mineral\r\n- Máy: Quartz (Pin)\r\n- Kiểu Hiển Thị: Kim\r\n- Mặt: Tròn\r\n- Đường Kính Mặt : 40mm\r\n- Bề Dày : 8mm\r\n- Độ Rộng Dây: 20mm\r\n- Chiều Dài Dây: 230mm\r\n- Chất Liệu Vỏ: Thép không gỉ\r\n- Dây Đeo: thép không gỉ\r\n- Chống Nước: đi mưa, rửa tay sinh hoạt nhẹ (tránh hóa chất, tắm cởi ra bền máy)\r\n- Bảo hành : 6 tháng\r\n- Tặng Kèm Pin + Hộp\r\n#A18', 37744, 5.48, '2022-12-03 10:16:53', '0000-00-00 00:00:00'),
(117, 1, 10, 'Đồng hồ Nam đẹp Tisselly Bussiness Classic | Đồng hồ chống nước, chống xước dành cho Nam 40MM ', 'https://cf.shopee.vn/file/sg-11134201-22110-rf7ve0qs3gkv2f', 'Thống số chi tiết sản phẩm từ nhà sản xuất\r\n𝗧𝗛𝗢̂𝗡𝗚 𝗦𝗢̂́ 𝗦𝗔̉𝗡 𝗣𝗛𝗔̂̉𝗠\r\n✪ Thương hiệu: 🆃🅸🆂🆂🅴🅻🅻🆈\r\n✪ Số Model .: T6602\r\n- Kích thước mặt:	40mm\r\n- Độ dày vỏ máy:	12mm\r\n- Kích thước dây:	20mm\r\n✪ Chống nước :	3ATM. chống nước sinh hoạt.\r\n✪ Chất liệu mặt kính:	Mặt kính Saphire 6 lớp chống xước, chống nước và va đập\r\n✪ Bộ máy: Quartz.\r\n✪ Chất liệu dây đeo: Da PU dập vân cá sấu, Thép không gỉ.\r\n✪ Chức năng :	Day, Monday, Minute, Morning.\r\n𝐂𝐇𝐄̂́ Đ𝐎̣̂ 𝐁𝐀̉𝐎 𝐇𝐀̀𝐍𝐇 \r\n✪ Bảo hành 12 tháng về pin, 6 tháng về máy.\r\n✪ 1 đổi 1 trong 10 ngày nếu có lỗi sản xuất.\r\n𝐂𝐇𝐄̂́ Đ𝐎̣̂ 𝐕𝐀̣̂𝐍 𝐂𝐇𝐔𝐘𝐄̂̉𝐍\r\n✪ Nội thành Hà Nội: Hỗ trợ giao hàng ngay trong ngày qua Nowship/Grab.\r\n✪ Hà Nội và các tỉnh miền Bắc: 1-3 ngày.\r\n✪ Miền trung: 3-4 ngày.\r\n✪ Miền nam: 3-5 ngày.\r\n✪ Thanh toán khi nhận hàng.\r\n𝗟𝗢̛̀𝗜 𝗖𝗔̉𝗠 𝗢̛𝗡\r\nMình xin cám ơn toàn thể các bạn đã ghé thăm gian hàng online của bên mình ! \r\nNếu có bất kỳ vấn đề gì xin mọi người đừng vội đánh giá Shop, Shop luôn cầu thị để đạt được kết quả bán hàng tốt nhất, phục vụ khách hàng tốt nhất, Chân thành cám ơn một lần nữa ạ.\r\n𝗖𝗛𝗜́𝗡𝗛 𝗦𝗔́𝗖𝗛 𝗦𝗜̉ - 𝗖𝗧𝗩\r\nBạn nào muốn làm CTV , Afiliate thì liên hệ Fanpage nha: https://www.facebook.com/Matino.vn', 3, 20.83, '2022-12-03 10:19:43', '2022-12-03 10:19:43'),
(118, 1, 10, 'Đồng Hồ Nữ Daniel Wellington Classic Petite Ashfield Rose Gold & Cuff DW V1 Chính Hãng - OtisWatch MSP47528', 'https://cf.shopee.vn/file/faccdce0070261124534b6188f41e11c', 'Mã sản phẩm: 47528 \r\nThông tin chi tiết và cách sử dụng:\r\nDaniel Wellington (DW) được thành lập bởi Filip Tysander, là một thương hiệu ngự trị trên tay của rất nhiều tín đồ thời trang khắp nơi trên thế giới. \r\nTHANH LỊCH VÀ KHÁC BIỆT\r\nClassic Petite Ashfield. Chiếc đồng hồ siêu mỏng, nổi bật với dây đeo mắt lưới màu đen nhã nhặn và mặt đồng hồ đen tuyền đầy tinh tế.\r\n\r\nHướng dẫn chọn size:\r\n - Đồng hồ size mặt (đường kính mặt đồng hồ) 32mm là size chuẩn của nữ thể hiện hết vẻ đẹp của đồng hồng Daniel Wellington.\r\n - Đồng hồ size 28mm dành cho những bạn nữ tay nhỏ, có cân nặng dưới 45kg đeo size 28mm.\r\n - Vòng tay gửi kèm mặc định sẽ là vòng size S của nữ. Nếu bạn muốn đổi size M hãy nhắn tin hoặc ghi chú trong đơn hàng.\r\n\r\n I/ CAM KẾT TỪ NHÀ BÁN HÀNG\r\n 1. OtisWatch là gian hàng chính hãng Daniel Wellington, quý khách hoàn toàn có thể yên tâm khi mua hàng.\r\n Tất cả các sản phẩm chúng tôi bán đều được nhập từ hãng, có giấy tờ & hóa đơn hợp pháp đã được Shopee Mall kiểm duyệt nguồn gốc và chứng nhận chính hãng Daniel Wellington.\r\n 2. Quý khách nhận hàng, kiểm tra rồi mới thanh toán.\r\n 3. Bảo hành sản phẩm 03 năm theo tiêu chuẩn hãng, đặc biệt ƯU ĐÃI tặng thêm gói thay pin MIỄN PHÍ lên tới 05 năm của nhà phân phối.\r\n \r\n II/ Thông số sản phẩm  Wellington Classic Petite Ashfield Rose Gold \r\n Thông số đồng hồ: \r\n - Độ dày mặt: 6mm\r\n - Đường kính mặt: có 2 size 28mm - 32mm\r\n - Chiều rộng dây: 12mm (size 28mm) - 14mm (size 32mm)\r\n - Độ dài dây: 145 - 185mm\r\n - Cấu tạo máy: Japanese Quartz Movement\r\n - Dây đồng hồ thay thế được (ưu điểm nổi bật của hãng DW)\r\n - Chống nước tối thiểu: 3ATM (có thể rửa tay, đi mưa)\r\n \r\n Thông số vòng tay cuff dw classic bracelet\r\n - Đường kính/chu vi: \r\n  + Size S :155mm/6 inch (size Nữ) \r\n  + Size L: 185mm/7 inch (size Nam)\r\n - Màu sắc: Vàng hồng\r\n - Chất liệu: Thép không gỉ (316L)\r\n \r\n III/ BỘ SẢN PHẨM DANIEL WELLINGTON GỬI ĐẾN TAY KHÁCH HÀNG GỒM:\r\n - 01 Đồng hồ Daniel Wellington Petite Ashfield Rose Gold chính hãng.\r\n - 01 Vòng tay Cuff Classic Bracelet.\r\n - 01 Hộp đồng hồ Daniel Wellington mẫu Gift Sets.\r\n - 01 Dụng cụ thay dây in logo Daniel Wellington mẫu mới nhất.\r\n - 01 Túi in logo Daniel Wellington\r\n - 01 Thẻ tag để check mã vạch chính hãng bằng phần mềm check trên điện thoại: QRcode scanner (của quốc tế) .\r\n - 01 Sách hướng dẫn sử dụng của Daniel Wellington.\r\n - 01 Phiếu xuất kho lưu thông tin khách hàng & số serial number của sản phẩm, mọi thông tin bảo hành đã được lưu giữ tại đây, có giá trị tương đương với phiếu bảo hành của nhà phân phối.\r\n\r\n \r\n Cảm ơn quý khách đã tin tưởng và ủng hộ gian hàng cung cấp Daniel Wellington chính hãng của chúng tôi.\r\n Click vào @otiswatchđể xem thêm nhiều mẫu Daniel Wellington khác.\r\n \r\n Để trở thành Đại lý hoặc Cộng tác viên của chúng tôi, hãy nhắn tin ngay', 1194, 21.25, '2022-12-03 10:19:43', '2022-12-03 10:19:43'),
(119, 1, 10, 'Đồng Hồ Nam Dây Da Thiết Kế Đơn Giản', 'https://cf.shopee.vn/file/6bbb8f3111e0030041e7e2ca08552301', 'Chào mừng đến với cửa hàng của chúng tôi\r\n\r\n1, mục tiêu của chúng tôi là gì? \r\n★ Sản phẩm hoàn hảo: phổ biến & thiết thực & rẻ tiền.\r\n★ Giao hàng nhanh: có sẵn hàng và vận chuyển nhanh chóng\r\n2, Bảo vệ người tiêu dùng tốt hơn \r\n★ Hoàn trả đầy đủ nếu bạn không nhận được đơn đặt hàng của mình.\r\n★ Hoàn trả toàn bộ hoặc một phần, nếu hàng không như mô tả.\r\n\r\nMô tả Sản phẩm:\r\nĐược làm bằng khóa ghim bằng thép không gỉ và dây đeo bằng da chất lượng cao để đeo thoải mái hơn\r\nMón quà tốt nhất cho bạn trai để đi bộ đường dài ngoài trời hoặc mặc thường ngày\r\n\r\nThông tin chi tiết:\r\nBộ máy đồng hồ: Đồng hồ thạch anh\r\nPhong cách đồng hồ: thời trang đơn giản, giản dị\r\nĐường kính quay số: 38mm\r\nĐộ dày quay số: 9mm\r\nChiều rộng dây đeo: 20mm\r\nChiều dài dây đeo: 23cm (bao gồm cả vỏ)\r\nVật liệu quay số: nhựa\r\nChất liệu dây đeo: PU\r\nChất liệu gương: kính\r\nLoại khóa: Khóa chốt\r\nĐối tượng áp dụng: nam giới\r\nMức độ chống thấm nước: không thấm nước\r\nBảo hành: Không có\r\nSố lượng: 1\r\n', 59978, 1.23, '2022-12-03 10:22:05', '2022-12-03 10:22:05'),
(120, 1, 10, 'Đồng Hồ Kim Chống Thấm Nước Thời Trang Dành Cho Nam', 'https://cf.shopee.vn/file/1b18e24116c25075762c893ee349f9e5', 'Mô tả:\r\n\r\nLoại sản phẩm: Đồng hồ thạch anh\r\nChiều dài dây: 23 cm\r\nĐộ sâu chống thấm nước: 3Bar\r\nĐường kính quay số: 40 mm\r\n-Chiều Rộng băng: 20 mm\r\n-Chiều Dày: 12mm\r\nChất liệu dây đeo: Thép không gỉ\r\nChất liệu vỏ: hợp kim nhôm\r\nTính năng: Con trỏ phát sáng\r\nGói hàng bao gồm:\r\n- 1 x Đồng hồ đeo tay\r\n\r\nLưu ý: Mặt số nhỏ không hoạt động, nó chỉ là trang trí', 24934, 4.76, '2022-12-03 10:22:05', '2022-12-03 10:22:05');
