(121, 1, 10, 'Đồng hồ thời trang nữ VKA đính cườm dây silicon GBM111', 'https://cf.shopee.vn/file/aac02544305af1262864ef361ed7f441', 'Đồng hồ nữ mặt VUÔNG dây silicol cao cấp \r\n✅ CAM KẾT CỦA SHOP \r\n- Cam kết ảnh shop tự chụp 100%\r\n+ CAM KẾT HÌNH ẢNH, MÔ TẢ TÍNH NĂNG CHUẨN\r\n+ BẢO HÀNH 1 ĐỔI 1 NẾU SAI HÀNG HOẶC LỖI \r\n🕞 Kiểu Dáng : Mặt vuông. Hàng lung linh y ảnh\r\n💫 THÔNG SỐ KỸ THUẬT\r\n🕧 Dành cho : Nữ\r\n🕐 Màu sắc : màu sắc như ảnh ạ \r\n🕜 Chất liệu vỏ : Thép không gỉ.\r\n🕑 Chất liệu mặt trước : Kính Sapphire có độ bền cao, chống trầy vượt trội\r\n🕝 Chất liệu mặt sau : Thép không gỉ\r\n🕒 Chất liệu dây : Dây silicol dẻo bền. Mang ôm tay. Thoải mái. Gọn nhẹ ', 3867, 2.34, '2022-12-03 10:25:25', '2022-12-03 10:25:25'),
(122, 1, 10, '[SHOP CHÍNH HÃNG] OLEVS 2871 Đồng hồ nam chính hãng Lịch chuyển động thạch anh Mặt số phát sáng chống thấm nước', 'https://cf.shopee.vn/file/sg-11134201-22110-ich8ee8befkv20', 'Thời gian giao hàng dự kiến cho sản phẩm này là từ 3-5 ngày\r\n  \r\n  Chào mừng bạn đến với cửa hàng chính thức của 【OLEVS】\r\n  Chúng tôi cam kết: 100% đồng hồ nguyên bản! Sản phẩm đã sẵn sàng! Chuyển phát nhanh! Bao bì đẹp!\r\n  \r\n  ✅ Hậu mãi: Nếu đồng hồ của bạn có bất kỳ vấn đề gì về chất lượng hoặc bạn không hài lòng, vui lòng liên hệ với chúng tôi\r\n  ✅ Khách mua sỉ & đại lý được chào đón.\r\n  ✅ Chúc các bạn mua sắm vui vẻ.\r\n  \r\n  【Chức năng】\r\n  ↓\r\n  Ngày tự động\r\n  Chống thấm nước 30m\r\n  Sáng trong bóng tối\r\n  Họa tiết mặt trăng & mặt trời chuyển đổi tự động\r\n  \r\n  【Gói hàng bao gồm】\r\n  1 x Đồng hồ\r\n  1 x Hộp đồng hồ màu đen\r\n  1 x Hướng dẫn sử dụng\r\n  1 x Thẻ olevs chính hãng\r\n  \r\n  【Nhắc nhở】\r\n  1. Nếu đồng hồ của bạn có bất kỳ vấn đề chất lượng nào hoặc bạn không hài lòng, hãy liên hệ với chúng tôi\r\n  2. Nếu bạn có bất kỳ câu hỏi nào, bạn có thể liên hệ với chúng tôi\r\n  \r\n  【Dịp thích hợp】\r\n  Quà sinh nhật, quà tặng ngày lễ\r\n  Kỷ lục thời gian tập thể dục, thể thao\r\n  Tham dự các bữa tiệc\r\n  \r\n  【Đặc điểm】\r\n  ↓\r\n  Model thương hiệu: OLEVS 2871\r\n  Bộ máy đồng hồ: Bộ máy thạch anh Nhật Bản\r\n  Kính đồng hồ: Kính tinh thể cứng với lớp phủ phim\r\n  Chất liệu vỏ: Thép không gỉ\r\n  Chất liệu dây đeo: Da\r\n  Hình dạng mặt số: Tròn\r\n  Chế độ hiển thị: Loại kim trỏ\r\n  Cách đeo: Khóa cài ghim tiện lợi\r\n  \r\n  Trọng lượng đồng hồ: 56g\r\n  Đường kính mặt số: 40mm\r\n  Độ dày mặt số: 11.5mm\r\n  Chiều rộng dây đeo: 20mm\r\n  Chiều dài dây đeo: 240mm\r\n  bảo hành 12 tháng\r\n  Chú ý:\r\n  1. Xin vui lòng cho phép sai lệch kích thước nhỏ do đo lường thủ công.\r\n  2. Chống nước thông thường 30m: rửa tay, dùng hàng ngày không thấm nước, không thích hợp mang khi bơi, ngâm và lặn sâu.\r\n  \r\n  【Dịch vụ khách hàng 100%】\r\n  1. Chúng tôi là nhà sản xuất đồng hồ trực tiếp.\r\n  2. Tất cả các sản phẩm là 100% mới và nguyên bản.\r\n  3. Chúng tôi cam kết cung cấp cho bạn sản phẩm với chất lượng cao nhất với giá cả hợp lý.\r\n  4. Chắc chắn tận tâm để cung cấp trải nghiệm khách hàng tốt!\r\n  5. Sự hài lòng của khách hàng luôn là mục tiêu theo đuổi quan trọng đối với chúng tôi.\r\n  6. Mọi người có thể yên tâm mua hàng của chúng tôi để nhận được sản phẩm chính hãng với dịch vụ chăm sóc khách hàng tuyệt vời của chúng tôi\r\n  Lưu ý: Các sản phẩm có chất liệu vàng, kim cương, đá quý trong shop đều là xi mạ/ nhân tạo.', 3829, 16.15, '2022-12-03 10:25:25', '2022-12-03 10:25:25'),
(123, 1, 11, 'Bộ máy ảnh Nikon 1 J1 kèm ống kính NIKKOR 10-30mm f/3.5–5.6 VR Mirrorless nhỏ gọn, dễ sử dụng', 'https://cf.shopee.vn/file/83808cc71270031e3298541ff02e6266', 'Nằm trong phân khúc máy ảnh mirrorless, Nikon 1 J1 sở hữu ngoại hình nhỏ gọn, thiết kế đơn giản nhưng tích hợp nhiều tính năng mạnh mẽ và tiện dụng bên trong.\r\nVới thiết kế gọn nhẹ, ngàm ống kính nhỏ không cồng kềnh, Nikon 1 J1 cho cảm giác cầm máy thoải mài để sử dụng tốt trong thời gian dài mà không mỏi tay. Sử dụng J1 bắt buộc phải dùng tay trái đỡ ống kính, do vậy tuy không có gờ tay phía trước nhưng cũng không ảnh hưởng đến việc cầm máy chắc chắn hơn.\r\nThời gian khởi động máy là 1.5 giây và thời gian khởi động cho đến khi bấm máy kiểu đầu tiên là 2 – 2.25 giây, đây cùng là khoảng thời gian khởi động trung bình của đa số sản phẩm máy ảnh khác.\r\nThử nghiệm khả năng chụp hình liên tiếp của J1 cho thấy, máy có thể chụp liên tiếp 5 khung hình/giây nhưng bộ đệm của máy chỉ chứa 12 ảnh, sau đó phải dừng lại vài giây rồi mới tiếp tục. Dĩ nhiên, đèn flash trên máy không hỗ trợ cho chế độ này.\r\nKhả năng lấy nét trên J1 rất đáng kinh ngạc, máy lấy nét êm du trong thời gian chỉ 0.20 giây và lấy nét liên tục khi thay đổi vị trí. Thời gian trễ màn trập trên J1 là 0.01 giây, khá tốt so với máy ảnh cùng phân khúc.\r\nSử dụng chế độ chụp ảnh tự động trên J1 nhận thấy, trong những tình huống thiếu sáng một chút, J1 lựa chọn hình ảnh có tốc độ màn trập thấp hơn là để hình ảnh với ISO cao, nhằm tránh hạt nhiễu cho hình ảnh. Kết quả hình ảnh với chế độ này cho màu sắc chân thực với độ tương phản cao.\r\nKhả năng tự động cân bằng trắng sử dụng trong tất cả các chế độ chụp và hoạt động hiệu quả trong nhiều nguồn sáng ngay cả với đèn sợi đốt.\r\nChất lượng video của J1 rất tốt, đặc biệt khi xem lại trên màn hình máy tính, màu sắc hiển thị trung thực với độ phân giải cao. Những đoạn video tốc độ chậm 400 và 1200 khung hình/giây cho hiệu ứng thú vị, đạt tỉ lệ 08:03 với chất lượng video HD sắc nét.\r\nKhả năng khử nhiễu của J1 ở mức trung bình, máy khử nhiễu khá tốt đến ISO 400, nhưng đến ISO 800 và 1600 hình ảnh xuất hiện nhiều hạt nhiễu và bắt đầu mất một vào chi tiết nhỏ. Đến ISO 3200, hạt nhiễu xuất hiện nhiều và dễ dàng thấy màu sắc sai lệch và mất nhiều chi tiết của hình ảnh.\r\nVề tuổi thọ pin, Nikon cho thông số 230 kiểu ảnh cho pin sạc đầy, một con số khá khiêm tốn với máy ảnh ống kính rời. Và kết quả chúng tôi dùng thử J1, pin máy cung cấp năng lượng cho là 213 kiểu ảnh với 20 video trung bình 20 giây không sử dụng đèn flash. Do vậy, với những buổi dã ngoại, đi chơi dài và quay video nhiều, bạn nên có một pin dự phòng để tránh gián đoạn cuộc vui.\r\n\r\nSản phẩm hoạt động hoàn hảo, ống kính không xước mốc rễ tre.\r\nPhụ kiện kèm theo: Pin, sạc, thẻ nhớ, dây đeo, cáp kết nối máy tính.\r\nBao test 7 ngày, đổi trả nếu xảy ra lỗi kĩ thuật của nhà sản xuất.\r\nBảo hành 3 tháng.\r\n JN Camera', 1, 122.83, '2022-12-03 10:34:06', '2022-12-03 10:34:06'),
(124, 1, 11, 'Skin 3M dán full body cho máy ảnh canon eos R5 , Eos R6', 'https://cf.shopee.vn/file/517ee03664c9ea5fd07146430a55cdd8', 'Skin 3M dán full body cho máy ảnh canon eos R5 , Eos R6\r\n\r\nSản phẩm : dán full body máy , không bao gồm Lens\r\n\r\nskin dán full body máy ảnh các dòng canon …. Skin 3M vân nổi cực đẹp , Độ bền cao, khả năng bám dính cực tốt.\r\n\r\nLớp đế keo công nghệ Mỹ, an toàn tuyệt đối cho máy ảnh, không để lại keo khi bóc.\r\nĐược thiết kế chuẩn cho từng dòng máy, cực dễ dán, có thể tự dán tại nhà 1 cách dễ dàng\r\n\r\nMiếng dán thiết kế theo kích thước máy ảnh: có thể cắt theo kích thước từng dòng máy ảnh, in hình theo yêu cầu khách hàng', 886, 9.35, '2022-12-03 10:34:06', '2022-12-03 10:34:06'),
(125, 1, 11, 'Máy quay kỹ thuật số cầm tay HD 1080P 16X HD 1080P', 'https://cf.shopee.vn/file/94fefdca714696319eeca587efc4eff5', 'Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\r\n\r\nGói hàng bao gồm:\r\n1 * Máy ảnh kỹ thuật số\r\n1 * Cáp dữ liệu\r\n1 * Nắp ống kính\r\n1 * Hướng dẫn sử dụng\r\nThông tin sản phẩm:\r\nĐặc trưng:\r\nThông tin và thông số của cảm biến CMOS, lên đến 16 triệu điểm ảnh\r\nPhương tiện lưu trữ có thể được mở rộng thành thẻ SD 32 gb / thẻ HCSD\r\nĐộ nhạy tự động, ISO100 ISO200, ISO400\r\nỐng kính cố định F / 3.2, F = 7.6 mm\r\n1,2 m - phạm vi lấy nét vô cực\r\nHình ảnh tĩnh jpeg / VGA, 1 m, 3 m, 5 m và 12 m, 16 m (nội suy)\r\nClip AVI 1080 p, 720 p VGA\r\nZoom kỹ thuật số 16x, thu phóng\r\nHỗ trợ chức năng ổn định hình ảnh\r\nĐèn LED chiếu sáng phạm vi đóng / mở <1,0 m\r\nTự động cân bằng trắng / nắng / nhiều mây / đèn / đèn huỳnh quang\r\nBù phơi sáng - 2.0 + / 2.0\r\nNghỉ ngơi / 2 giây 5 giây / 10 giây\r\nGiao diện usb máy tính (tốc độ cao)\r\nTự động tắt máy / 1/3/5/10 phút\r\nMô tả sản phẩm:\r\nĐặc trưng:\r\nThông tin và thông số của cảm biến CMOS, lên đến 16 triệu điểm ảnh\r\nPhương tiện lưu trữ có thể được mở rộng thành thẻ SD 32 gb / thẻ HCSD\r\nĐộ nhạy tự động, ISO100 ISO200, ISO400\r\nỐng kính cố định F / 3.2, F = 7.6 mm\r\n1,2 m - phạm vi lấy nét vô cực\r\nHình ảnh tĩnh jpeg / VGA, 1 m, 3 m, 5 m và 12 m, 16 m (nội suy)\r\nClip AVI 1080 p, 720 p VGA\r\nZoom kỹ thuật số 16x, thu phóng\r\nHỗ trợ chức năng ổn định hình ảnh\r\nĐèn LED chiếu sáng phạm vi đóng / mở <1,0 m\r\nTự động cân bằng trắng / nắng / nhiều mây / bóng đèn / đèn huỳnh quang\r\nBù phơi sáng - 2.0 + / 2.0\r\nNghỉ ngơi / 2 giây 5 giây / 10 giây\r\nGiao diện usb máy tính (tốc độ cao)\r\nTự động tắt máy / 1/3/5/10 phút\r\nMicro tích hợp\r\nLoa tích hợp\r\n2,4 inch TFT - Màn hình LCD LCD (230000 pixel, 4: 3)\r\nĐầu ra video NTSC / PAL\r\nNguồn pin lithium ion NP - 5 c\r\nKích thước 115 (dài) X48 (cao) X50 (rộng) mm\r\nTrọng lượng khoảng 220 g', 3975, 17.00, '2022-12-03 10:36:36', '2022-12-03 10:36:36'),
(126, 1, 11, 'Inch TFT LCD Display 18MP 720P 8x Zoom HD Digital Camera Anti-Shake Camcorder Videos CMOS Micro Camera', 'https://cf.shopee.vn/file/a8deb02114c08ab0bcb9bbfe4f4f4351', 'Đặc điểm:\r\nMáy ảnh kỹ thuật số TFT LCD 2,7 \'\'TFT\r\nCảm biến CMOS 5 megapixel\r\nĐộ phân giải hình ảnh lên đến 18MP (4896x3672)\r\nĐộ phân giải video lên đến 1280x720 HD\r\nThu phóng kỹ thuật số 8 lần\r\nChống rung và giảm mắt đỏ, cân bằng trắng, phát hiện khuôn mặt và chức năng chụp nụ cười, v.v.\r\nHỗ trợ thẻ kỹ thuật số bảo mật bên ngoài lên đến 32GB (Không bao gồm thẻ kỹ thuật số bảo mật)\r\n\r\n\r\nMô tả:\r\nPhần mềm ảnh để quản lý và nâng cao ảnh, in ấn, gửi ảnh bằng e-mail và nhiều hơn nữa.\r\nĐa ngôn ngữ: tiếng Anh, tiếng Nga, tiếng Tây Ban Nha, tiếng Ba Lan, tiếng Bồ Đào Nha, tiếng Pháp, tiếng Hà Lan, tiếng Ả Rập &amp; Tiếng Trung Quốc\r\nChụp nhanh, tiếp tục chụp, Tích hợp đèn Flash.\r\n\r\n\r\nThông tin chi tiết:\r\nĐộ phân giải video: 1280x720 HD, 640x480 VGA, 320x240 QVGA\r\nMàn hình LCD: Màn hình LCD TFT 2,7 inch\r\nBộ nhớ ngoài: Thẻ nhớ kỹ thuật số an ninh (lên đến 32GB, không bao gồm thẻ)\r\nThu phóng kỹ thuật số: Thu phóng kỹ thuật số 16 lần\r\nPhơi sáng: EV-3 --- EV + 3\r\nCân bằng trắng: Tự động / Ngày / Mây / Vonfram / Huỳnh quang\r\nCảnh: Tự động / Chân dung ban đêm / Cảnh đêm / Chân dung / Phong cảnh / Bãi biển / Độ nhạy cao\r\nIso: Tự động / 100/200/400\r\nHẹn giờ tự động: 2 giây, 5 giây hoặc 10 giây trễ\r\nĐịnh dạng tệp: Định dạng JPEG (hình ảnh vẫn) / định dạng AVI\r\nChống rung: hỗ trợ\r\nĐèn Flash: Tự động / Đèn Flash cưỡng bức / Tắt đèn Flash / Giảm mắt đỏ\r\nIn trực tiếp: Hỗ trợ\r\nƯu tiên cho khuôn mặt: Hỗ trợ\r\nChụp gạch: Hỗ trợ\r\nBắn liên tục: Hỗ trợ (VGA 6PCS)\r\nCổng: USB 2.0\r\nYêu cầu hệ thống: cho XP / VISTA / 7 / MAC\r\nPin: Pin Lithium-ion (550mA)\r\nNhiệt độ hoạt động: 0-40 ℃\r\nĐầu vào bộ chuyển đổi: 100-240V AC 50 / 60HZ 0,15A\r\nĐầu ra bộ chuyển đổi: 5V DC 1500mA\r\nMàu: Đen, Bạc, Đỏ\r\nKích thước: xấp xỉ. 100 * 65 * 18mm\r\n\r\n\r\nGói hàng bao gồm:\r\n1x máy ảnh kỹ thuật số\r\n1x Hướng dẫn sử dụng\r\n1x Cáp dữ liệu1x pin Lithium\r\n1x Túi máy ảnh\r\n1x dây đeo treo\r\n\r\n\r\nLưu ý:\r\n1. Do sự khác biệt giữa các màn hình khác nhau, hình ảnh có thể không phản ánh màu sắc thực tế của sản phẩm. Chúng tôi đảm bảo phong cách giống như trong hình ảnh.\r\n2. Do kỹ thuật đo lường cá nhân là khác nhau, có thể có 0-1cm sai số của vật lý. Cảm ơn bạn!', 2997, 23.38, '2022-12-03 10:36:36', '2022-12-03 10:36:36'),
(127, 1, 11, 'Máy ảnh film pns Pentax Espio 125M', 'https://cf.shopee.vn/file/4490a8dbab8807e3024fb6eb80089422', '📸 Pentax Espio 125M giá chỉ 750K\r\n- Máy ngoại hình đẹp. Máy không lên màn hình hiển thị, các chức năng khác hoạt động bình thường, lens đẹp, flash nhạy.\r\n🔋 Máy sử dụng Pin CR123A\r\n💰 Giá: 750K\r\n➖➖➖➖➖➖➖➖➖➖\r\n📌 Máy mua tại tiệm được bảo hành 1 tháng.\r\n✈️ Ship COD toàn quốc hoặc mua trực tiếp tại Hải Phòng\r\n☎️ 033.219.7742', 4, 31.88, '2022-12-03 10:48:18', '2022-12-03 10:48:18'),
(128, 1, 11, 'Camera SLR Kĩ Thuật Số Siêu Mỏng Hd 1080p Slr 4k Dv 2.4 Inch Zoom 16x', 'https://cf.shopee.vn/file/f5660d8aefd5f53229addc30e2db58ca', 'Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\r\n\r\nĐặc trưng:\r\n Camera HD\r\n Camera này có cảm biến CMOS 16 megapixel, ống kính hồng ngoại và màn hình 2,4 inch TFT LCD 320 * 240 pixel. Có hiệu ứng rõ ràng và mang đến cho bạn trải nghiệm khác biệt.\r\n Định dạng video Camera\r\n AVI, độ phân giải video: 1280 * 720/720 * 480/640 * 480/320 * 240, định dạng ảnh: JPEG, độ phân giải ảnh: 12M (4000 * 3000) / 5M (2592 * 1944) / 3M (2048 * 1536) / 1M (1024 * 768) / VGA (640 * 480).\r\n An toàn để sử dụng\r\n Có chức năng ngắt điện tự động. Được cung cấp bởi gói pin lithium hoặc 4 pin AA (không có sẵn pin), zoom kỹ thuật số 16x, chức năng webcam.\r\n Ứng dụng rộng rãi\r\n Camera có thể đáp ứng nhiều nhu cầu chụp ảnh khác nhau bằng cách kết nối các lens khác nhau (được bán riêng). Bạn có thể gắn Camera này lên tripod.\r\n Thiết kế di động siêu nhẹ\r\n Đi kèm với một dây đeo Camera để bạn có thể mang theo khi đi nghỉ hoặc di chuyển. Kích thước di động giúp trẻ mới biết đi hoặc người cao tuổi của bạn dễ dàng sử dụng vòng đeo cổ để tránh vô tình làm rơi.\r\n Thông tin chi tiết: \r\n Loại sản phẩm : Camera SLR kỹ thuật số\r\n Số lượng: 1\r\n Chất liệu:\r\n Nhựa\r\n Màu sắc:  đen\r\n Pixel hiệu ứng: 16 triệu\r\n Hệ số zoom quang học: zoom kỹ thuật số 16x\r\n Hệ số zoom kỹ thuật số: 16 lần\r\n Độ phân giải tối đa: 1280 * 720\r\n Kích thước màn hình LCD: 2,4 inch TFT\r\n Phương tiện lưu trữ: thẻ SD\r\n Giao diện dữ liệu: USB2.0\r\n Chất liệu: Nhựa\r\n Loại pin: pin AA (KHÔNG bao gồm)\r\n Định dạng video: AVI\r\n Định dạng ảnh: JPGET\r\n Đầu ra TV: NTSC-30fps / PAL-25fps\r\n Kích thước: 11,5 * 11 * 8,2cm / 4,52 * 4,32 * 3,22 inch\r\n Khối lượng tịnh: 300.0g / 10.58\r\n \r\n \r\n \r\n Gói hàng bao gồm: \r\n \r\n 1 * Camera SLR kỹ thuật số\r\n 1 * Hướng dẫn sử dụng\r\n 1 * cáp USB\r\n \r\n \r\n \r\nLưu ý: \r\n Chuyển đổi: 1 cm = 10 mm = 0.39 inch\r\n 1. Do sự khác biệt về ánh sáng và màn hình, màu sắc của mặt hàng có thể hơi khác so với hình ảnh.\r\n 2. Xin vui lòng cho phép sự khác biệt 0,5-2 cm do đo lường thủ công.', 912, 21.04, '2022-12-03 10:48:18', '2022-12-03 10:48:18'),
(129, 1, 11, 'Bộ máy ảnh canon 450D kèm ống kính', 'https://cf.shopee.vn/file/1e18e25a7457fb808c78db058a989cc0', 'Bao test 7 ngày, đổi trả nếu xảy ra lỗi kĩ thuật của nhà sản xuất.\r\n\r\nBH: 3 tháng\r\n\r\n JN Camera\r\n\r\nLH Tư Vấn : 0️⃣8️⃣2️⃣5️⃣2️⃣9️⃣3️⃣4️⃣5️⃣6️⃣\r\n\r\nz.a.l.0:0️⃣8️⃣2️⃣5️⃣2️⃣9️⃣3️⃣4️⃣5️⃣6️⃣\r\n\r\nĐ/c: Số 25 ngõ 278 Thái Hà, Phường Trung Liệt, Quận Đống Đa, Hà Nội\r\n\r\n\r\n\r\nTÍNH NĂNG NỔI BẬT\r\n\r\nXin giới thiệu một số điểm khác biệt đáng kể của Canon 450D so với các đối thủ khác cũng như người anh 400D.\r\n\r\n1 - Cảm biến hình độ phân giản lớn hơn: 12.4Mp\r\n\r\nCảm biến 12.4Mp này với bộ xử lý ảnh 14Bit về lý thuyết sẽ cho ảnh đẹp và mượt mà hơn.\r\n\r\n\r\n\r\n2 - Sử dụng SD hay SDHC thay cho CF:\r\n\r\nĐây là dòng DSLR đầu tiêu của Canon sử dụng SD thay cho CF. Việc dùng SD tiết kiệm được không gian cũng như giúp người dùng dễ dàng mua thẻ hơn do SD thì phổ biến và giá rẻ hơn là CF.\r\n\r\n\r\n\r\n3 - Ống ngắm rộng hơn(thị trường lớn hơn)\r\n\r\nĐây được xem là cải tiến lớn của dòng DSLR bình dân. Tuy không sáng bằng các dòng máy chuyên và bán chuyên nhưng kích thước của ống ngắm 450D ngang ngửa với 30D.\r\n\r\n\r\n\r\n4 - Có chế độ ngắm trực tiếp qua LCD (Live View):\r\n\r\nĐây là máy ảnh bình dân đầu tiên trang bị ngắm qua LCD. Hệ thống ngắm Live View của Canon hoạt động dựa vào độ tương phản(Contrast) để lấy nét.\r\n\r\n\r\n\r\n5 - Thêm chức năng Spot Metering:\r\n\r\nCác dòng DSRL bình dân đời trước của Canon thường thiếu chức năng này. Canon 450D với Spot Metering giúp người dùng dễ dàng lấy nét hơn đặt biệt là khi chụp không tự động và khi ở khu vực có độ tương phải ánh sáng kém.\r\n\r\n\r\n\r\n6 - Chế độ tự chụp nhiều tấm:\r\n\r\nGiờ đây chế độ tự động chụp của Canon có thể giúp ra chụp nhiều tấm. Ví dụ khi ta xếp ngưòi thành hàng và chụp thì máy có thể chụp nhiều tấm liên tiếp mà không cần phải ra nhấn lại.\r\n\r\n\r\n\r\n7 - Màn hình LCD 3\"\r\n\r\nĐây cũng được xem là một cải tiến đáng kể nhất của Canon 450D. Tuy độ phân giải vẫn là 230,000 điểm ảnh nhưng thực đơn được thiết kế với gấp đôi số mục được nhìn thấy.\r\n\r\n\r\n\r\n8 - Tự động tối ưu hoá ánh sáng ảnh.\r\n\r\nNgay sau khi chụp thì máy sẽ tính toán ngay để cấn chỉnh bức ảnh sao cho có ánhs ánh sáng và độ tương phản tốt nhất.\r\n\r\n\r\n\r\n9 - Ưu tiên vùng sáng(Highlight Tone Priority).\r\n\r\nĐây lại là một tính năng lần đầu tiên có mặt trong dòng DSLR bình dân. Nó giúp máy lấy được nhiều chi tiết hơn ở vùng sáng, nhưng ngược lại lại làm năng nhiễu (noise) vùng tối.\r\n\r\n\r\n\r\n10 - Giảm nhiễu ở ISO cao:\r\n\r\nĐây là tính năng được lấy từ Canon 40D xuống. Với tính năng này được chọn thì những hình chụp ở ISO cao sẽ được xử lý để loại bỏ tối da nhiễu.\r\n\r\n\r\n\r\n11 - Bộ chuyển đổi tín hiệu 14bit.\r\n\r\nCanon 450D được trang bị bộ chuyển tín hiệu DIGIC III với 14bit. Trên lý thuyết thì tín hiệu sẽ được chuyển đổi từ analog sang số hoàn thiện hơn.\r\n\r\n\r\n\r\n12 - Menu:\r\n\r\nHệ thống Menu của 450D cũng làm gần như giống 40D nhằm tạo thoải mái và dễ dàng hơn cho người dùng khi tinh chỉnh máy. Màn hình khi ở chế độ Menu có thể chuyển đổi từ tông trắng sang đen và ngược lại giúp khi ra khu vực có cường độ ánh sáng cao có thể thấy rõ hơn và khi ở môi trường ánh sáng yếu sẽ không bị chói', 15, 118.58, '2022-12-03 10:50:29', '2022-12-03 10:50:29'),
(130, 1, 11, 'Bộ máy ảnh Mirrorless Nikon 1 J2 kèm ống kính Kit NIKKOR 10-30mm f/3.5–5.6VR', 'https://cf.shopee.vn/file/147602781b41554ff7b38fcfed738ebb', '- Máy ảnh không gương lật thế hệ hai của Nikon\r\n- Chất lượng ảnh DSLR trong thiết kế Compact thời trang\r\n- Cảm biến CX-CMOS độ phân giải 10.1 Megapixels\r\n- Tốc độ chụp liên tiếp 10 hình/giây khi lấy nét tự động\r\n- Trang bị bộ xử lý ảnh EXPEED 3 siêu nhanh\r\n- Hệ thống lấy nét tự động AF 73 điểm, ISO 100-6400\r\n- Quay phim Full-HD 1080p với âm thanh Stereo\r\n- Màn hình siêu nét 3” độ phân giải 460K\r\n- Ống kính kèm theo NIKKOR 10-30mm f/3.5–5.6VR\r\nSản phẩm hoạt động hoàn hảo, ống kính không xước mốc rễ tre.\r\nPhụ kiện kèm theo: Pin, sạc, thẻ nhớ, dây đeo, cáp kết nối máy tính.\r\nBao test 7 ngày, đổi trả nếu xảy ra lỗi kĩ thuật của nhà sản xuất.\r\nBảo hành 3 tháng.\r\nLiên hệ tư vấn và hỗ trợ 0.9.1.2.2.8.6.9.3.5', 1, 131.33, '2022-12-03 10:50:29', '2022-12-03 10:50:29'),
(131, 1, 11, 'Bộ máy ảnh Canon EOS 100D (Kiss X7) kèm ống kính Canon EF-S 18-55mm', 'https://cf.shopee.vn/file/82c158aeaa4711a9e64e4f447f5b6791', 'Canon đã đưa vào cảm biến CMOS APS-C kích thước 22,3 x 14,9 mm độ phân giải 18 megapixel, chip xử lý hình ảnh Digic 5, khả năng quay video chuẩn Full HD tốc độ 30 khung hình mỗi giây. Model này cũng sử dụng hệ thống lấy nét lai AF Hybrid kết hợp giữa lấy nét theo pha và tương phản. Tốc độ chụp liên tiếp của máy là 4 khung hình mỗi giây. Canon 100D hỗ trợ độ nhạy sáng ISO từ 100 đến 12.800, mở rộng lên mức 25.600. Tốc độ màn trập tối đa 1/4000 giây và tối thiểu là 30 giây. Kính ngắm quang có độ phủ 95% và hệ số phóng đại 0,87x. Đèn flash tích hợp có khoảng đánh xa 9,7 mét và tốc độ đồng bộ 1/200 giây.\r\nCanon 100D được trang bị hệ thống lấy nét lai 9 điểm tương tự như ở Canon 700D. Vị trí mặt sau của máy được đặt một màn hình 3\" cảm ứng đa điểm với độ phân giải cao, có khả năng hiển thị hình ảnh sắc nét.\r\nSản phẩm hoạt động hoàn hảo, ống kính không xước mốc rễ tre.\r\n\r\nPhụ Kiện : Pin ,Sạc ,Thẻ Nhớ , Dây Đeo , Cáp Kết  Nối Máy Tính\r\n\r\nBH: 3 tháng\r\n JN Camera\r\nLH Tư Vấn : 08.25.29.3456 \r\nz.a.l.0: 08.25.29.3456\r\nĐ/c: Số 25 ngõ 278 Thái Hà, Phường Trung Liệt, Quận Đống Đa, Hà Nội', 1, 258.83, '2022-12-03 10:53:42', '2022-12-03 10:53:42'),
(132, 1, 11, 'Máy ảnh Canon M50 kèm lens 15-45mm', 'https://cf.shopee.vn/file/395f644d9edea6e9fe2fa0e45ec82737', 'Canon EOS M50 được trang bị cảm biến APS-C CMOS 24.1MP\r\nMáy ảnh M50 được Canon trang bị cảm biến APS-C CMOS 24.1MP và bộ xử lý hình ảnh DIGIC 8 cho ISO từ 100-25600 và có thể mở rộng lên ISO 51200 phù hợp sử dụng với nhiều điều kiện ánh sáng khác nhau.\r\n\r\nCanon EOS M50 có khả năng quay video độ phân giải UHD 4K/24p, Full HD 1080/60p và HD 720/120p. Ngoài ra, bộ xử lý Digic 8 trên máy còn cho tốc độ chụp liên tiếp 10 fps/s, thời gian khởi động máy và thời gian delay giữa mỗi khung hình nhanh cho hiệu quả sử dụng tổng thể mượt mà và nhanh chóng.\r\n\r\nCông nghệ lấy nét Dual Pixel CMOS AF\r\nMặc dù là một chiếc máy ảnh mirrorless trong phân khúc phổ thông nhưng EOS M50 lại sở hữu công nghệ lấy nét tuyệt với của Canon là Dual Pixel CMOS AF cung cấp hiệu suất lấy nét mượt mà và nhanh theo cách tương tự như cách máy quay lấy nét.\r\n\r\nHệ thống này tích hợp 2 photodiod riêng biệt trong mỗi pixel để mang tới một mạng lưới rộng lớn và dày đặc các điểm lấy nét theo pha trên phần lớn cảm biến hình ảnh cho khả năng lấy nét nhanh hơn và chính xác hơn.\r\n\r\nThiết kế thân thiện của Canon EOS M50\r\nLà một mẫu máy ảnh Canon được thiết kế dành cho phân khúc người dùng phổ thông nên EOS M50 có giao diện và thiết kế rất dễ sử dụng, máy được cấu tạo từ hợp kim, nhựa tổng hợp cho cảm giác nhẹ và chắc chắn. Màn hình LCD 3 inch có cảm ứng và có thể lật nhiều góc khác nhau hỗ trợ chụp ảnh tự sướng hoặc quay vlog một cách dễ dàng, rất thích hợp cho các tín đồ hay đi du lịch.\r\n\r\nTính năng truyền dữ liệu không dây\r\nCác tính năng truyền dữ liệu không dây như Wi-Fi, NFC và Bluetooth cũng được trang bị trên chiếc máy này cho phép bạn dễ dàng chia sẻ ảnh và phim với thiết bị di động cũng như khả năng điều khiển từ xa thông qua ứng dụng của Canon.\r\n\r\nĐi kèm với Body EOS M50 là ống kính Kit EF-M 15-45mm f/3.5-6.3 IS STM phù hợp với nhiều thể loại ảnh chụp như phong cảnh, đồ ăn, trẻ em, du lịch. Kích thước nhỏ gọn cùng tiêu cự linh hoạt sẽ hỗ trợ tốt cho những người mới lần đầu sử dụng máy ảnh.\r\n\r\nNếu bạn đang tìm kiếm một chiếc máy ảnh nhỏ gọn, thời trang và dễ sử dụng cho nhiều mục đích khác nhau thì Canon EOS M50 là một lựa chọn đáng để bạn cân nhắc.\r\n\r\nLƯU Ý, đây là máy đã qua sử dụng hàng trưng bày tại shop', 1, 615.83, '2022-12-03 10:53:42', '2022-12-03 10:53:42'),
(133, 1, 12, 'Set 2 khăn tắm + khăn mặt gấu hồng LOTSO', 'https://cf.shopee.vn/file/65d425c9bd736c07ac7a839e634080d0', 'Chất liệu: san hô lông cừu\r\n\r\nThủ công sợi: sợi pha\r\n\r\nThông số kỹ thuật của sợi: 32 phần\r\n\r\nQuy trình sản xuất: dệt trơn\r\n\r\nTrọng lượng: 425g\r\n\r\nHấp thụ nước: 5s-10 giây\r\n\r\nMàu sắc: [khăn đơn] trắng, [khăn đơn] hồng, [khăn tắm đơn] trắng, [khăn tắm đơn] hồng, [khăn tắm + khăn tắm 2 cái] trắng, [khăn tắm + khăn tắm 2 chiếc] màu hồng, [khăn tắm Bộ khăn tắm] màu trắng, [bộ khăn tắm khăn tắm] màu hồng\r\n\r\nThông số kỹ thuật (chiều dài * chiều rộng cm)\r\n\r\nChiều dài * chiều rộng (CM): khăn 35 * 75cm, khăn tắm 70 * 140cm', 1192, 3.78, '2022-12-03 10:57:35', '2022-12-03 10:57:35'),
(134, 1, 12, 'Mũ gội đầu chắn nước bảo vệ tai cho bé 0 - 6 tuổi, có thể điều chỉnh vòng đầu', 'https://cf.shopee.vn/file/7194e459f50e5a9f747fa7a3f0d4500b', '✔️ Đặc điểm\r\n➖ Mũ gội đầu giúp chắn nước vào mắt vào tay bé, giúp bé thích thú khi tắm.\r\n➖ Mũ gội đầu làm từ xốp EVA:\r\n     + Mũ gội đầu mềm mại, có 4 mức điều chỉnh phù hợp cho bé từ 0 - 6 tuổi.\r\n     + Mũ gội đầu thiết kế bằng xốp EVA bền và thân thiện với môi trường.\r\n     + Kích thước 28x30cm.\r\n➖ Mũ gội đầu làm từ nhựa PP và TPE:\r\n    + Mũ gội đầu bằng nhựa PP và TPE mềm mại, có khóa điều chỉnh vòng đầu phù hợp cho bé từ 0 - 6 tuổi.\r\n    + Kích thước 28x28cm.\r\n\r\n✔️ Bora cam kết:\r\n➖ Đổi hàng miễn phí và ngay lập tức nếu sản phẩm có lỗi từ nhà sản xuất.\r\n\r\n✔️ Thông tin liên hệ:\r\n➖ SĐT: 0386.987.088 - 0369.987.088.\r\n➖ Website: https://www.bora.vn/\r\n➖ Fanpage: https://www.facebook.com/www.bora.vn/\r\n', 1713, 1.49, '2022-12-03 10:57:35', '2022-12-03 10:57:35'),
(135, 1, 12, 'Nón bảo hiểm 3/4 Tiroshi chính hãng, mũ bảo hiểm cao cấp thời trang thoáng khí, bảo vệ đầu chống va đập', 'https://cf.shopee.vn/file/ab70a32a019dd46ae1b9012a9469fae0', 'Mũ bảo hiểm 3/4 đầu ôm trọn đầu và vùng mặt chính hãng TIROSHI nhiều màu kèm kính UV, nón bảo hiểm 3/4 Freesize.\r\nNón bảo hiểm 3/4 Tiroshi đầu màu trơn nhiều màu là sản phẩm đang bán chạy tại TIROSHI, TIROSHI tin rằng đây là chiếc Mũ bảo hiểm 3/4 Tiroshi đầu  đi chơi, đi phượt hot nhất trên thị trường VIỆT NAM.\r\n\r\nMũ bảo hiểm 3/4 Tiroshi Form mũ được thiết kế vừa vặn với chuẩn chung đầu người Việt Nam nón bảo hiểm 3/4 Tiroshi\r\n- Mũ bảo hiểm 3/4 Tiroshi có lớp xốp được ép nhiệt dày hơn khoảng 1 cm nên mũ chắc tay cứng, vừa vặn bám chặt với phần vỏ giúp triệt tiêu hoàn toàn xung lực mạnh từ bên ngoài tác động vào, giảm chấn hiệu quả tối đa, ôm trọn vòng đầu. \r\n- Mũ bảo hiểm 3/4 Tiroshi với lớp vải lót bên trong là lớp vải cao cấp, chất lượng cao, ưu điểm nổi trội khác với các loại mũ rẻ tiền là thấm hút mồ hôi tốt\r\nThông tin về mũ bảo hiểm 3/4 Tiroshi của TIROSHI :Nón bảo hiểm 3/4 Tiroshi\r\n- Nón bảo hiểm 3/4 Tiroshi (vỏ nón): Chất chính phẩm chịu được sự va đập mạnh và đâm xuyên caon  .\r\n- Màu sắc: Nhiều màu\r\n- Trọng lượng: 800gr.\r\n Một bộ sản phẩm bao gồm: Nón bảo hiểm 3/4 Tiroshi - Có thể mua kèm kính hoặc lưỡi trai\r\n Khách hàng Nên kết hợp với Kính UV400 ,mũ sẽ có thẩm mỹ tốt hơn\r\n Lớp vải lót bên trong được may nhiều sợi dù đảm bảo khi đội đầu sẽ không quá nặng và cảm giác thoải mái khi chạy xe.\r\n Phù hợp với đi làm, đi chơi, đi phượt. Mũ bảo hiểm 3/4 Tiroshi\r\n Nón bảo hiểm 3/4 Tiroshi\r\nTIROSHI SHOP CAM KẾT:\r\nMũ bảo hiểm nửa đầu màu trơn 100% giống mô tả. Hình ảnh sản phẩm là ảnh thật do shop tự chụp và giữ bản quyền hình ảnh\r\nĐảm bảo chất lượng 100%\r\nMũ bảo hiểm nửa đầu được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách\r\nVới sứ mệnh đem lại sự an toàn và thẩm mỹ đến mọi gia đình. Sự hài lòng của khách hàng là niềm vui của Mũ bảo hiểm 3/4 Tiroshi', 1025, 3.95, '2022-12-03 11:00:45', '2022-12-03 11:00:45'),
(136, 1, 12, 'Tem rời sirius mẫu zin + tem 3 lớp+ 50cc -110cc', 'https://cf.shopee.vn/file/288565f66b3313489d30b26565d2cbe5', '- Chất liệu decal PVC chống thấm nước\r\n- bảo hành phai màu chọn đời \r\n-  bóc tem không ảnh hưởng sơn xe\r\n- Công nghệ in trên máy cắt bế mimaki của nhật cho màu tem bắt mắt, sắc nét từng chi tiết\r\n- sử dụng đơn giản\r\n- Tem có nhều lựa chọn màu sắc', 25478, 2.93, '2022-12-03 11:00:45', '2022-12-03 11:00:45'),
(137, 1, 12, 'Đèn trợ sáng l4 Ngắn 3 chế độ Sáng tặng kèm công tắc + ốc gương', 'https://cf.shopee.vn/file/9333718177084741453e981cfc6dfff8', 'Đèn trợ sáng l4 Ngắn 3 chế độ Sáng tặng kèm công tắc + ốc gương\r\n- có phần loại : đèn ko phụ kiện : đèn + pát chân đèn\r\n                         Đèn đủ phụ kiện : đèn + pát chân đèn + công tắc + ốc gương mặt cười\r\n                         Đèn đủ phụ kiện + Len : đèn + pát chân đèn + công tắc + ốc gương mặt cười + Len vàng phá sương\r\nsản phẩm bán ra bảo hành 6 tháng, chống nước', 2303071, 2.12, '2022-12-03 11:04:14', '2022-12-03 11:04:14'),
(138, 1, 12, '', 'https://cf.shopee.vn/file/b5f8e171f2e64976e77f6faaf7460a41', 'Đèn trợ sáng l4 Ngắn 3 chế độ Sáng tặng kèm công tắc + ốc gương\r\n- có phần loại : đèn ko phụ kiện : đèn + pát chân đèn\r\n                         Đèn đủ phụ kiện : đèn + pát chân đèn + công tắc + ốc gương mặt cười\r\n                         Đèn đủ phụ kiện + Len : đèn + pát chân đèn + công tắc + ốc gương mặt cười + Len vàng phá sương\r\nsản phẩm bán ra bảo hành 6 tháng, chống nước', 460482, 2.12, '2022-12-03 11:04:14', '2022-12-03 11:04:14'),
(139, 1, 12, 'Máy lọc nước 2 vòi Nóng Nguội AQuausan mẫu mới 2022', 'https://cf.shopee.vn/file/6b45b19a1742ac21a10885cf1fb3a71e', 'shop vận chuyển đã tối ưu lên rẻ nhất sàn lên anh chị mua hàng rẻ nhất sàn rồi ạ a chị cứ mang so sánh nhé,\r\nta_toyyv giá tốt phí vận tốt nhé\r\nMáy lọc nước AQuausan\r\n– Màng RO  AQuausan Chính Hãng\r\n– Bơm hút \r\nLưu ý trên tìm đến các đại lý chính hãng để tránh mua phải hàng giả.\r\n\r\n Chúng tôi nhà phân phối chính hãng sản phẩm máy lọc nước AQuausan được nhiều khách hàng đánh giá tốt bởi nó có một số tính năng vượt trội hơn các dòng máy thông thường.\r\n– Bơm hút đẩy  Có thể hút bể âm độ sâu 2m và đẩy khỏe 120-135 PSI giúp cho quá trình lọc diễn ra nhanh hơn đạt hiệu quả cao hơn.\r\n\r\n– Màng RO AQuausan Chính hãng: Đối với 1 chiếc bơm khỏe thì cần phải có một màng lọc tốt cân xứng, Màng RO đạt công xuất lọc 15L/H gấp đôi so với các máy lọc thông thường khác.\r\n\r\nMáy lọc nước AQuausan về Việt Nam liên doanh xản xuất đã có nhiều cải tiến phù hợp gần gũi với môi trường, khí hậu, nguồn nước VIỆT NAM\r\n\r\nĐặc điểm nỗi bật sản phẩm máy lọc nước AQuausan 9 cấp lọc\r\n+ Chức năng lọc sạch tuyệt đối Asen \r\nThông tin chi tiết các lõi lọc.\r\n1. Lõi lọc số 1: LõiPP , khe lọc 05micron\r\n–  Chức năng: Loại bỏ tạp chất thô có kích thước lớn hơn 05 micron, các loại bùn đất, rỉ sét, kim loại nặng\r\n– Tuổi thọ: 3 ~ 6 tháng (Tùy thuộc vào nguồn nước và lượng sử dụng)\r\n\r\n2. Lõi lọc số 2:\r\n– Nguyên liệu: Than hoạt tính dạng hạt\r\n– Chức năng: Hấp phụ kim loại nặng, chất hữu cơ, chất tẩy rửa, các loại hóa chất độc hại …\r\n– Tuổi thọ: 6 ~ 9 tháng (Tùy thuộc vào nguồn nước và lượng sử dụng)\r\n\r\n3. Lõi lọc số 3:\r\n– Nguyên liệu: Sợi PP có khe lọc 1 micron\r\n– Chức năng: Loại bỏ bùn đất, rỉ sét, các loại tạp chất thô, kim loại nặng … có kích thước > 1 micron\r\n– Tuổi thọ: 6 ~ 9 tháng  (Tùy thuộc vào nguồn nước và lượng sử dụng)\r\n\r\n4. Lõi lọc số 4 ( màng R/O nhập khẩu nguyên chiếc từ Nhật Bản ):\r\n– Nguyên liệu: Màng RO thẩm thấu ngược, có khe lọc đạt 0,0001 micron\r\n– Chức năng: Loại bỏ hoàn toàn chất rắn, khí hoàn toàn trong nước, các Ion kim loại nặng, vi sinh vật, vi khuẩn, siêu vi khuẩn, các chất hữu cơ làm cho nước trở nên hoàn toàn tinh khiết\r\nTốc độ lọc 20 lít/ giờ, tiết kiệm nước thải\r\n\r\n5. Lõi lọc số 5:\r\n– Nguyên liệu: Than hoạt tính dạng xốp nén tích hợp vật liệu Nano Bạc\r\n– Chức năng: Cân bằng PH, khử mùi hôi, tạo khoáng và vị ngọt của nước,  và các loại nấm trong nước\r\n\r\n6. Lõi lọc số 6:\r\n– Nguyên liệu: Đá Maifan\r\n– Chức năng: Tạo 45 khoáng chất cơ bản – Rất cần thiết cho cơ thể\r\n\r\n7. Lõi lọc số 7:\r\n– Nguyên liệu: Hạt bóng gốm\r\n– Chức năng: Bức xạ hồng ngoại, tách nhóm phân tử nước, tăng lượng oxy cho nước giúp nước lưu thông dễ dàng trong cơ thể, giảm quá trình lão hóa và tránh khô da\r\n\r\n8. Lõi lọc số 8:\r\n– Nguyên liệu: Alkanline\r\n\r\n9. lõi lọc số 9 : diệt khuẩn', 929151, 131.75, '2022-12-03 11:06:48', '2022-12-03 11:06:48'),
(140, 1, 12, 'Máy hút bụi cầm tay - Máy hút không dây lực hút siêu mạnh sử dụng pin sạc, dùng hút bụi ô tô, bụi giường thảm vv.', 'https://cf.shopee.vn/file/cc619a9a5537422bba96575c46ca84d9', 'Máy hút bụi cầm tay - Máy hút  không dây lực hút siêu mạnh sử dụng pin sạc,\r\nChi tiết máy hút bụi cầm tay không dây siêu mini EASYR✨\r\n✅Chất liệu: Nhựa ABS cao cấp có độ bền cao chống va đập tốt, phần trên là nhựa trong suốt giúp bạn dễ dàng quan sát lượng bụi bẩn để biết và vệ sinh lưới lọc\r\n✅Lõi lọc: đạt chuẩn HEPA, có thể tái sử dụng nhiều lần\r\n✅Lực hút: 6000Pa\r\n✅Công suất: 120W\r\n✅Pin: Lithium 2000Mah\r\n✅Động cơ: Turbine phản lực 2 chiều\r\n✅Bản sạc: USB\r\n✅Kích thước: 16.5cm x 14.5cm x 4cm\r\n✅Màu sắc: Trắng & Đen\r\n✅Dung tích khoang chứa: 0.3L\r\n✅Trọng lượng: 400gr\r\n✅Có trang bị đèn LED\r\n✅Đầu nối: 1 đầu dài + 1 đầu chổi \r\n✅Máy hút bụi cầm tay không dây siêu mini EASYR phiên bản nâng cấp 2021 chỉ nhỏ gọn bằng 1 chiếc Iphone không chiếm nhiều diện tích, thiết kế thông minh, dễ dàng hút sạch mọi ngóc ngách, góc tường, sofa, giường, thảm, bụi, lông thú cưng, bàn phím, máy tính, tàn thuốc, sỏi cát, hạt,..\r\n\r\n✨Lưu ý✨\r\n✅Nên sạc đầy pin trước khi sử dụng để đạt hiệu quả tốt nhất👍\r\n✅Lõi sau khi rửa phải phơi khô ráo triệt để trước khi lắp vào máy\r\n\r\n✨Ưu điểm sản phẩm✨\r\n✅Thiết kế không dây cực tiện lợi, sạc bằng đầu USB\r\n✅Hút được bề mặt khô và nước\r\n✅Có trang bị thêm đèn LED thông minh để dễ dàng soi được bụi bẩn mọi ngóc ngách như góc giường, góc tường,...\r\n✅Sử dụng đơn giản, thiết kế không dây nhỏ gọn nên dễ dàng mang theo, không chiếm nhiều không gian\r\n✅Tiết kiệm gấp nhiều lần so với các sản phẩm tương đồng\r\n✅Nhỏ hơn các dòng máy không dây cầm tay trên thị trường gấp 5 lần nên dễ dàng tháo lắp, vệ sinh\r\n\r\n✨Chế độ bảo hành - cam kết✨\r\n✅Bảo hành 1 đổi 1 trong vòng 12 tháng nếu như sản phẩm có vấn đề về chất lượng\r\n✅Cam kết sản phẩm như hình, có phiếu bảo hành, phiếu lưu ý sử dụng, bao bì và sản phẩm khắc logo  EASYR 100% để tránh hàng nh,ái trôi nổi\r\n✅Quà tặng kèm đầy đủ\r\n✅Hàng hóa được đóng gói cẩn thận trước khi giao\r\n✅Đổi trả sản phẩm trong vòng 7 ngày nếu không vừa ý', 46, 4.50, '2022-12-03 11:06:48', '2022-12-03 11:06:48'),
(141, 1, 12, 'Kính Mát Gọng Vuông Lớn Chống Ánh Sáng Xanh Thời Trang Hàn Quốc', 'https://cf.shopee.vn/file/d83176b84d66aa562432e86498d4e592', 'Mô tả Sản phẩm:\r\nTình trạng sản phẩm: Còn mới                            \r\nChất liệu: pc + kính\r\nKích thước: Chiều rộng khung: 145mm\r\n           Chiều dài đền: 143mm\r\n           Chiều cao ống kính: 40mm \r\n           Chiều rộng ống kính: 47mm\r\n           Khoảng cách mũi: 18mm\r\nMàu sắc: Như hình ảnh hiển thị\r\nTrọn gói: 1 Pc\r\n\r\nLưu ý:\r\n️ Do chênh lệch cài đặt ánh sáng và màn hình, màu sắc sản phẩm có thể hơi khác so với hình ảnh.\r\nNếu bạn có bất kỳ câu hỏi nào về mặt hàng, xin vui lòng cho tôi biết.\r\nSự hài lòng của bạn là ưu tiên của chúng tôi!', 1450, 0.30, '2022-12-03 11:09:10', '2022-12-03 11:09:10'),
(142, 1, 12, 'Vòng Đeo Tay Mặt Gấu Trong Suốt Ba Chiều Thời Trang Hàn Quốc', 'https://cf.shopee.vn/file/71108cd7962d1ddc998503e750a8eb73', 'Phong cách: Đơn giản\r\n\r\nChất liệu: hợp kim\r\n\r\n\r\n\r\nKhông phai\r\n\r\n\r\n\r\nĐược thiết kế với đường nét nữ tính trẻ trung, sống động, mạnh mẽ, sản phẩm này giúp các bé gái của chúng ta đứng ra ngoài khi họ hẹn hò các bữa tiệc thư giãn với bạn bè.\r\n\r\n\r\n\r\nGhi chú\r\n\r\n1. Do điều kiện ánh sáng và chụp, màu sắc thực tế của mặt hàng có thể hơi khác so với hình ảnh, cảm ơn bạn đã thông cảm.\r\n\r\n2. Đo lường thủ công có thể có sai số 1-3 cm.\r\n\r\n3. Bảo quản đồ trang sức ở nơi khô ráo, cố gắng không chạm vào nước. Điều này sẽ giúp kéo dài tuổi thọ của đồ trang sức.\r\n\r\n\r\n\r\nCảm ơn Bạn Rất Nhiều Vì Đã Ghé thăm Cửa Hàng Của Chúng Tôi Và Chúc Bạn Chúc Bạn Chúc Chúc Bạn Chúc Chúc Bạn Chúcạnh phúc.', 49704, 0.43, '2022-12-03 11:09:10', '2022-12-03 11:09:10'),
(143, 1, 12, 'Toàn Quốc [E-Voucher] Gói Netflix Premium HD/4K - Gói 3 tháng, 6 tháng và 12 tháng gói share', 'https://cf.shopee.vn/file/f58169047fc690a9d41ce2997d1468ed', 'Toàn Quốc [E-Voucher] Gói Netflix Premium HD/4K - Gói 3 tháng, 6 tháng và 12 tháng (gói share)\r\nĐiểm nổi bật:\r\n- Netflix là một dịch vụ phát trực tuyến theo đăng ký, cho phép các thành viên của chúng tôi xem các chương trình truyền hình và phim mà không bị quảng cáo làm phiền trên một thiết bị có kết nối Internet.   \r\n- Bạn cũng có thể tải các chương trình truyền hình và phim xuống thiết bị iOS, Android hoặc Windows 10 của mình để xem mà không cần kết nối Internet.\r\n\r\n* Điều kiện sử dụng:\r\n- Sau khi mua đơn thành công Shop gửi tài khoản đăng nhập vào app Netflix để Khách sử dụng (đây  là  tài  khoản  Share) nếu  khách có nhu cầu mua tài khoản riêng  không Share giá cao inbox Shop ạh\r\n- Thời gian hỗ trợ gửi tài khoản từ 8h sáng tới 17h chiều (giờ hành chánh)\r\n- Xem và đăng nhập trên 1 thiết bị (TV, ĐT, máy tính, ...), tất cả các phim trên app (hạn chế  đổi  thiết  bị)\r\n- Có nhiều gói dịch vụ cho Khách lựa chọn\r\n+ Gói 3 tháng\r\n+ Gói 6 tháng\r\n+ Gói 12 tháng\r\n- Khách lựa chọn gói phù hợp với nhu cầu và sau khi mua xong nhắn tin cho Shop và Shopee để được hướng dẫn sử dụng\r\n- Áp dụng xem tất cả các ngày không giới hạn trong gói đăng ký\r\n- Khách hàng áp dụng: Tất cả khách hàng\r\n- E-Voucher không có giá trị quy đổi thành tiền mặt, không trả lại tiền thừa, không được hoàn hủy.\r\n- Không áp dụng đồng thời với chương trình khuyến mại khác\r\n- Khi  đặt  đơn  xong  nhận  được  tài  khoản  không  được  đổi  trả  lại  với  bất  cứ  lý  do  nào. Shop  bảo  hành  suốt  thời gian sử dụng và đảm bảo người dùng được 100%\r\n\r\n* Quy  định  khi  dùng tài khoản Netflix (sharee) Shop cấp sau  khi  có  đơn: \r\n- Vào đúng tên Profile được Shop  cấp\r\n- Không đổi mật khẩu\r\n- Không đổi tên Profile\r\n- Không đặt mã mã pin khác\r\n- Không đổi giao diện\r\n- Không thêm hoặc xoá Profile người khác\r\n- Không đổi ngôn ngữ tiếng anh (vẫn có phụ đề tiếng Việt ở từng phim: nếu muốn thay đổi những thứ bên trên nhắn tin cho Shop trước - có thể đổi hoặc không thay đổi Shop báo hỗ trợ)\r\n- Chế độ bảo hành 1 đổi 1\r\n- Bảo hành đầy đủ ngày\r\n- Hỗ trợ nhiệt tình đổi tài khoản nhanh gọn (trừ lúc đi ngủ, hay đi đường) \r\n=> Suốt quá trình sử dụng nếu phát hiện vi phạm quy tắc. Shop từ chối bảo hành (Khách lưu  ý thực  hiện  đúng)\r\n\r\nHotline/zalo: 0902851949 - 0931407492', 356, 8.50, '2022-12-03 11:11:25', '2022-12-03 11:11:25'),
(144, 1, 12, 'Thẻ viettel 20k', 'https://cf.shopee.vn/file/b85efc7d0ec84354b2ed299ed5bd00f1', '1. Bước 1:\r\n- Bạn đặt hàng (thanh toán bằng ví shopee, thẻ ghi nợ, ví airpay hoặc thẻ ATM,…) trước khi shop nạp thanh toán.\r\n2. Bước 2: \r\n- Bạn cung cấp Số điện thoại muốn nạp để shop gửi mã thẻ trong phần ghi chú hoặc trong mục chát.\r\n- Thời gian nạp nhanh trong vòng 1 phút khi shop nhận được tin nhắn từ khách hàng.\r\n- Thời gian nạp chậm từ 1 ngày đến 6 ngày kể cả trả sau hoặc trả trước.\r\n- Thời gian nhận thẻ: từ 01 phút dến 10 phút Mã thẻ + Seri.\r\n3. Bước 3: \r\n- Shop sẽ nhắn cho bạn xác nhận lại Số điện thoại nhận mã thẻ. \r\n- Sau đó shop sẽ nạp trực tiếp hoặc nhắn mã thẻ cho bạn tùy ý bạn lựa chọn.\r\n- Bạn lưu ý là Shop sẽ không hoàn lại tiền với lý do sai số điện thoại, không phối hợp cung cấp mã otp cho shop, hoặc tự ý đổi mã viettel bạn nhé. \r\n- Sau khi Bạn nạp thành công, vui lòng ấn xác nhận đã nhận hàng và đánh giá shop nhé. Chân trọng cảm ơn.\r\nMọi thắc mắc hoặc muốn nhanh hãy gọi hoặc nhắn tin cho shop SĐT: 0866655576 hoặc zalo 0866655576. SĐT: 0986351790; zalo 0986351790', 3195, 0.85, '2022-12-03 11:11:25', '2022-12-03 11:11:25'),
